insert  into `aboutus`(`info_id`,`title`,`content`,`cat_attr`,`in_date`) values (61,'账户注册','<p>\r\n	<strong><span style=\"font-size:14px;\">天下名品网上商城注册有以下两种途径：</span></strong></p>\r\n<p>\r\n	<br />\r\n	<strong><span style=\"font-size:14px;\">1、网站注册</span></strong><br />\r\n	1.1、进入天下名品网站后，点击页面左上方&ldquo;注册&rdquo;，将出现新页面，在新页面中选择相应的注册方式（Email注册和手机号注册），根据提示内容输入注册账号、密码（密码设置不要过于简单）、手机号、验证码等，确认无误后点击&ldquo;同意以上条款并注册&rdquo;即可，注册用户名是唯一的。注册成功后，您可以到网站&ldquo;我的天下名品&rdquo;进行个人信息的更新。<br />\r\n	1.2在订购过程中注册开户，进入 天下名品- 选择您所需要的商品 - 点击放入购物车内 - 将出现新页面 - 在页面右侧点击&ldquo;注册&rdquo;进入注册页面。</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/5/4w26g5wgw5y532657614.png\" style=\"width: 650px; height: 120px;\" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/5/u81mqxhj8h4t64g7xp52.png\" style=\"width: 650px; height: 625px;\" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong><span style=\"font-size:14px;\">2、天下名品APP客户端注册</span></strong></p>\r\n<p>\r\n	<a href=\"http://mall.txmp.com.cn/aboutus/82.html\"><span style=\"color:#0000ff;\">详见天下名品APP客户端注册流程。</span></a></p>\r\n','3738448167,4732875731,','2014-11-02 15:05:52'),(62,'找回密码','<p>\r\n	<strong><span style=\"font-size:14px;\">天下名品商城为您提供密码找回功能，操作步骤如下：</span></strong></p>\r\n<p>\r\n	<br />\r\n	<span style=\"font-size:14px;\"><strong>1、输入用户名</strong></span><br />\r\n	找回密码需要先输入手机号和验证码后，点击下一步；</p>\r\n<p>\r\n	<br />\r\n	<span style=\"font-size:14px;\"><strong>2、验证身份</strong></span><br />\r\n	选择相应找回渠道后，点击获取验证码，请您到您相应的邮箱或手机短信中查看验证码，输入无误后点击下一步；</p>\r\n<p>\r\n	<strong><span style=\"font-size:14px;\">3、重置密码</span></strong><br />\r\n	填写您所能记住的新的密码，提交完成即可。</p>\r\n<p>\r\n	图片示例如下：</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/5/8sk13g62431v3cet6bff.jpg\" style=\"width: 600px; height: 280px;\" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n','3738448167,4732875731,','2014-11-02 15:06:26'),(63,'我的天下名品','<p>\r\n	<strong><span style=\"font-size:14px;\">&ldquo;我的天下名品&rdquo;为您提供账户管理、商品管理和个人信息管理等服务。</span></strong></p>\r\n<p>\r\n	<br />\r\n	<strong><span style=\"font-size:14px;\">1、账户管理</span></strong><br />\r\n	我的订单：查询您的订单信息<br />\r\n	账户余额：查询账户余额及账户交易明细<br />\r\n	优惠券：查询优惠券信息</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/5/447fg3637ce642q28c8o.jpg\" style=\"width: 820px; height: 478px;\" /><br />\r\n	<br />\r\n	&nbsp;</p>\r\n<p>\r\n	<span style=\"font-size:14px;\"><strong>2、收藏管理</strong></span><br />\r\n	可以将您感兴趣但未确认购买的商品放入收藏，方便以后查询及购买（放入收藏中商品不占库存量）</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/5/q433qlw6r5qcsv7o84b6.jpg\" style=\"width: 820px; height: 448px;\" /><br />\r\n	<br />\r\n	&nbsp;</p>\r\n<p>\r\n	<span style=\"font-size:14px;\"><strong>3、个人信息管理</strong></span><br />\r\n	修改E-mail地址<br />\r\n	修改密码<br />\r\n	修改送货信息<br />\r\n	<br />\r\n	<span style=\"font-size:14px;\"><strong>4、资金账户管理</strong></span><br />\r\n	资金账户管理</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/5/8u8avbp61v8f1bq28554.jpg\" style=\"width: 820px; height: 320px;\" /><br />\r\n	&nbsp;</p>\r\n','3738448167,4732875731,','2014-11-02 15:27:29'),(64,'服务条款','<p>\r\n	<strong><span style=\"font-size:14px;\">天下名品网上商城服务条款</span></strong></p>\r\n<p>\r\n	<span style=\"font-size:14px;\"><strong>一、确认与接纳</strong></span><br />\r\n	&ldquo;天下名品&rdquo;（http://www.txmp.com.cn）是天下名品投资发展有限公司（下称&ldquo;天下名品&rdquo;）推出的基于全球互联网向用户提供集电子商务、社区服务及类金融服务为一体的综合性网站。&ldquo;天下名品&rdquo;及其涉及到的产品、服务、相关软件的所有权和运营权归天下名品所有，天下名品享有对&ldquo;天下名品&rdquo;上一切活动的监督、提示、检查、纠正及处罚权利。用户通过注册程序阅读本服务条款并点击&ldquo;同意&rdquo;或&ldquo;接受&rdquo;按钮完成注册，或以任何行为实际使用、享受&ldquo;天下名品&rdquo;的服务，即表示用户与天下名品已达成协议，自愿接受本服务条款的所有内容。如用户不同意本服务条款的条件，则不能使用txmp.com.cn服务以及注册成为&ldquo;天下名品&rdquo;用户。<br />\r\n	<br />\r\n	<span style=\"font-size:14px;\"><strong>二、服务保护条款</strong></span><br />\r\n	1、&ldquo;天下名品&rdquo;服务仅供依法能够且有权订立具有法律约束力合约的自然人、法人及非法人组织使用。因此，用户应为具备完全民事行为能力的自然人，或依法成立、存续的法人或非法人组织。用户违反本项条件，&ldquo;天下名品&rdquo;可随时、全权决定拒绝向其提供服务，若因此给&ldquo;天下名品&rdquo;或第三方造成损失，用户承担全部赔偿责任。<br />\r\n	2、考虑到&ldquo;天下名品&rdquo;产品及服务的特性，用户同意：<br />\r\n	（1）自备设备，包括PC、调制解调器及配备上网装置，负担上网和支付与此服务有关的通讯费用；<br />\r\n	（2）在参加&ldquo;天下名品&rdquo;各类活动时以及&ldquo;天下名品&rdquo;提出要求时，提供及时、详尽及准确的个人资料，包括但不限于姓名、性别、年龄、住址/住所地、通讯地址、联系电话、电子邮件地址等；<br />\r\n	（3） 实时更新注册资料，符合及时、详尽、准确的要求。<br />\r\n	3、用户在享用&ldquo;天下名品&rdquo;各项服务的同时，同意接受天下名品提供的各类信息服务，这些信息所涉及的内容包括以文字、图片、照片、音视频形式表现的各类订单信息、宣传信息、促销信息、商业信息以及天下名品合作伙伴信息，该类信息的提供方式包括但不限于电子邮件、短信息。用户在&ldquo;天下名品&rdquo;注册或实际使用&ldquo;天下名品&rdquo;的服务，即表明用户已同意接受此项服务。若用户不希望接收来自&ldquo;天下名品&rdquo;的邮件，则可通过回复邮件的方式按照提示自助完成退阅；若用户不希望接收来自&ldquo;天下名品&rdquo;的短信，则可联系&ldquo;天下名品&rdquo;客户服务部 协助处理。<br />\r\n	4、&ldquo;天下名品&rdquo;为用户提供合法的、健康的产品及服务，但是用户应对其使用&ldquo;天下名品&rdquo;自行承担责任及风险，天下名品在任何情况下不就因使用或不能使用&ldquo;天下名品&rdquo;提供的服务所发生的特殊的、意外的、直接或间接的损失承担赔偿责任。<br />\r\n	5、除非法律规定或者&ldquo;天下名品&rdquo;明确承诺，&ldquo;天下名品&rdquo;将不对所提供的商品的适用性或满足用户特定需求及目的进行任何明示或者默示的担保。请在购买前确认自身的需求，同时仔细阅读商品说明。<br />\r\n	6、用户在参与活动或交易过程中与其它会员发生纠纷时，一旦一方或双方共同提交&ldquo;天下名品&rdquo;要求调处，则&ldquo;天下名品&rdquo;有权根据单方判断做出调处决定，用户了解并同意接受&ldquo;天下名品&rdquo;的判断和调处决定，该决定将对用户具有约束力。如用户未在限期内执行处理决定，则天下名品有权暂停向其提供服务，暂时冻结其天下名品账户内的资金，并采取进一步法律手段解决。<br />\r\n	7、不接受任何商业目的的注册和购买。&ldquo;天下名品&rdquo;欢迎以使用为目的购买天下名品产品，但不接受一切以商业为目的的商业行为，若用户利用&ldquo;天下名品&rdquo;的服务、产品、活动从事任何商业行为，天下名品有权采取取消订单、冻结或关闭账户、永久禁止注册等措施，并拒绝提供天下名品承诺的正常售后服务（产品质量问题按照国家或地方相关法律法规执行）。如用户利用&ldquo;天下名品&rdquo;的产品、服务或活动从事任何商业行为给天下名品造成损失的，用户需承担赔偿责任，构成犯罪的，天下名品有权提请国家主管部门追究其行政和刑事责任。<br />\r\n	<br />\r\n	<span style=\"font-size:14px;\"><strong>三、用户使用基本规则</strong></span><br />\r\n	1、特别提示用户，使用互联网必须遵守国家有关的政策和法律，包括刑法、国家安全法、保密法、计算机信息系统安全保护条例等，保护国家利益，保护国家安全，对于违法使用互联网络而引起的一切责任，由用户负全部责任。<br />\r\n	2、用户在申请使用&ldquo;天下名品&rdquo;提供的网络服务时，必须向天下名品提供准确的个人资料，如个人资料有任何变动，必须及时更新。如有合理理由怀疑用户提供的资料错误、不实、失效或不完整的，&ldquo;天下名品&rdquo;有权向用户发出询问及/或要求改正的通知，并有权直接做出删除相应资料的处理，直至中止、终止对用户提供部分或全部服务。&ldquo;天下名品&rdquo;对此不承担任何责任，用户将承担因此产生的任何直接或间接支出。<br />\r\n	3、用户可在&ldquo;天下名品&rdquo;发布商品或服务信息、评论及其它信息，但 不得使用&ldquo;天下名品&rdquo;服务发送或传播敏感信息和违反国家法律法规政策的信息，此类信息包括但不限于：<br />\r\n	（1）反对宪法所确定的基本原则的；<br />\r\n	（2）危害国家安全，泄露国家秘密，颠覆国家政权，破坏国家统一的；<br />\r\n	（3）损害国家荣誉和利益的；<br />\r\n	（4）煽动民族仇恨、民族歧视，破坏民族团结的；<br />\r\n	（5）破坏国家宗教政策，宣扬邪教和封建迷信的；<br />\r\n	（6）散布谣言，扰乱社会秩序，破坏社会稳定的；<br />\r\n	（7）散布淫秽、色情、赌博、暴力、凶杀、恐怖或者教唆犯罪的；<br />\r\n	（8）侮辱或者诽谤他人，侵害他人合法权益的；<br />\r\n	（9）含有法律、行政法规禁止的其它内容的。<br />\r\n	用户在发布商品、服务信息及使用&ldquo;天下名品&rdquo;服务过程中，还必须遵循以下原则：<br />\r\n	（1）遵守中国有关的法律和法规；<br />\r\n	（2）不得为任何非法目的而使用网络服务系统，遵守所有与网络服务有关的网络协议、规定和程序；不得利用&ldquo;天下名品&rdquo;网络服务系统进行任何可能对互联网的正常运转造成不利影响的行为；<br />\r\n	（3）不得进行任何未经&ldquo;天下名品&rdquo;许可的商业广告行为；不得对&ldquo;天下名品&rdquo;上的任何数据作商业性利用，包括但不限于在未经&ldquo;天下名品&rdquo;事先书面同意的情况下，以复制、传播等任何方式使用&ldquo;天下名品&rdquo;上展示的资料；<br />\r\n	（4）不得使用虚假、冒充他人或其它方的信息注册&ldquo;天下名品&rdquo;后发布评论或其它内容；不得以虚构或歪曲事实的方式不当评价其它会员，不得采取不正当方式制造或提高自身的信用度，不得采取不正当方式制造或提高（降低）其它会员的信用度；<br />\r\n	（5）不得使用任何装置、软件或例行程序干预或试图干预&ldquo;天下名品&rdquo;的正常运作或正在&ldquo;天下名品&rdquo;上进行的任何交易、活动；不得采取任何将导致不合理的庞大数据负载加诸&ldquo;天下名品&rdquo;网络设备的行动；<br />\r\n	（6）不得利用网络服务进行任何不利于天下名品或&ldquo;天下名品&rdquo;的行为。<br />\r\n	4、用户享有检举权，用户在使用&ldquo;天下名品&rdquo;服务过程中若发现违法、违规、侵权或其它任何违反本服务条款的行为，有权通过专门的客服途径向天下名品进行检举，天下名品将通过对检举内容的核实采取相应的措施。用户保证其检举事项的真实性、公正性，同时尊重天下名品对被检举事项的处置措施；被检举用户有权通过专门的客服途径进行辩解，但不影响天下名品先行采取相应措施，天下名品在接纳被检举用户的辩解后，将恢复对其的服务。天下名品将对用户检举进行保密。<br />\r\n	5、用户违反本条&ldquo;用户使用基本规则&rdquo;，天下名品有权视情节的严重采取警告、限期改正、暂停服务、取消订单、禁止交易、封闭帐号、永久禁止注册等措施，给天下名品或第三方造成损失的，天下名品有权采取一切合法的诉讼与非诉手段进行索赔；用户行为构成犯罪的，天下名品有权通知和协助国家主管部门进行查处。<br />\r\n	<br />\r\n	<span style=\"font-size:14px;\"><strong>四、账户、密码以及注册信息</strong></span><br />\r\n	1、用户注册成功后，将拥有一个&ldquo;天下名品&rdquo;专用帐号及相应的密码，该帐号和密码将成为用户登录&ldquo;天下名品&rdquo;、使用&ldquo;天下名品&rdquo;服务、进行交易、完成支付以及享受售后服务的凭证。<br />\r\n	2、每位用户只允许在&ldquo;天下名品&rdquo;拥有一个有效账户，如有证据证明或天下名品有理由相信用户存在恶意注册多个账户的情形，天下名品有权采取取消订单、冻结或关闭账户等措施，给天下名品造成损失的，用户承担赔偿责任。<br />\r\n	3、使用&ldquo;天下名品&rdquo;服务过程中，用户有义务保管好个人账号及密码，并对他人使用私人计算机作出限制。用户不得以任何形式擅自转让或授权他人使用自己的&ldquo;天下名品&rdquo;帐号及密码。如果因为用户管理不善造成帐号、密码等被复制或被盗用，相应损失由用户自行承担。同时，通过该用户的个人账户在&ldquo;天下名品&rdquo;上发生的所有活动以及产生的责任，亦应由该用户承担。<br />\r\n	4、用户不得采用测试、欺骗等任何非法手段，盗取其它用户的账户信息或对他人进行骚扰。<br />\r\n	5、&ldquo;天下名品&rdquo;承诺仅根据本网站服务目的使用用户个人信息。服务目的包括但不限于交易确认、交易支付、客户回访、政策更新、用户通知、发送促销信息、商业信息以及其它与交易和服务相关的辅助服务等。如用户认为&ldquo;天下名品&rdquo;超范围使用了其个人信息，请立即与客服中心联系，&ldquo;天下名品&rdquo;将核实处理。<br />\r\n	<br />\r\n	<span style=\"font-size:14px;\"><strong>五、用户隐私保护</strong></span><br />\r\n	尊重用户个人隐私是天下名品的一项基本政策，因此，天下名品一定不会向任何第三方披露、转让、出租或者出售交易用户名单、交易记录等涉及消费者个人信息的数据以及用户保存在天下名品各项服务中的非公开内容，除非天下名品在诚信基础上认为透露这些信息是必要的。<br />\r\n	1、对用户注册资料的保护<br />\r\n	用户可授权天下名品向第三方透露其注册资料，否则天下名品不会公开用户的姓名、住址、通信地址、电子邮箱、电话及帐号。除非：<br />\r\n	（1）事先获得用户明确授权后，用户要求天下名品或授权某人通过电子邮件服务或其它方式透露这些信息；<br />\r\n	（2）相应的法律、法规要求以及按照有关政府主管部门的要求，需要天下名品提供用户的个人资料；<br />\r\n	（3）为了维护公众和（或）&ldquo;天下名品&rdquo;、天下名品合法利益；<br />\r\n	（4）&ldquo;天下名品&rdquo;可能会与第三方合作向用户提供相关的网络服务，在此情况下，如该第三方同意承担与&ldquo;天下名品&rdquo;同等的保护用户隐私的责任，则&ldquo;天下名品&rdquo;有权将用户的注册资料等提供给该第三方；<br />\r\n	（5）在不透露单个用户隐私资料的前提下，&ldquo;天下名品&rdquo;有权对整个用户数据库进行分析并对用户数据库进行商业上的利用。<br />\r\n	2、对用户保存、发布信息的保护<br />\r\n	天下名品对用户在&ldquo;天下名品&rdquo;服务中发布或保存的各类非公开信息进行保密，除非天下名品基于诚信在以下情形下认为透露这些信息是必要的：<br />\r\n	（1）遵守有关法律规定，包括在国家有关机关查询时，提供用户在&ldquo;天下名品&rdquo;上发布的信息、因交易和付款而保存在&ldquo;天下名品&rdquo;的信息，以及这些信息产生的时间、互联网地址或者域名以及其上传至&ldquo;天下名品&rdquo;的其它信息；<br />\r\n	（2）遵从&ldquo;天下名品&rdquo;产品服务程序；<br />\r\n	（3）为保持维护天下名品的知识产权；<br />\r\n	（4）在紧急情况下维护用户个人和社会大众的隐私安全；<br />\r\n	（5）其它诚信及必要的情况下。<br />\r\n	<br />\r\n	<span style=\"font-size:14px;\"><strong>六、商品价格及价格变化</strong></span><br />\r\n	1、产品的价格将在&ldquo;天下名品&rdquo;官方网站上指明。这类信息可能随时更改且不发出任何通知。商品的价格包含了增值税，商品送达费用则另外结算，送达费用根据用户选择送货方式的不同而异。如果发生了意外情况，在确认了用户的订单后，由于供应商提价，税额变化引起的价格变化，或是由于网站的失误等造成商品价格变化，用户有权取消的订单，并以电子邮件或电话等方式通知&ldquo;天下名品&rdquo;客服服务部。<br />\r\n	2、&ldquo;天下名品&rdquo;将尽最大努力保证用户所购商品与网站上公布的价格一致，但价目表和声明并不构成要约。直至用户发出订单，&ldquo;天下名品&rdquo;才能确认商品的价格，如果&ldquo;天下名品&rdquo;发现错误定价，将采取下列措施之一：<br />\r\n	（1）如果某一商品的正确定价低于&ldquo;天下名品&rdquo;的错误定价，则按照较低的定价向用户销售交付该商品。<br />\r\n	（2）如果某一商品的正确定价高于&ldquo;天下名品&rdquo;的错误定价，&ldquo;天下名品&rdquo;会根据情况决定，是否在交付前联系用户寻求指示, 或者取消订单并通知用户。<br />\r\n	<br />\r\n	<span style=\"font-size:14px;\"><strong>七、订单与缺货</strong></span><br />\r\n	1、有关产品的信息及产品的可获性将在&ldquo;天下名品&rdquo;官方网站上指明。用户应在提交订单前仔细核实上述信息，订单提交成功后系统将自动向用户发送一封确认邮件。此后天下名品将对用户的订单进行审核并在通过审核后安排配送。<br />\r\n	2、若用户订购的产品发生缺货，则&ldquo;天下名品&rdquo;及用户均有权单方取消订单，并以有效方式通知对方。<br />\r\n	3、&ldquo;天下名品&rdquo;将尽量保证产品信息及可获性的准确，但仍可能因人员操作、系统问题及其它不可抗原因产生错误，在此情况下&ldquo;天下名品&rdquo;将按正确的信息和用户进行确认修改，用户有权取消订单或者按照正确的信息完成交易。<br />\r\n	4、若用户在一份订单里订购了多种商品并且&ldquo;天下名品&rdquo;只给用户发出了其中一部分商品，用户应联系&ldquo;天下名品&rdquo;客服中心，&ldquo;天下名品&rdquo;将向用户退还该部分款项或者向用户补足剩余商品。<br />\r\n	<br />\r\n	<span style=\"font-size:14px;\"><strong>八、发货与收货</strong></span><br />\r\n	1、配送范围将在&ldquo;天下名品&rdquo;官方网站公示，用户应仔细阅读并在每次下订单前再次进行确认，确保所提交的送货地址属于该范围之内，超出该范围的订购或配送要求，属于无效订单，&ldquo;天下名品&rdquo;有权单方取消订单。<br />\r\n	2、在提交订单前，用户应再次确认配送地址，如果因为用户地址错误造成延期配送或不能配送的，用户自行承担责任，造成货物重复配送，天下名品有权按照实际配送次数收取物流费用。<br />\r\n	3、收货人可以为用户本人也可以为本人以外的其它人。天下名品将按照通过审核后的订单上所述的配送地址、收货人姓名和电话进行配送。如果收货人在配送过程中要求变更接收地址的，天下名品视同已经过用户本人的同意。<br />\r\n	4、原则上收货人应当亲自接收，如遇特殊情况收货人可以与&ldquo;天下名品&rdquo;客服中心联系申请由他人代为签收。如果配送地点属于办公区域，则前台人员代为签收视为已经经过用户的同意。大额订单进行配送签收时，天下名品有权要求收货人出示有效身份证明。<br />\r\n	5、天下名品尽量将配送时间控制在1-3天，如遇不可抗力因素，包括但不限于以下情况：<br />\r\n	（1）自然灾害，如地震、台风、洪水、旱灾、海啸等。<br />\r\n	（2）政府行为，主要是指当事人在订立合同以后，政府当局颁布新政策、法律和行政措施而导致合同不能履行。<br />\r\n	（3）社会异常事件，如战争、罢工、骚乱、交通管制等。<br />\r\n	（4）恶劣天气所导致无法或难以正常送货，天下名品有权延迟配送时间。<br />\r\n	6、若用户无正当理由多次拒收货物，则&ldquo;天下名品&rdquo;有权取消该用户以后的订单。情形恶劣的，&ldquo;天下名品&rdquo;有权采取冻结、关闭账户，永久禁止注册等措施，并保留追究赔偿责任的权利。<br />\r\n	<br />\r\n	<span style=\"font-size:14px;\"><strong>九、付款与退款</strong></span><br />\r\n	1、付款方式将在&ldquo;天下名品&rdquo;官方网站予以公示。用户应在确认订单时，选择付款方式，并严格按照已选择的方式付款。用户未能按照所选择的方式或所要求的时间完成付款的，&ldquo;天下名品&rdquo;有权单方取消订单。<br />\r\n	2、退款方式将在&ldquo;天下名品&rdquo;官方网站予以公示。因退货或换货商品缺货而产生的现金款项，&ldquo;天下名品&rdquo;将退回至用户，退回方式视支付方式的不同而不同。用户应严格依据退款方式及退款周期收回退款。 &nbsp;<br />\r\n	<br />\r\n	<span style=\"font-size:14px;\"><strong>十、退货与换货</strong></span><br />\r\n	退换货政策将在&ldquo;天下名品&rdquo;官方网站予以公示。&ldquo;天下名品&rdquo;将针对商品品类的不同实行不同的退换货政策和条件，用户在申请退换货前应仔细阅读并理解，同时严格按照相关流程和要求完成退换货。<br />\r\n	<br />\r\n	<span style=\"font-size:14px;\"><strong>十一、特别授权</strong></span><br />\r\n	用户完全理解并不可撤销地授予天下名品及其关联公司下列权利：<br />\r\n	1、一旦用户向&ldquo;天下名品&rdquo;、天下名品及（或）其关联公司作出任何形式的承诺，且相关公司已确认用户违反了该承诺，则&ldquo;天下名品&rdquo;有权立即按用户的承诺或协议约定的方式对用户的账户采取限制措施，包括中止或终止向用户提供服务，并公示相关公司确认的用户的违约情况。用户了解并同意，&ldquo;天下名品&rdquo;无须就相关确认与用户核对事实，或另行征得用户的同意，且&ldquo;天下名品&rdquo;无须就此限制措施或公示行为向用户承担任何的责任。<br />\r\n	2、一旦用户违反本协议，或与天下名品签订的其它协议的约定，天下名品有权以任何方式通知天下名品关联公司，要求其对用户的权益采取限制措施，包括但不限于将用户账户内的款项支付给&ldquo;天下名品&rdquo;指定的对象，要求关联公司中止、终止对该用户提供部分或全部服务，且在其经营或实际控制的任何网站公示用户的违约情况。<br />\r\n	<br />\r\n	<span style=\"font-size:14px;\"><strong>十二、拒绝担保及责任限制</strong></span><br />\r\n	1、除非另有明确的书面说明，&ldquo;天下名品&rdquo;网站及其所包含的或以其它方式通过&ldquo;天下名品&rdquo;提供给用户的全部信息、内容、材料、产品（包括软件）和服务，是由&ldquo;天下名品&rdquo;在&ldquo;按照现状&rdquo;和&ldquo;按照可提供&rdquo;的基础上提供的。除非另有明确的书面说明，&ldquo;天下名品&rdquo;不对网站的运营及网站上的信息、内容、材料、产品（包括软件）或服务作任何形式的、明示或默示的声明或担保（根据中华人民共和国法律另有规定的除外）；亦不对这些信息、内容、材料、产品（包括软件）和服务、或用户购买和使用产品引起的任何损害承担责任（除非根据中华人民共和国法律应承担责任的以外），包括但不限于直接、间接或附带的惩罚性和结果性的损害赔偿。用户明确同意在使用&ldquo;天下名品&rdquo;服务时自担风险。<br />\r\n	2、除非法律法规明确要求，或出现以下情况，否则，&ldquo;天下名品&rdquo;没有义务对所有用户的注册数据、交易行为以及与交易有关的其它事项进行事先审查：<br />\r\n	（1）&ldquo;天下名品&rdquo;有合理的理由认为特定用户及具体交易事项可能存在重大违法或违约情形；<br />\r\n	（2）&ldquo;天下名品&rdquo;有合理的理由认为用户在&ldquo;天下名品&rdquo;网的行为涉嫌违法或不当。<br />\r\n	3、用户了解并同意，&ldquo;天下名品&rdquo;及天下名品不对因下述任一情况而导致用户的任何损害赔偿承担责任，包括但不限于利润、商誉、使用、数据等方面的损失或其它无形损失的损害赔偿 (无论&ldquo;天下名品&rdquo;及天下名品是否已被告知该等损害赔偿的可能性) ：<br />\r\n	（1）使用或未能使用&ldquo;天下名品&rdquo;服务；<br />\r\n	（2）第三方未经批准的使用用户的账户或更改用户的数据；<br />\r\n	（3）用户对&ldquo;天下名品&rdquo;服务的误解；<br />\r\n	（4）任何非因&ldquo;天下名品&rdquo;及天下名品的原因而引起的与&ldquo;天下名品&rdquo;服务有关的其它损失。<br />\r\n	4、用户明白，在使用&ldquo;天下名品&rdquo;提供的服务时可能存在来自任何他人的包括威胁性的、诽谤性的、令人反感的或非法的内容或行为，以及对他人权利的侵犯（包括但不限于知识产权、人身权）的风险，用户同意承担以上风险，天下名品对此不作任何类型的担保。<br />\r\n	5、用户理解并同意，天下名品及其关联公司并非司法机构，仅能以普通人的身份对证据进行鉴别，天下名品及其关联公司对争议的调处完全是基于用户的委托，天下名品及其关联公司无法保证争议处理结果符合用户的期望，也不对争议调处结论承担任何责任。如用户因此遭受损失，用户同意自行向受益人索偿。<br />\r\n	6、用户明白，使用&ldquo;天下名品&rdquo;提供的服务涉及到Internet服务和电信增值服务，可能会受到各个环节不稳定因素的影响。因此服务存在因不可抗力（包括但不限于自然灾害、政府行为以及战争、罢工、动乱等社会异常现象）、计算机病毒或黑客攻击、国家相关行业主管部门及电信运营商的调整、系统不稳定、用户所在位置、用户关机以及其它任何技术、互联网络、通信线路原因等造成的服务中断或不能满足用户要求的风险。用户同意承担以上风险，天下名品不作担保。对因此导致用户不能发送、上传和接受阅读消息、或接发错消息，或无法实现其它通讯条件，天下名品不承担任何责任。<br />\r\n	<br />\r\n	<span style=\"font-size:14px;\"><strong>十三、知识产权</strong></span><br />\r\n	1、天下名品对&ldquo;天下名品&rdquo;上全部内容享有绝对的、完全的所有权及知识产权，或已取得权利人的合法授权，内容包括：文字、图片、图表、照片、软件、声音、图像，以及广告中的全部内容、&ldquo;天下名品&rdquo;以通告形式发出的全部内容、本服务条款第二条&ldquo;服务保护条款&rdquo;第3款所涉及的各类信息。所有这些内容均受著作权、商标权、物权及其它知识产权和所有权法律的保护。用户只能在天下名品和（或）权利人的授权下才能使用这些内容，而不能擅自复制、编辑、改编、传播这些内容，或对内容进行任何形式的权利申请，或创造与内容有关的派生产品。同时，这些内容不可以被用于任何可能引起消费者对&ldquo;天下名品&rdquo;服务产生混淆或者贬低的商品或者服务上。<br />\r\n	2、未经天下名品书面同意，用户不得用任何方式对&ldquo;天下名品&rdquo;网站内容进行修改，也不得复制、下载&ldquo;天下名品&rdquo;网页内容、数据、信息进行转售或商业利用。用户被授予有限的、可撤销的和非独家的权利建立连接到&ldquo;天下名品&rdquo;主页的超链接，只要这个链接不以虚假、误导、贬低或其它方式侵害&ldquo;天下名品&rdquo;的商品和服务。<br />\r\n	3、对于用户发布和保存在&ldquo;天下名品&rdquo;上的内容，用户授予天下名品及其关联公司独家的、全球通用的、永久的、免费的许可使用权利 (并有权在多个层面对该权利进行再授权)。此外，天下名品及其关联公司有权(全部或部份地) 使用、复制、修订、改写、发布、翻译、分发、执行和展示用户的全部资料数据（包括但不限于注册资料、交易行为数据及全部展示于&ldquo;天下名品&rdquo;的各类信息）或制作其派生作品，并以现在已知或日后开发的任何形式、媒体或技术，将上述信息纳入其它作品内。用户进一步确认，天下名品对其内容的使用是基于用户对内容的合法性、合规性及权属做出的承诺和保证，天下名品的使用不意味着天下名品认可用户的观点或承诺对该内容承担任何责任，无论天下名品是否对用户发布和保存的内容进行使用，用户均应独立的、完全的对其内容负责。若天下名品因对内容的使用而遭受任何争议、索赔、指控，作为内容提供方的用户应对此承担全部责任，并赔偿天下名品因此遭受的损失。<br />\r\n	<br />\r\n	<span style=\"font-size:14px;\"><strong>十四、服务条款的修改及服务修订</strong></span><br />\r\n	1、用户接受，随着市场环境、网络环境以及&ldquo;天下名品&rdquo;自身发展，天下名品会在必要时修改服务条款，服务条款一旦发生变动，&ldquo;天下名品&rdquo;将会以站内公告、站内信、电子邮件或其它书面方式将修改后的条款予以公布或通知。<br />\r\n	2、用户接受，天下名品为了保障公司业务发展和调整的自主权，拥有随时修改或中断服务而不需通知用户的权利，天下名品行使修改或中断服务的权利不需对用户或任何第三方负责。用户必须在同意本条款的前提下，天下名品才开始对用户提供服务。<br />\r\n	3、用户若反对任何服务条款的修改或服务的修订，或用户对后继的条款、服务有异议，或对天下名品服务不满，用户享有以下权利：<br />\r\n	（1） 不再使用天下名品和/或&ldquo;天下名品&rdquo;的服务；<br />\r\n	（2） 自行注销账户，或以其它被许可的方式结束其使用天下名品和/或&ldquo;天下名品&rdquo;服务的资格；<br />\r\n	（3） 书面通知天下名品停止对其的服务。<br />\r\n	结束用户服务后，用户使用&ldquo;天下名品&rdquo;服务的权利马上终止。从那时起，天下名品不再对用户承担任何义务。<br />\r\n	4、一旦用户选择继续使用&ldquo;天下名品&rdquo;服务，则表示用户已接受经修订的条款及服务，当用户与&ldquo;天下名品&rdquo;发生争议时，应以最新的服务条款为准。除另行明确声明外，任何使&ldquo;天下名品&rdquo;服务范围扩大或功能增强的新内容均受本条款约束。<br />\r\n	<br />\r\n	<span style=\"font-size:14px;\"><strong>十五、违约责任承担</strong></span><br />\r\n	1、如果用户未遵守本服务条款的任何一项，天下名品有权立即终止提供一切服务，并保留通过法律手段追究责任的权利。<br />\r\n	2、用户同意支付因用户违反本服务条款或为纠正用户的违反行为所引起的律师费用、诉讼费用、公正费用、鉴定费用、执行费用等，以及因违反服务条款引起的损害赔偿费用。如用户的密码、账户被盗用，除非该事件因天下名品的过错导致，否则用户应承担被盗用期间产生的一切责任和后果。<br />\r\n	3、&ldquo;天下名品&rdquo;已经建立了规范的消费纠纷受理及解决机制，用户和天下名品一致同意，有关本条款以及使用&ldquo;天下名品&rdquo;服务产生的争议双方首先通过&ldquo;天下名品&rdquo;专业客服部门进行友好协商沟通，并力求和解解决，当协商不能时，任何一方有权选择采取诉讼方式，并应由天下名品所在地有管辖权的人民法院管辖。若有任何服务条款与法律相抵触，这些条款将按尽可能接近的方法重新解析，而其它条款则保持对双方产生法律效力和影响。<br />\r\n	<br />\r\n	<span style=\"font-size:14px;\"><strong>十六、其它</strong></span><br />\r\n	1、本服务条款以及与使用&ldquo;天下名品&rdquo;服务相关的声明、说明、规则、政策、程序，构成&ldquo;天下名品&rdquo;与用户之间有效的完整协议，将对用户持续有效，有效期至用户注销或者被取消账户、且停止一切使用&ldquo;天下名品&rdquo;服务的行为后，但&ldquo;天下名品&rdquo;与用户间已经产生的权利义务，仍对双方有约束力。<br />\r\n	2、天下名品将视向用户所提供服务内容之特性，要求用户在注册天下名品提供的有关服务时，遵守特定的条件和条款；如该特定条件和条款与以上服务条款有任何不一致之处，则以特定条件和条款为准。<br />\r\n	3、本服务条款中的任何条款无论因何种原因完全或部分无效或不具有执行力，其余条款仍应有效并且有约束力。<br />\r\n	4、本服务条款的标题、序号均为方便阅读而设定，不影响条款实际含义及其效力。<br />\r\n	5、本服务条款自公布及适用的当天生效，有效期持续至更新版本发布之时。</p>\r\n','3738448167,8571848833,','2014-11-02 15:29:58'),(65,'购物流程','<p>\r\n	<span style=\"font-size:14px;\"><strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 天下名品商城购物流程说明</strong></span></p>\r\n<p>\r\n	<img alt=\"\" src=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/5/o8133ky668f846428wdo.jpg\" style=\"width: 400px; height: 483px;\" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<a href=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/4/n163s817u5d6o65ajt1l.png\"><img alt=\"\" src=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/4/8218cg5ow115373l6h1b.png\" style=\"width: 820px; height: 4px;\" /></a></p>\r\n<p>\r\n	<span style=\"font-size:14px;\"><strong>1、注册</strong></span></p>\r\n<p>\r\n	1.1点击页面顶部&ldquo;注册&ldquo;，进入注册页面；</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/4/36m3u654c5ibj2f5q1yb.png\" style=\"width: 650px; height: 120px;\" /></p>\r\n<p>\r\n	1.2、填写账户名、密码、手机号等个人信息进行注册；<br />\r\n	1.3、选中&ldquo;我已阅读并同意《用户注册协议》&rdquo;，点击&ldquo;立即注册&rdquo;，完成注册。请在注册时务必详细填写个人信息。</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/4/6783bpl7b1km8en74ert.png\" style=\"width: 520px; height: 500px;\" /></p>\r\n<p>\r\n	1.4 找回密码<br />\r\n	1.4.1输入用户名：找回密码需要先输入手机号和验证码后，点击下一步；<br />\r\n	1.4.2验证身份：选择相应找回渠道后，点击获取验证码，请您到您相应的邮箱或手机短信中查看验证码，输入无误后点击下一步；<br />\r\n	1.4.3重置密码：填写您所能记住的新的密码，提交完成即可。</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/5/2v7d351mb2j8d2638p14.jpg\" style=\"width: 820px; height: 280px;\" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<a href=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/4/n163s817u5d6o65ajt1l.png\"><img alt=\"\" src=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/4/8218cg5ow115373l6h1b.png\" style=\"width: 820px; height: 4px;\" /></a></p>\r\n<p>\r\n	<span style=\"font-size:14px;\"><strong>2.查找商品</strong></span></p>\r\n<p>\r\n	天下名品商城提供按类别查找和关键字检索两种方式，让您快速直达商品。</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<a href=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/4/n163s817u5d6o65ajt1l.png\"><img alt=\"\" src=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/4/8218cg5ow115373l6h1b.png\" style=\"width: 820px; height: 4px;\" /></a></p>\r\n<p>\r\n	<strong><span style=\"font-size:14px;\">3.加入购物车</span></strong></p>\r\n<p>\r\n	3.1、浏览要购买的商品，点击&ldquo;加入购物车&rdquo;商品会自动添加到购物车里；<br />\r\n	3.2、如果需要更改商品数量，需在商品所在栏目后的商品数量框中输入购买数量；</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/5/ul8npsd31175yw327jg8.jpg\" style=\"width: 820px; height: 475px;\" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<a href=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/4/n163s817u5d6o65ajt1l.png\"><img alt=\"\" src=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/4/8218cg5ow115373l6h1b.png\" style=\"width: 820px; height: 4px;\" /></a></p>\r\n<p>\r\n	<strong><span style=\"font-size:14px;\">4、去结算</span></strong></p>\r\n<p>\r\n	选好商品后点击&ldquo;去结算&rdquo;；</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/5/c8m3eo664654worn5471.jpg\" style=\"width: 820px; height: 369px;\" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<a href=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/4/n163s817u5d6o65ajt1l.png\"><img alt=\"\" src=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/4/8218cg5ow115373l6h1b.png\" style=\"width: 820px; height: 4px;\" /></a></p>\r\n<p>\r\n	<strong><span style=\"font-size:14px;\">5、支付方式、配送方式</span></strong></p>\r\n<p>\r\n	详细填写收货人信息、付款方式、发票信息、配送方式等信息。</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/5/d5kgq5p3dsmc3828eg41.jpg\" style=\"width: 820px; height: 705px;\" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<a href=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/4/n163s817u5d6o65ajt1l.png\"><img alt=\"\" src=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/4/8218cg5ow115373l6h1b.png\" style=\"width: 820px; height: 4px;\" /></a></p>\r\n<p>\r\n	<strong><span style=\"font-size:16px;\">6、提交订单</span></strong></p>\r\n<p>\r\n	确认无误后点击&ldquo;提交订单&rdquo;，生成新订单并显示订单编号。可进入&ldquo;我的天下名品&rdquo;&rarr;&ldquo;订单中心&rdquo;查看订单详细信息。</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/5/dj18d6km886mn22cl87g.jpg\" style=\"width: 820px; height: 336px;\" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n','3738448167,8571848833,','2014-11-02 15:33:21'),(66,'会员制度','<p>\r\n	<strong><span style=\"font-size:14px;\">天下名品会员等级说明</span></strong></p>\r\n<p>\r\n	会员级别分为普通会员、铜牌会员、银牌会员和金牌会员四种，系统根据规则自动升降，无需申请，可登录&ldquo;我的天下名品&rdquo;查询等级。<br />\r\n	在网上注册即可成为普通会员，第一次购物即可享受积分和后续积分的奖励。</p>\r\n','3738448167,8571848833,','2014-11-02 15:37:58'),(67,'积分计划','<p>\r\n	<strong><span style=\"font-size:14px;\">1、积分获得</span></strong></p>\r\n<p>\r\n	在天下名品成功购物即可获取积分，不同级别会员购买不同属性的产品将累积不同的购物积分<br />\r\n	1.1商品添加至&ldquo;我的购物车&rdquo;后即可查看该商品的积分；<br />\r\n	1.2非天下名品品牌商品的积分以添加到&ldquo;我的购物车&rdquo;后显示的积分为准；<br />\r\n	1.3所有积分如计算后出现小数点后一位，将按舍弃的原则折合成整数；<br />\r\n	1.4此规则自2014年1月1日起执行，感谢您对天下名品的支持，天下名品将为您提供最优质的商品及服务。</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong><span style=\"font-size:14px;\">2、积分活动</span></strong></p>\r\n<p>\r\n	天下名品会不定期推出优惠活动，用户可参与活动并赢取积分。<br />\r\n	2.1签到获积分：在会员俱乐部连续签到3天获得10积分；连续5天获得20积分；连续7天获得50积分；连续30天获得300积分。<br />\r\n	2. 2完善资料送积分：为了能给您提供个性化服务，完善基本资料中的真实姓名、性别、出生日期、收信邮箱、手机等信息后可获得50积分；为了您账户的安全，请验证手机和验证邮箱，现在验证还赠送10积分哦。<br />\r\n	2.3不定期积分活动，敬请关注。<br />\r\n	&nbsp;</p>\r\n<p>\r\n	<strong><span style=\"font-size:14px;\">3、积分生效及查询</span></strong><br />\r\n	为了保证您30天退换货权益，积分将在相关订单商品送达成功30天后生效。具体积分累计情况请登录&ldquo;我的天下名品-会员积分&rdquo;进行查询。</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong><span style=\"font-size:14px;\">4、积分有效期</span></strong><br />\r\n	任何账户中的积分，其有效期为1年。起算时间为最后获得积分的时间顺延一年，逾期清零。<br />\r\n	2015年1月1日将清零您在2014年12月31日前获得的积分。<br />\r\n	&nbsp;</p>\r\n<p>\r\n	<strong><span style=\"font-size:14px;\">5、积分回馈活动</span></strong><br />\r\n	您的积分可以进行积分换购活动。</p>\r\n','3738448167,8571848833,','2014-11-02 15:38:59'),(68,'订单修改|取消','<p>\r\n	<strong><span style=\"font-size:14px;\">若您想取消未收货的订单，请使用 &quot;取消订单&quot;服务<br />\r\n	具体操作步骤如下：</span></strong></p>\r\n<p>\r\n	进入&quot;我的订单&quot;页面，找到要取消的订单，点击&ldquo;取消订单&rdquo;按钮；<br />\r\n	选择订单取消原因后，提交申请；<br />\r\n	&quot;取消订单&quot;申请成功后，您可在&ldquo;我的订单&gt;客户服务&gt;取消订单记录&rdquo;页面查看取消进度。<br />\r\n	&nbsp;</p>\r\n<p>\r\n	<strong><span style=\"font-size:14px;\">天下名品自营商品订单取消：</span></strong><br />\r\n	商品出库前：若您在商品未出库前提交取消申请，会在30分钟后完成退款审核。<br />\r\n	商品送往配送站前：若您在商品已经出库，等待装车送往配送站前提交取消申请，会在24小时内完成退款审核。<br />\r\n	商品送往配送站的途中：若您在订单商品已经装车送往配送站的途中提交取消申请，会在商品到达配送站的当天24小时内完成退款审核。<br />\r\n	拒收订单：订单拒收后，系统会自动帮您提交取消申请，在当天24小时内完成退款审核。<br />\r\n	&nbsp;</p>\r\n<p>\r\n	<strong><span style=\"font-size:14px;\">入驻商家商品订单取消：</span></strong></p>\r\n<p>\r\n	入驻商家订单根据卖家自身情况进行取消申请和退款受理。<br />\r\n	<br />\r\n	<span style=\"font-size:14px;\"><strong>订单取消后，款项退换说明：</strong></span></p>\r\n<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" class=\"tablecss\" width=\"99%\">\r\n	<tbody align=\"center\">\r\n		<tr>\r\n			<th colspan=\"2\" height=\"35\" rowspan=\"2\" width=\"30%\">\r\n				支付方式</th>\r\n			<th rowspan=\"2\" width=\"30%\">\r\n				退款方式</th>\r\n			<th colspan=\"2\" width=\"45%\">\r\n				退款说明</th>\r\n		</tr>\r\n		<tr>\r\n			<th width=\"15%\">\r\n				天下名品退款处理周期</th>\r\n			<th width=\"15%\">\r\n				银行退款处理周期</th>\r\n		</tr>\r\n		<tr>\r\n			<td rowspan=\"2\">\r\n				<p align=\"left\">\r\n					在线支付</p>\r\n			</td>\r\n			<td>\r\n				<p align=\"left\">\r\n					储蓄卡</p>\r\n			</td>\r\n			<td>\r\n				<p align=\"left\">\r\n					退回原支付卡</p>\r\n			</td>\r\n			<td>\r\n				<p align=\"left\">\r\n					1个工作日</p>\r\n			</td>\r\n			<td>\r\n				<p align=\"left\">\r\n					1-7个工作日</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<p align=\"left\">\r\n					信用卡</p>\r\n			</td>\r\n			<td>\r\n				<p align=\"left\">\r\n					退回原支付卡</p>\r\n			</td>\r\n			<td>\r\n				<p align=\"left\">\r\n					1个工作日</p>\r\n			</td>\r\n			<td>\r\n				<p align=\"left\">\r\n					1-15个工作日</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td rowspan=\"3\">\r\n				<p align=\"left\">\r\n					在线支付--手机支付平台</p>\r\n			</td>\r\n			<td>\r\n				<p align=\"left\">\r\n					银行卡</p>\r\n			</td>\r\n			<td>\r\n				<p align=\"left\">\r\n					退回原支付卡</p>\r\n			</td>\r\n			<td>\r\n				<p align=\"left\">\r\n					1个工作日</p>\r\n			</td>\r\n			<td>\r\n				<p align=\"left\">\r\n					1-15个工作日</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td rowspan=\"2\">\r\n				<p align=\"left\">\r\n					银行卡+电子券</p>\r\n			</td>\r\n			<td>\r\n				<p align=\"left\">\r\n					银行卡支付款项退回手机支付平台账户余额</p>\r\n			</td>\r\n			<td>\r\n				<p align=\"left\">\r\n					1个工作日</p>\r\n			</td>\r\n			<td>\r\n				<p align=\"left\">\r\n					1-2个工作日</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<p align=\"left\">\r\n					电子券自动原返至手机支付平台账户</p>\r\n			</td>\r\n			<td>\r\n				<p align=\"left\">\r\n					1个工作日</p>\r\n			</td>\r\n			<td>\r\n				<p align=\"left\">\r\n					1-2个工作日</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<p align=\"left\">\r\n					在线支付-直连银行支付</p>\r\n			</td>\r\n			<td>\r\n				<p align=\"left\">\r\n					建行、招行、邮储</p>\r\n			</td>\r\n			<td>\r\n				<p align=\"left\">\r\n					退回原支付卡</p>\r\n			</td>\r\n			<td>\r\n				<p align=\"left\">\r\n					1个工作日</p>\r\n			</td>\r\n			<td>\r\n				<p align=\"left\">\r\n					1-2个工作日</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td rowspan=\"4\">\r\n				<p align=\"left\">\r\n					货到付款/自提支付</p>\r\n			</td>\r\n			<td>\r\n				<p align=\"left\">\r\n					POS机刷卡</p>\r\n			</td>\r\n			<td>\r\n				<p align=\"left\">\r\n					退回原支付卡</p>\r\n			</td>\r\n			<td>\r\n				<p align=\"left\">\r\n					1个工作日</p>\r\n			</td>\r\n			<td>\r\n				<p align=\"left\">\r\n					1-15个工作日</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<p align=\"left\">\r\n					支票支付</p>\r\n			</td>\r\n			<td>\r\n				<p align=\"left\">\r\n					退回原支付卡</p>\r\n			</td>\r\n			<td>\r\n				<p align=\"left\">\r\n					1个工作日</p>\r\n			</td>\r\n			<td>\r\n				<p align=\"left\">\r\n					1-3个工作日</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td rowspan=\"2\">\r\n				<p align=\"left\">\r\n					现金支付</p>\r\n			</td>\r\n			<td>\r\n				<p align=\"left\">\r\n					个人储蓄卡（工、建、农、招）</p>\r\n			</td>\r\n			<td>\r\n				<p align=\"left\">\r\n					1个工作日</p>\r\n			</td>\r\n			<td>\r\n				<p align=\"left\">\r\n					1-2个工作日</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<p align=\"left\">\r\n					其他个人储蓄卡</p>\r\n			</td>\r\n			<td>\r\n				<p align=\"left\">\r\n					1个工作日</p>\r\n			</td>\r\n			<td>\r\n				<p align=\"left\">\r\n					2-5个工作日</p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<p>\r\n	&nbsp;</p>\r\n','3738448167,8571848833,','2014-11-02 15:40:15'),(69,'配送范围及收费标准','<p>\r\n	<strong><span style=\"font-size:14px;\">天下名品商城订单配送范围及收费标准</span></strong><br />\r\n	<br />\r\n	<strong><span style=\"font-size:14px;\">1、配送范围</span></strong><br />\r\n	请您根据收货人地址选择正确的省、市、区/县后，系统会提示您可供选择的送货方式及相关配送信息。<br />\r\n	【华北】 北京市、天津市、河北省、山西省、内蒙古自治区<br />\r\n	【东北】 辽宁省、吉林省、黑龙江省<br />\r\n	【华东】 上海市、江苏省、浙江省、安徽省、福建省、江西省、山东省<br />\r\n	【华中、华南】 河南省、湖北省、湖南省、广东省、广西壮族自治区、海南省<br />\r\n	【西南】 重庆市、四川省、贵州省、云南省、西藏自治区<br />\r\n	【西北】 陕西省、甘肃省、青海省、宁夏回族自治区、新疆维吾尔自治区<br />\r\n	<br />\r\n	<strong><span style=\"font-size:14px;\">2、收费标准</span></strong><br />\r\n	2.1、天下名品商城商品分为自营和入驻商家两种，天下名品商城自营商品，订单金额满<span style=\"color:#ff0000;\"><strong>98</strong></span>元以上（<span style=\"color:#ff0000;\"><strong>含98元</strong></span>），即可享受免费配送，若订单金额不足98元，则需支付5元配送费。<br />\r\n	2.2、订单商品由入驻商家销售和配送，则不享受此活动，具体配送金额以商家标注配送费为准。<br />\r\n	&nbsp;</p>\r\n','3738448167,4531735175,','2014-11-02 15:42:14'),(70,'商品验货与签收','<p style=\"margin-left: 40px;\">\r\n	<strong>商品配送、签收、验货</strong><br />\r\n	<strong>1、商品配送</strong><br />\r\n	1.1卖家所选择的快递公司在派送商品时应当主动联系收货人，而不应在未征得收货人同意的情况下将商品交由小区保安、门卫、公司前台等人签收。<br />\r\n	1.2卖家应与快递公司约定，在提供配送过程中，应遵守天下名品平台相关规则规定的标准及规范，为消费者提供满意的配送服务，积极提升客户满意度。<br />\r\n	<br />\r\n	<strong>2、商品签收</strong><br />\r\n	2.1卖家按照约定发货后，收货人有及时收货的义务。收货人可以本人签收商品或委托他人代为签收商品，被委托人的签收视为收货人本人签收。<br />\r\n	2.2消费者只填写了收货地址，但没有填写收货人或填写的收货人信息不特定，商品在收货地址被签收的，该签收视为消费者本人签收。<br />\r\n	<br />\r\n	<strong>3、商品验收</strong><br />\r\n	3.1收货人签收商品时，应当对商品进行验收。<br />\r\n	3.2涉及商品表面一致的事项，收货人应当在签收商品时进行验收。 本条所称&ldquo;表面一致&rdquo;，是指凭肉眼即可判断所收到的商品表面状况良好且与网上描述相符，表面一致的判断范围包括但不限于商品的形状、大小、数量、重量等。<br />\r\n	3.3收货人签收商品时发现表面不一致的，有权拒绝签收商品。 卖家应在商品拒收后及时联系消费者，进行处理。<br />\r\n	3.4对于需要先签收再打开包装查看的商品，收货人应当要求承运人当场监督并打开包装查看，如发现表面不一致，应当在签收单（收货人联和承运人联）上备注详细情况并让承运人签字确认或者直接退回商品。<br />\r\n	3.5收货人无正当理由拒绝签收商品的，运费由消费者承担。<br />\r\n	3.6收货人拒绝签收商品后，卖家应当及时联系承运人取回商品。因卖家怠于取回商品所产生的额外运费、保管费等费用由卖家承担。</p>\r\n','3738448167,4531735175,','2014-11-02 15:42:54'),(71,'银行转账','<p>\r\n	<strong><span style=\"font-size:14px;\">银行转账（仅包括个人用户，@B2B用户的支付方式另行规定）</span></strong><br />\r\n	1、国内顾客可以通过全国任何一家银行，向天下名品在中国招商银行开立的指定账户汇款。<br />\r\n	2、到款时间一般为办理转帐手续之后：同行1-2个工作日、跨行2-5个工作日;<br />\r\n	3、提示：为了及时帮您确认订单收款，请务必在备注栏或用途栏内写明天下名品订单号。<br />\r\n	公司名称：天下名品产业投资发展有限公司<br />\r\n	开户银行：光大银行XX支行<br />\r\n	银行帐户：XXXXXXXXXXXXXX<br />\r\n	银行转账单的填写方法参考下图：</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/5/23sw571rd16ikg2ni5l4.jpg\" style=\"width: 650px; height: 317px;\" /><br />\r\n	<br />\r\n	<br />\r\n	<strong><span style=\"font-size:14px;\">温馨提示：</span></strong><br />\r\n	1) 少数情况不支持银行转账；会体现在具体的交易信息中。<br />\r\n	2) 选择银行转账的天下名品订单，订单提交后将保留7个工作日， 请及时汇款；<br />\r\n	3) 若您填写了订单号，我们可以在收到款项后的24小时内确认收款并发货，否则需要1-5工作日，若款项汇出5个工作日内未帮您进行订单收款确认，请及时致电客服热线400-6666-288。</p>\r\n','3738448167,3763727635,','2014-11-02 15:44:06'),(72,'在线支付','<p>\r\n	<strong><span style=\"font-size:14px;\">在线支付</span></strong><br />\r\n	<br />\r\n	天下名品商城现开通支付宝支付、银联在线支付。</p>\r\n<p>\r\n	用户在天下名品商城选择在线支付时，会提供支付宝支付和银联在线支付两个选项，用户根据自己实际情况选择适合自己使用的在线支付方式完成支付。</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/5/my5w373x75263ax7ji81.jpg\" style=\"width: 650px; height: 274px;\" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong><span style=\"font-size:14px;\">温馨提示：</span></strong></p>\r\n<p>\r\n	在线支付具体操作请查看对应网上支付帮助。</p>\r\n<table cellpadding=\"0\" cellspacing=\"0\" class=\"blue_tab\" width=\"445\">\r\n	<thead>\r\n		<tr>\r\n			<th colspan=\"3\">\r\n				支付平台名称</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				<img src=\"http://image.yihaodianimg.com/images/help/images/pic/105.jpg\" /></td>\r\n			<td width=\"160\">\r\n				支付宝\r\n				<p style=\"font-weight:normal;\">\r\n					7&times;24小时客户服务热线：</p>\r\n				<p style=\"font-weight:normal;\">\r\n					95188</p>\r\n			</td>\r\n			<td>\r\n				<a class=\"blue\" href=\"http://help.alipay.com/lab/-210220/0-210220.htm#A5\" target=\"_blank\"><span style=\"color:#0000ff;\">网上支付帮助</span></a></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				&nbsp;</td>\r\n			<td>\r\n				&nbsp;</td>\r\n			<td>\r\n				&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				<img src=\"http://image.yihaodianimg.com/images/help/images/pic/131.jpg\" /></td>\r\n			<td>\r\n				银联在线支付\r\n				<p style=\"font-weight:normal;\">\r\n					7&times;24小时客户服务热线：</p>\r\n				<p style=\"font-weight:normal;\">\r\n					95516</p>\r\n			</td>\r\n			<td>\r\n				<a class=\"blue\" href=\"https://online.unionpay.com/portal/open/index.do\" target=\"_blank\"><span style=\"color:#0000ff;\">网上支付帮助</span></a></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<p>\r\n	&nbsp;</p>\r\n','3738448167,3763727635,','2014-11-02 15:46:58'),(73,'积分及优惠券支付','<p>\r\n	1、单张订单只能使用一张优惠券。<br />\r\n	2、优惠券为不记名卡，请您妥善保管，遗失不补。<br />\r\n	3、优惠券不得合并，不设找零，不可兑换现金。<br />\r\n	4、请保证您的优惠券在有效期内使用，过期即作废。<br />\r\n	5、请您在使用时注意优惠券的使用规则，不同的优惠券使用规则不同。<br />\r\n	6、使用优惠券的订单发生退货时，优惠券支付的部分将退回原优惠券内，若原优惠券有效，可再次使用。 例：300元订单，其中50元使用优惠券，发生全单退货时，50元退回原优惠券中，250元根据您原支付方式退回，若您的原优惠券还在有效期内，您可以再次根据此卡的原使用规则进行订购使用。<br />\r\n	7、使用优惠券的订单发生退换货后，如订单金额不满足此优惠券的使用规则，则优惠券不能正常使用，需要客户补足相应的金额，建议使用优惠券的订单进行换货处理。例：300元订单，其中50元使用优惠券（此优惠券规则为，满300元方能使用）， 发生某件100元商品退货，造成原订单金额200元，不符合使用50元优惠券的规定， 所以100元的退款只能退100元-50元（优惠券的金额）=50元，当然原优惠券若在有效期内，您可以再次根据此卡的原使用规则进行订购使用。<br />\r\n	8、使用折扣优惠券购买商品时，所购买商品金额（特惠品金额除外）满足条件金额后可方使用。例：（50元优惠券，满200元可使用），购买A商品199元，+1元送商品B，如果用户订单只订购A+B=200元，此时优惠券不可使用，需要购买其它商品并满200元后方可使用此优惠券。）</p>\r\n','3738448167,3763727635,','2014-11-02 15:47:34'),(74,'资金账号支付','<p>\r\n	资金账户是您在天下名品的专属账户；您在天下名品购物多支付的部分或报销运费等金额都会存入您在天下名品资金账户中，您可以在天下名品购物时使用。<br />\r\n	1、如果您需要通过资金账户余额支付订单，请您选择&ldquo;使用余额支付&rdquo;（注：如果您的账户中没有余额则不会显该项支付方式）；<br />\r\n	2、当资金账户余额&le;订单应收金额时，系统会优先使用余额部分对订单进行支付，差额部分您可以通过其它支付方式进行支付；了解更多支付方式请点击查看；<br />\r\n	3、订单发货后无法再使用资金账户余额对订单进行支付；<br />\r\n	4、您可以进入天下名品 &ldquo;我的天下名品&rdquo;中查看您的资金账户余额。</p>\r\n','3738448167,3763727635,','2014-11-02 15:48:07'),(75,'发票制度','<p>\r\n	<strong><span style=\"font-size:14px;\">1、获得发票</span></strong><br />\r\n	1.1电话订购时，确认好所需要的产品后，请将您的发票抬头提供给销售人员，发票将随同商品一起送到。<br />\r\n	1.2如您在网站订购，请在提交订单前将开发票前的&ldquo;+&rdquo;点开，在&ldquo;您需要开具发票吗？&rdquo;处选择&ldquo;是&rdquo;，并填写发票抬头选择发票内容(带星号为必填项)。发票将随商品一起送到。<br />\r\n	&nbsp;</p>\r\n<p>\r\n	<strong><span style=\"font-size:14px;\">2、设置发票信息</span></strong><br />\r\n	2.1发票抬头内容不能为空，您可写个人或公司名称。<br />\r\n	2.2发票内容明细中只能填写服装、鞋、家居、配饰、化妆品、家电或商品<br />\r\n	&nbsp;</p>\r\n<p>\r\n	<strong><span style=\"font-size:14px;\">3 、开发票的注意事项</span></strong><br />\r\n	3.1发票金额不能高于订单金额。<br />\r\n	3.2非现金支付的金额不开发票。例如优惠券支付的金额。<br />\r\n	3.3购买现金卡时按照实际价格开具发票，现金卡使用时不再开具发票。<br />\r\n	&nbsp;</p>\r\n<p>\r\n	<strong><span style=\"font-size:14px;\">4、补发票说明</span></strong><br />\r\n	4.1发票可以补100天之内订购的订单。<br />\r\n	4.2补开发票需提供&ldquo;天下名品发货单&rdquo;或详细的订购信息。<br />\r\n	4.3请您提供正确的地址，我们会在补开发票后以挂号信方式为您寄出，请注意查收。<br />\r\n	4.4收到发票后如发现发票抬头、内容或金额等与您下订单时所填写的项目不符，请先与客服中心联系确认后，将原发票退回天下名品才予以重开。<br />\r\n	地址：北京市通州区枢密院<br />\r\n	邮编：101100<br />\r\n	天下名品投资发展有限公司（收）<br />\r\n	<br />\r\n	<strong><span style=\"font-size:14px;\">5、入驻商家发货的商品的发票开具</span></strong><br />\r\n	5.1入驻商家发货的订单，发票直接由入驻商家开具并寄出。在订单确认页面开具发票处，会提示您&ldquo;部分入驻商家开具的发票会在您收货后单独为您邮寄，请注意分别查收。&rdquo;<br />\r\n	5.2如果您购买了多个入驻商家发货的商品，每个入驻商家发货的商品会单独形成一张订单，发票直接由各入驻商家开具寄出。<br />\r\n	5.3部分入驻商家发货的订单，其发票会在订单发货后单独寄出（一般会在发货后4-5天发出），请您在收到商品后耐心等待，若超过一周还未收到发票，请联系天下名品客服查询。<br />\r\n	5.4入驻商家发货商品，只能开具入驻商家所售的商品类型，若您选择的发票类型不属于入驻商家发货类型，将无法开具，请您谅解。</p>\r\n','3738448167,3763727635,','2014-11-02 15:48:39'),(76,'退换货政策','<p style=\"text-align: center;\">\r\n	<strong><span style=\"font-size:14px;\">天下名品商城退换货总则</span></strong></p>\r\n<p>\r\n	<strong><span style=\"font-size:14px;\">一、 无理由退货政策</span></strong></p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp; 1. 天下名品承诺，对于您（作为消费者）通过天下名品网站购买的商品，若商品能够保持出售时原状且配件、赠品（如有）齐全的，则自商品收货之日起，可享受&ldquo;7天无理由退货&rdquo;政策，您可在线进行申请退货；并需自行将商品寄回且承担相关运费；但根据法律规定及商品性质，如下商品不享受&ldquo;7天无理由退货&rdquo;政策：</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp; （1）消费者定制商品；<br />\r\n	&nbsp;&nbsp;&nbsp; （2）鲜活易腐商品，例如鲜花、绿植、果蔬、低温乳品、速冻食品等；<br />\r\n	&nbsp;&nbsp;&nbsp; （3）在线下载或消费者拆封的音像制品、计算机软件等数字化商品；<br />\r\n	&nbsp;&nbsp;&nbsp; （4）交付的报纸、期刊类商品；<br />\r\n	&nbsp;&nbsp;&nbsp; （5）食用类商品，例如食品、保健品、饮料、药品、酒类、奶粉、婴儿辅食等；<br />\r\n	&nbsp;&nbsp;&nbsp; （6）贵重类商品，例如钻石、贵金属、手表、珠宝、奢侈品等；<br />\r\n	&nbsp;&nbsp;&nbsp; （7）个人护理、贴身类商品，例如计生用品、美护、内衣、贴身袜裤等；；<br />\r\n	&nbsp;&nbsp;&nbsp; （8）虚拟类商品，例如礼品卡、手机充值、游戏点卡等充值类商品，以及门票、机票、旅游套餐等一次性消费服务类商品等；<br />\r\n	&nbsp;&nbsp;&nbsp; （9）特殊类商品，例如运营商合约手机以及二手品、处理品等；<br />\r\n	&nbsp;&nbsp;&nbsp; （10）其他根据商品性质不宜退货的商品。</p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp; 2. &ldquo;7天无理由退货&rdquo;政策，目前仅支持退货，不支持换货。<br />\r\n	&nbsp;&nbsp;&nbsp; 3. 对于上述&ldquo;7天无理由退货&rdquo;政策的适用，如商家与您另有约定的，则优先适用该约定，但该约定与 法律规定相冲突及低于&ldquo;天下名品退换货政策&rdquo;标准的除外。</p>\r\n<p>\r\n	<br />\r\n	<strong><span style=\"font-size:14px;\">二、 有理由退换货政策</span></strong><br />\r\n	&nbsp;&nbsp;&nbsp; 1. 天下名品承诺，如您通过天下名品网站购买的商品出现国家法律所规定的功能性故障或商品质量问题，则自您所购商品收货之日起，7天内可以退货，15天内可以换货，如涉及保修则在保修期内可以保修，您可在线进行申请退换货，运费由该商品所售商家承担。</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/5/5r8b8a5e315133242usn.jpg\" style=\"width: 663px; height: 135px;\" /></p>\r\n<p>\r\n	&nbsp;&nbsp;&nbsp; 2. 如您所购商品在收货之日起15天内出现非质量问题，例如图物差异、商品破损等，则您可在线进行退换货申请，根据实际问题情况，会对您提交的退换货申请进行审核，并将于1个工作日内向您反馈审核通过与否的结果。</p>\r\n<p>\r\n	&nbsp;</p>\r\n','3738448167,1361742631,','2014-11-02 15:49:26'),(77,'退换货注意事项','<p>\r\n	1、判断实际收货日期规则<br />\r\n	1.1天下名品配送的订单<br />\r\n	客户实际签收日期视为实际收货日期；<br />\r\n	1.2商家配送的订单<br />\r\n	以第三方物流平台显示的实际到货日期为准。如果商家不能有效反馈签收日期，则天下名品将根据距离等因素与客户人工确认实际到货日期。<br />\r\n	<br />\r\n	2、一张订单仅为客户提供一次退换货服务。</p>\r\n<p>\r\n	如遇同款商品缺货或断货，天下名品及商家则无法办理换货。目前只可提供商品一换一服务（仅限支持换货的商品），换货时无法加订商品。<br />\r\n	<br />\r\n	3、客户应确保退换货时，商品包装、吊牌、标识需完整，商品未经穿着、无脏污、破损（如未自行修改尺寸、洗涤、皮具打蜡、刺绣等），且需将发货单、商品配件、说明书、赠品及所需退换商品一并寄回，否则将会影响办理退换货。特别注意：鞋类商品包装损坏（包括包裹填充物、品牌包装箱或外包装袋、鞋盒外直接缠胶带），以及鞋面、鞋底已磨损，已有穿着痕迹的情况，均不予以办理退换货。<br />\r\n	<br />\r\n	4、如客户购买商品时天下名品或商家已提供发票，则办理退货或订单金额发生变更的换货时，需将发票随商品一同返还。客户应妥善保管发票，如发票丢失、损毁、涂改，将无法办理退换货。<br />\r\n	<br />\r\n	5、如客户对礼包、套装中商品或在满减等优惠活动中购买的商品进行部分退换，将无法享受礼包、套装或在满减等优惠活动中购买时的优惠。商品销售页面或活动规则中明确标注不支持部分退换货的，则天下名品或商家将按照该特殊政策或规则执行。<br />\r\n	<br />\r\n	6、原订单参与满98元免运费活动（全场免运费活动期间除外），若办理退换货，退换货后订单金额小于免运费金额时，需支付订单运费；运费金额会在您的实际退款中扣除。<br />\r\n	<br />\r\n	7、以下情况不予办理退换货：<br />\r\n	7.1任何非由本网站出售的商品，不予办理退换货；<br />\r\n	7.2任何已使用商品，不予办理退换货，但有质量问题除外；<br />\r\n	7.3密封产品原包装已打开或破损（如一次性封贴或者胶条封箱被拆开或已破损），不予办理退换货；<br />\r\n	7.4任何因非正常使用及保管导致出现质量问题的商品，不予办理退换货；<br />\r\n	7.5以到付、平邮、挂号信方式退回商品，不予办理退换货。<br />\r\n	7.6本网站所售商品如在国家规定的三包商品范围内，退换货按国家相关政策、法规执行。</p>\r\n','3738448167,1361742631,','2014-11-02 15:50:06'),(78,'退换货办理流程','<p>\r\n	<strong><span style=\"font-size:14px;\">一、天下名品自营商品退换货政策</span></strong></p>\r\n<p>\r\n	<strong>无理由退换货流程</strong></p>\r\n<p>\r\n	<img alt=\"\" src=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/5/k283s758rjk7u8o82x64.png\" style=\"width: 650px; height: 279px;\" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong>有理由退换货流程</strong></p>\r\n<p>\r\n	<img alt=\"\" src=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/5/6auglk5vasxf142w2221.png\" style=\"width: 650px; height: 279px;\" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<span style=\"font-size:14px;\"><strong>二、天下名品入驻商家商品退换货政策</strong></span></p>\r\n<p style=\"text-align: center;\">\r\n	<span style=\"font-size:12px;\"><strong>天下名品入驻商家退换货流程</strong></span></p>\r\n<p>\r\n	<img alt=\"\" src=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/5/ajo52ja3782mtjtv246n.png\" style=\"width: 650px; height: 279px;\" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	&nbsp;</p>\r\n','3738448167,1361742631,','2014-11-02 15:51:37'),(80,'售后维修','<p>\r\n	1、天下名品自有品牌的小家电、手表类商品若签收30天后出现质量问题可安排维修。<br />\r\n	商品是否保修及保修时间按单品页面说明为准，请在网站商品说明页面进行确认（通常保修时间分别为3个月、6个月、1年）。<br />\r\n	确认为保修商品后，按以下流程进行办理：<br />\r\n	<img alt=\"\" src=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/5/u8cv1jo812252lue851i.png\" style=\"width: 800px; height: 178px;\" /></p>\r\n<p>\r\n	2、商家物流配送的手表、数码家电类商品请根据各商家制定的维修流程办理维修事宜。</p>\r\n','3738448167,1361742631,','2014-11-02 15:52:16'),(81,'天下名品APP介绍','<p>\r\n	<strong><span style=\"font-size:14px;\">天下名品触屏版客户端介绍</span></strong><br />\r\n	（简称天下名品APP）<br />\r\n	天下名品APP是天下名品网上商城专为手机用户免费定制的购物软件，它与天下名品网上万产品库对接，拥有商品搜索、浏览、收藏、查物流、购物车等功能，保持用户的体验与PC端毫无差异。天下名品APP在保证用户完善的购物体验的同时，更了解用户的个性化需求，目前天下名品APP有以下特色功能。<br />\r\n	<img alt=\"\" src=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/5/c11y88i31wvvg7i1lpu4.png\" style=\"width: 400px; height: 712px;\" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong><span style=\"font-size:14px;\">天下名品APP功能说明</span></strong><br />\r\n	天下名品APP可以实现搜索、浏览、收藏、购买天下名品网上商城产品，购物车，物流查询， 促销推荐等功能。</p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong><span style=\"font-size:14px;\">首页展示</span></strong><br />\r\n	天下名品APP首页以专题图片及视频的形式展现，方便触摸屏手机用户使用习惯的同时，更了解用户的需求，精心准备出几大推荐专题，指尖滑动顺畅浏览中一定有惊喜；&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/5/s8636fnlb7p7vgf14l7x.png\" style=\"width: 400px; height: 712px;\" />&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;<br />\r\n	<br />\r\n	<strong><span style=\"font-size:14px;\">产品分类</span></strong><br />\r\n	分类浏览功能，产品分类条理清晰，与电脑上的天下名品网站浏览体验一样棒；</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/5/b5i67wr7yop1m8gtmo38.png\" style=\"width: 400px; height: 712px;\" /><br />\r\n	&nbsp;<br />\r\n	<br />\r\n	<strong><span style=\"font-size:14px;\">产品搜索</span></strong><br />\r\n	搜索结果人性化排序，更有类目筛选功能，方便快捷淘宝贝；</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/5/81hwmr255l317r7xgi4s.png\" style=\"width: 400px; height: 712px;\" />&nbsp;<br />\r\n	<br />\r\n	<strong><span style=\"font-size:14px;\">浏览商品</span></strong><br />\r\n	浏览商品大图功能。天下名品手机客户端用户独享，商品细节更清晰，更方便找宝贝；</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/5/o1i57oh1k5v222l142bq.png\" style=\"width: 400px; height: 712px;\" /><br />\r\n	<br />\r\n	<strong><span style=\"font-size:14px;\">购物车</span></strong><br />\r\n	把要买的宝贝都放入购物车一起支付，方便购买多件商品；</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/5/2c243k25286jb3s8841f.png\" style=\"width: 400px; height: 712px;\" /><br />\r\n	<br />\r\n	<strong><span style=\"font-size:14px;\">移动支付</span></strong><br />\r\n	确认购物车里的商品和个人收货信息无误后，即可成功提交手机天下名品订单，支持货到付款支付和优惠券，资金账户支付；<br />\r\n	<br />\r\n	<strong><span style=\"font-size:14px;\">查看物流</span></strong><br />\r\n	实时掌握购买商品的物流状态，看着宝贝送到家；<br />\r\n	<br />\r\n	<strong><span style=\"font-size:14px;\">分享功能</span></strong><br />\r\n	用户看到喜欢的商品后，不仅可以添加到收藏夹，还可以保存到手机相册，或者添加到电子邮件发送，丰富了用户的个性化购物体验。</p>\r\n','3738448167,3144812548,','2014-11-02 15:54:32'),(82,'APP注册登录','<p>\r\n	<strong><span style=\"font-size:14px;\">天下名品商城PC端（网页版）与移动客户端（APP）用户通用，可随时随地轻松购物。</span></strong></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<strong><span style=\"font-size:14px;\">新用户注册</span></strong><br />\r\n	请选择&ldquo;注册&rdquo;并输入邮箱和密码，完成注册。</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/5/sv68577pq34h1276n8mv.png\" style=\"width: 400px; height: 712px;\" /><br />\r\n	&nbsp;</p>\r\n<p>\r\n	<strong><span style=\"font-size:14px;\">老用户登录</span></strong><br />\r\n	如果您是老用户，请直接输入账号和密码登录。</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/5/o53y76n71y6wb24gysix.png\" style=\"width: 400px; height: 712px;\" /><br />\r\n	&nbsp;</p>\r\n','3738448167,3144812548,','2014-11-02 15:56:33'),(83,'APP购物流程','<p style=\"text-align: center;\">\r\n	<strong><span style=\"font-size:14px;\">天下名品APP客户端购物流程说明</span></strong></p>\r\n<p>\r\n	<img alt=\"\" src=\"http://static.txmp.com.cn/img/admin/ckeditor/2014/11/5/2ikq365g5752du2lc5i6.jpg\" style=\"width: 400px; height: 533px;\" /></p>\r\n<p>\r\n	1、开通手机上网功能，访问天下名品手机触屏版或天下名品手机客户端。<br />\r\n	2、通过搜索或分类浏览查找到您想要购买的商品。<br />\r\n	3、选择订购此商品的尺码和数量，点击&ldquo;加入购物车&rdquo;按钮，放入购物车。<br />\r\n	4、确认购物车中的商品信息后，登录您的账户，点击&ldquo;去结算&rdquo;按钮。<br />\r\n	5、仔细核对您的订单信息，确认无误后，点击&ldquo;确认购买&rdquo;按钮。<br />\r\n	6、生成订单号后，表示您已成功提交了订单。<br />\r\n	7、您可以通过点击&ldquo;我的天下名品&rdquo;来查看订单信息和物流状态。<br />\r\n	8、等待快递送货上门，验证无误后签收商品。</p>\r\n<p>\r\n	&nbsp;</p>\r\n','3738448167,3144812548,','2014-11-02 15:57:58'),(84,'天下名品APP安装','<p>\r\n	<strong><span style=\"font-size:14px;\">天下名品APP客户端提供安卓系统和IOS系统两个版本；</span></strong><br />\r\n	<br />\r\n	<strong><span style=\"font-size:14px;\">Android系统客户端</span></strong><br />\r\n	网站下载:<a href=\"http://www.txmp.com.cn/m/android.html\">http://www.txmp.com.cn/m/android.html</a>页面，点击右侧&ldquo;立即下载&rdquo;按钮，下载到电脑，用数据线同步到手机。<br />\r\n	触屏版下载:请直接在手机浏览器中输入如下地址下载：http://mimages.txmp.com.cn/m/<br />\r\n	<br />\r\n	<strong><span style=\"font-size:14px;\">IOS系统客户端</span></strong><br />\r\n	通过iTunes安装：下载本应用到电脑上的iTunes，使用数据线同步到手机<br />\r\n	通过苹果应用商店（app store）下载安装：用您的iPhone或itouch打开app store应用；在搜索框中输入&ldquo;天下名品网上商城&rdquo;并点击搜索；选择&ldquo;天下名品网上商城&rdquo;并下载安装。</p>\r\n','3738448167,3144812548,','2014-11-02 15:58:39'),(86,'到店自提','<p>\r\n	<strong><span style=\"font-size:14px;\">一、到店自提服务介绍</span></strong><br />\r\n	自提服务是天下名品为顾客提供的一种新的配送方式，方便顾客安排合适时间进行提货，目前天下名品实体店（直营+加盟）和天下名品合作实体店提供到店自提服务。</p>\r\n<p>\r\n	<strong><span style=\"font-size:14px;\">二、 天下名品自提服务范围</span></strong><br />\r\n	目前开通自提的区域有深圳、北京，其他城市陆续开通中，敬请期待......<br />\r\n	<br />\r\n	<strong><span style=\"font-size:14px;\">三、到店自提常见问题</span></strong><br />\r\n	1. 都有哪些商品不可以自提？<br />\r\n	天下名品目前不支持入驻卖家（由卖家销售）、大家电、生鲜食品、以及一些体积超大的商品自提。<br />\r\n	2. 下单之后可以更换自提点或更换配送方式吗？<br />\r\n	天下名品订单选择具体自提门店后暂不支持转到其他自提点或转为其它配送方式。<br />\r\n	3. 为何结算时无法选择自提？<br />\r\n	在以下情况下，有可能无法为您提供自提服务：<br />\r\n	? 您所购买的为大家电，生鲜等暂不支持自提的商品，详情以下单时所支持配送方式为准；<br />\r\n	? 您的购物车中商品较多，超过了该自提点支持的最大下单重量、体积、金额；<br />\r\n	? 你选择的收货地址没有自提服务；<br />\r\n	4. 自提时验货发现问题，可以当场退货吗？如何处理？<br />\r\n	目前天下名品店（直营+加盟）提供门店当场退货服务及开箱验货服务，天下名品合作店暂不支持当场退换货服务，如发现问题请致电天下名品客服客服电话：400-6666-288.<br />\r\n	5、自提时需要提供哪些凭证？<br />\r\n	为了保护你的权益请确保下单时候使用的姓名，与您的身份证姓名一致。如果您代他人提货，请准备好下单人的身份证及你本人身份证，同时告知订购时预留手机号码的后四位！<br />\r\n	<br />\r\n	&nbsp;</p>\r\n','3738448167,4531735175,','2014-11-05 14:17:24'),(87,'关于天下名品网上商城','<p>\r\n	天下名品网上商城（mall.txmp.com.cn）是天下名品产业投资发展有限公司发起，集优秀管理团队、先进技术团队、专业服务团队于一体的科技型零售服务网站。总部位于北京CBD商务区。 天下名品彻底改变传统零售行业的销售模式，以全新的科技为依托，采用实体店铺连锁加盟、网络以及终端设备服务相结合的新零售经营模式，将优质的商品与便利的服务带给广大消费者。 目前，天下名品包括天下名品B2B2C商城、行业B2C商城、商业机器人以及智能手机APP购物商城，公司通过线上线下O2O（Online to Offline线上线下商务与互联网结合）模式，真正实现便利店与电子商务的无缝完美结合，为消费者打造&ldquo;3分钟幸福生活圈&rdquo;。 天下名品通过线上与线下紧密结合的商品销售模式，彻底打破传统零售模式与传统电子商务模式，通过天下名品社区网购店的线下推广；商业机器人（整屏品牌宣传推广，分屏电子商务城）；天下名品PC商城；移动APP购物商城的商品销售，四者整合为一，紧密结合。通过天下名品商城来满足消费者大批量采购需求，进而打通网络销售渠道，建立庞大会员基础，并在此基础上拓展业务范围和加强粉丝营销力度，打造成为综合性多元化服务平台，从而为消费者提供最好的购物体验以及生活服务，建设顾客一站式幸福生活体验店。</p>\r\n','1848773281,','2014-11-10 18:16:17'),(88,'联系我们','天下名品产业投资发展有限公司\r\n\r\n北京：\r\n\r\n地 址：北京市朝阳区东三环中路39号建外SOHO \r\n\r\n邮编：100022  \r\n\r\n电话：010-58699138\r\n\r\n客服热线： 400 680 9955\r\n\r\n传真：010-58699138-8006 \r\n\r\n邮箱：cfcm@cfcm.com.cn \r\n\r\n企业网站：http://www.txmp.com.cn \r\n\r\n地铁路线：\r\n\r\n乘坐地铁1号线至国贸站，往三环过大北窑公交站台，穿过大门右拐，星巴克对面，步行约5-10分钟；\r\n\r\n公交路线：\r\n\r\n28路、214路、348路、57路、601路、627路、683路、686路、707路、805路快、806路、808路、810路、846路、814路、954路、974路、976路、976路区间快车、998路、运通107路。公交车均可直达到。。\r\n\r\n深圳：\r\n\r\n地 址：深圳中心区CBD南区福华三路卓越世纪3203\r\n\r\n邮编：518000 \r\n\r\n电话：0755-88912292\r\n\r\n客服热线： 400 666 6288\r\n\r\n传真：010-58699138-8006 \r\n\r\n邮箱：cfcm@cfcm.com.cn \r\n\r\n企业网站：http://www.txmp.com.cn \r\n\r\n地铁路线：\r\n\r\n乘坐地铁1号罗宝线、4号龙华线至会展中心站，往E出口，穿过金中环酒店右拐，走到十字路口即可，步行约5分钟。\r\n\r\n公交路线：\r\n\r\n乘坐34路; 50路; 221路; K113路至岗厦村，71路； 乘坐398路至大中华国际广场，33路; 38路; 56路; 60路; 62路; 80路; 103路B线；乘坐109路; 214路; 375路; 379路至世纪广场；乘坐26路; 28路; 47路; 109路; 229路; 235路; 337路; 338路; 353路; 357路; 362路; 364路; 367路; 372路空调; 382路至联合广场；公交车均可直达到。步行约2分钟。','1848773281,','2014-11-10 18:18:31');

