/*Table structure for table `advpos` */

DROP TABLE IF EXISTS `advpos`;

CREATE TABLE `advpos` (
  `pos_id` int(11) NOT NULL AUTO_INCREMENT,
  `pos_name` varchar(50) NOT NULL,
  `cat_attr` varchar(200) NOT NULL,
  `pos_desc` varchar(200) DEFAULT NULL,
