  `p_height` int(11) DEFAULT NULL,
  `img_path` varchar(100) DEFAULT NULL,
  `sort_no` int(11) DEFAULT NULL,
  `in_date` datetime DEFAULT NULL,
  PRIMARY KEY (`pos_id`)
) ENGINE=InnoDB AUTO_INCREMENT=306 DEFAULT CHARSET=utf8 COMMENT='记录广告位信息';

