/*Table structure for table `api_movie_sms_voucher` */

DROP TABLE IF EXISTS `api_movie_sms_voucher`;

CREATE TABLE `api_movie_sms_voucher` (
  `Id` int(11) NOT NULL AUTO_INCREMENT,
  `order_id` varchar(17) NOT NULL DEFAULT '' COMMENT '订单编号',
  `order_status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '使用状态,1:已成功;2:失败3:取消4:未处理5:退款成功',
  `order_time` datetime DEFAULT '0000-00-00 00:00:00' COMMENT '下单时间',
  `pay_status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '支付状态,1:未支付;3：已支付;6：内部全额退款;8:银行全额退款',
  `position` varchar(255) DEFAULT NULL COMMENT '终端位置说明',
  `voucher_no` varchar(255) NOT NULL DEFAULT '' COMMENT '凭证编号',
  `voucher_id` varchar(255) NOT NULL DEFAULT '' COMMENT '凭证ID,用于验证的凭证ID',
  `barcode_image` text COMMENT '条形码图,Base64格式',
  `use_status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '凭证使用状态,1:未使用;2:已使用;3:使用完;4:过期;5:取消',
  `sms_content` varchar(500) NOT NULL DEFAULT '' COMMENT '短信内容',
  `mms_content` varchar(500) NOT NULL DEFAULT '' COMMENT '彩信内容',
  `send_time` datetime DEFAULT '0000-00-00 00:00:00' COMMENT '下发时间',
  `send_status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '下发状态:1:提交网关;2:下发成功;3:下发失败',
  `send_type` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '下发方式,0：不下发;1：下发短信;2：下发彩信;3：下发短彩信',
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='电影票短信凭证';

/*Data for the table `api_movie_sms_voucher` */

