/*Table structure for table `api_tour_order` */

DROP TABLE IF EXISTS `api_tour_order`;

CREATE TABLE `api_tour_order` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `code` varchar(200) DEFAULT NULL COMMENT '终端编码',
  `username` varchar(50) DEFAULT NULL COMMENT '用户姓名',
  `mobile` varchar(20) DEFAULT NULL COMMENT '用户手机号',
  `idcard` varchar(20) DEFAULT NULL COMMENT '用户身份证',
  `product_name` varchar(2000) DEFAULT NULL COMMENT '产品名称',
  `type` varchar(50) DEFAULT NULL COMMENT '产品型号',
