  `status` varchar(20) DEFAULT NULL COMMENT '支付状态',
  `metadata` text COMMENT '发送数据的元数据',
  `date` datetime DEFAULT NULL COMMENT '插入时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=66 DEFAULT CHARSET=utf8;

