/*Table structure for table `area` */

DROP TABLE IF EXISTS `area`;

CREATE TABLE `area` (
  `area_id` char(10) NOT NULL,
  `area_name` varchar(20) NOT NULL,
  `en_name` varchar(50) NOT NULL,
  `up_area_id` char(10) NOT NULL,
  `area_level` char(1) NOT NULL,
  `sort_no` int(11) NOT NULL DEFAULT '0',
  `is_city` char(1) NOT NULL DEFAULT '0',
  `seotitle` varchar(100) DEFAULT NULL,
  `seokeyword` varchar(100) DEFAULT NULL,
  `seodesc` varchar(200) DEFAULT NULL,
  `area_have` varchar(10) DEFAULT NULL,
  `is_open` char(1) DEFAULT '0' COMMENT '0：未开通子站 1：已开通子站',
  PRIMARY KEY (`area_id`),
  KEY `up_area_id` (`up_area_id`)
