/*Table structure for table `buyercoupon` */

DROP TABLE IF EXISTS `buyercoupon`;

CREATE TABLE `buyercoupon` (
  `id` mediumint(9) NOT NULL AUTO_INCREMENT,
  `c_id` mediumint(9) DEFAULT NULL,
  `give_cust_id` mediumint(9) NOT NULL,
  `give_user_id` mediumint(9) NOT NULL,
  `cust_id` mediumint(9) NOT NULL,
  `c_name` varchar(50) NOT NULL,
  `c_img` varchar(60) DEFAULT NULL,
  `c_type` char(1) NOT NULL COMMENT '0:优惠金额 1:优惠积分 2:优惠折扣',
  `c_money` decimal(10,2) DEFAULT NULL,
  `c_inter` int(11) DEFAULT NULL,
  `c_discount` float DEFAULT NULL,
  `start_time` datetime NOT NULL,
  `end_time` datetime NOT NULL,
  `coupon_times` int(11) NOT NULL DEFAULT '0',
  `coupon_num` int(11) NOT NULL DEFAULT '0',
  `is_every` char(1) NOT NULL COMMENT '0:启用 1：禁用',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COMMENT='记录买家优惠卷拥有信息';

