/*Table structure for table `category` */

DROP TABLE IF EXISTS `category`;

CREATE TABLE `category` (
  `cat_id` char(10) NOT NULL,
  `cat_name` varchar(50) NOT NULL,
  `en_name` varchar(50) NOT NULL,
  `word_index` char(1) NOT NULL COMMENT '拼音的第一个字母',
  `up_cat_id` char(10) NOT NULL,
  `cat_level` char(1) NOT NULL,
  `module_type` varchar(10) NOT NULL DEFAULT '' COMMENT '见参数配置表',
  `is_display` char(1) NOT NULL DEFAULT '' COMMENT '0：显示 1：隐藏',
  `sort_no` int(11) NOT NULL,
  `member_add` char(1) NOT NULL COMMENT '0：允许 1：禁止',
  `seotitle` varchar(100) DEFAULT NULL,
  `seokeyword` varchar(100) DEFAULT NULL,
  `seodesc` varchar(200) DEFAULT NULL,
  `mem_type` varchar(1) DEFAULT '' COMMENT '0：企业 1：个人 2：不限',
  `cat_intr` text,
  `cat_simple` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`cat_id`),
  KEY `module_type` (`module_type`),
  KEY `up_cat_id` (`up_cat_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='记录功能模块分类信息';

