r\n	&nbsp;&nbsp;&nbsp; 类型：其他<br />\r\n	&nbsp;&nbsp;&nbsp; 产地：丹麦<br />\r\n	&nbsp;&nbsp;&nbsp; 生活方式：早餐/正餐/小资DIY/节日/上班族/下午茶/出游/送礼/聚会<br />\r\n	&nbsp;&nbsp;&nbsp; 饼干形状：块状<br />\r\n	&nbsp;&nbsp;&nbsp; 曲奇种类：曲奇<br />\r\n	&nbsp;&nbsp;&nbsp; 净重(g)：125<br />\r\n	&nbsp;&nbsp;&nbsp; 食品保质期：540</p>\r\n',NULL,'2014-11-10 00:00:00','2014-12-11 00:00:00','0.00','11.90','0.00',NULL,0,19,5,1,NULL,NULL,NULL,NULL,'0','0',NULL,NULL,NULL,NULL,NULL,'','','1',NULL,'1','2014-11-10 17:33:46',NULL,'0.00',NULL,'8352811563','1'),(602,25,'3347553812,6771682731,6128777182','',NULL,'Kjeldsens丹麦蓝罐 曲奇饼干 908g 丹麦进口','GN-20141111092929228','丹麦蓝罐 送礼体面过人 饼干礼盒 中秋 国庆 进口礼盒',NULL,'丹麦蓝罐 送礼体面过人 饼干礼盒 中秋 国庆 进口礼盒','/goods/2014/11/11/8g25787ahpq61644tu7q.jpg,/goods/2014/11/11/847ss87x88gy62522vwm.jpg,/goods/2014/11/11/582l8jp18om42pu2aa44.jpg,/goods/2014/11/11/8hbc6133wn6dopw333g6.jpg',NULL,'<div class=\"content\">\r\n	<h3 class=\"productDescriptionSource\">\r\n		商品描述</h3>\r\n	<div class=\"productDescriptionWrapper\">\r\n		<div class=\"aplus\">\r\n			<h4>\r\n				来自厂家关于保质期的说明：</h4>\r\n			丹麦奇新蓝罐有限公司一直积极进取维持优良产品质素及包装质量，确保每一片美味的曲奇都是黄金，松脆，充满新鲜黄油香味。<br />\r\n			为提升更好的产品及包装质量，丹麦奇新蓝罐有限公司投放大量资源与丹麦科技学院紧密合作研发最新包装方式，我们非常荣幸能够介绍最新的包装，这个新设计加强了密封的效果，在贮藏方面能有效地减少因外在元素影响曲奇的质量。<br />\r\n			最新的密封设计能够有效增加曲奇的保鲜度，保质期的时间亦相对延长，带来每一口的美味曲奇是更加松，更加脆。我们有信心这个新研发会令消费者对我们产品的评价提升。<br />\r\n			根据测试，最新的密封设计比现有的密封方法增加达4倍的密封效果。通过这个成功的研发，产品的保质期从18个月得以延长到达24个月，更加能满足我们对高质量的严格要求。<br />\r\n			包装处在更替升级阶段，由于批次库存的原因，短期内同时存在18个月和24个月两种保质期的包装，产品品质一致，请放心食用。<br />\r\n			<h4>\r\n				Kjeldsens丹麦蓝罐曲奇908g</h4>\r\n			<p>\r\n				Kjeldsens丹麦蓝罐曲奇在曲奇饼食品中，可谓大名鼎鼎，它始于1933年，至今一直沿用新鲜牛油及加仑子等天然原料烘制，成品色泽金黄，口感香醇，有一股香浓的奶油香味。再配上款款不同的造型，使得每一块曲奇都宛若一件小巧的艺术品，让人爱不释手。</p>\r\n			<p>\r\n				2009 年，丹麦藍罐曲奇荣获丹麦女王陛下玛格丽特二世赐予的「丹麦皇室御用品牌」认证，成为丹麦皇室御用品牌，尽显皇室尊贵。故此丹麦蓝罐曲奇新的包装 上印有「丹麦皇室御用」的金色皇冠徽章，这徽章只赐予真正的丹麦蓝罐曲奇使用，品牌超凡地位毋庸置疑，并非一般曲奇品牌可随便使用。</p>\r\n			<div class=\"leftImage\">\r\n				<img alt=\"Kjeldsens丹麦蓝罐曲奇908g\" data-original=\"http://g-ec4.images-amazon.com/images/G/28/foodchatu/B003NNUHRM1.jpg\" height=\"229\" src=\"http://g-ec4.images-amazon.com/images/G/28/foodchatu/B003NNUHRM1.jpg\" style=\"float: left;\" width=\"260\" /></div>\r\n			<strong>优质曲奇值得细味的质量</strong><br />\r\n			丹麦藍罐从生产曲奇，到品牌推广都一丝不苟。对于产质量素，我们注重：\r\n			<ul>\r\n				<li style=\"list-style-position: inside;\">\r\n					卫生</li>\r\n				<li style=\"list-style-position: inside;\">\r\n					原材料质量</li>\r\n				<li style=\"list-style-position: inside;\">\r\n					生产技术</li>\r\n				<li style=\"list-style-position: inside;\">\r\n					质量监控</li>\r\n				<li style=\"list-style-position: inside;\">\r\n					产品标准</li>\r\n				<li style=\"list-style-position: inside;\">\r\n					加强烘焙師傅的能力</li>\r\n				<li style=\"list-style-position: inside;\">\r\n					技巧</li>\r\n			</ul>\r\n			丹麦藍罐曲奇的生产过程都遵照《危害分析重要管制条例》，并获得：\r\n			<ul>\r\n				<li style=\"list-style-position: inside;\">\r\n					「国际食物安全甲级」证书</li>\r\n				<li style=\"list-style-position: inside;\">\r\n					「IFS国际食品标准」证书</li>\r\n			</ul>\r\n			为确保产品的原材料能保持上佳质量，我们会定期审查各个原料供货商。除了保持产品的质量外，高效率和有系统的生产流程，都能巩固丹麦藍罐与消费者的互信、良好的关系，满足消费者的需求。\r\n			<div class=\"rightImage\">\r\n				<img alt=\"Kjeldsens丹麦蓝罐曲奇908g\" data-original=\"http://g-ec4.images-amazon.com/images/G/28/foodchatu/B003NNUHRM2.jpg\" height=\"230\" src=\"http://g-ec4.images-amazon.com/images/G/28/foodchatu/B003NNUHRM2.jpg\" style=\"float: right;\" width=\"248\" /></div>\r\n			<h4>\r\n				曲奇故事</h4>\r\n			<ul>\r\n				<li>\r\n					第一次制造曲奇是由数片细少的蛋榚组合而成。据考据，Cookie的制作法，是由伊朗人发明的。</li>\r\n				<li>\r\n					「Cookie」这个字通过粤语传播入中文，粤音读起来极像原文，但如以普通话读则完全失真。在英式英语中，Cookie主要用作分辨美式饼干如&quot;朱古力饼干&quot;。</li>\r\n				<li>\r\n					在曲奇饼食品中，丹麦蓝罐曲奇可谓大名鼎鼎，它始于1933年，至今一直沿用新鲜牛油及加仑子等天然原料烘制，成品色泽金黄，口感香醇，有一股香浓的奶油香味。</li>\r\n				<li>\r\n					丹麦人喜爱曲奇，源自他们古老的家庭传统。以前，每年快到圣诞节的时候，家家户户都要准备至少四样的曲奇，很多家庭制作的秘方都一直沿用至今。</li>\r\n				<li>\r\n					那时候评判一家的主妇是否能干，是否勤快，主要看餐桌上的曲奇种类，种类越多，证明主妇的能力越强。</li>\r\n				<li>\r\n					久而久之，这种曲奇成了丹麦饼干的传统。丹麦的曲奇每年都源源不断地销往世界上120多个国家和地区。</li>\r\n			</ul>\r\n		</div>\r\n	</div>\r\n	<h3 class=\"productDescriptionSource\">\r\n		品牌简介</h3>\r\n	<div class=\"productDescriptionWrapper\">\r\n		<div class=\"aplus\">\r\n			<img alt=\"蓝罐曲奇\" data-original=\"http://g-ec4.images-amazon.com/images/G/28/GroceryHXF/logo/2013/impfood_logo_9._V380830200_.gif\" height=\"66\" src=\"http://g-ec4.images-amazon.com/images/G/28/GroceryHXF/logo/2013/impfood_logo_9._V380830200_.gif\" style=\"float: left;\" width=\"118\" />在欧洲，曲奇作为甜点的历史，比文字更早出现。<br />\r\n			<br />\r\n			最早的文献记载，公元前170年的古罗马时期，曲奇用作奖励小朋友，其后在宗教仪式上，作「忠告」的象征。至文艺复兴，甜的食材如蜂蜜或水果，开始加进曲 奇的配方内。时至今天，曲奇已普及至世界各地，与茶或咖啡共享，成为最受欢迎的美食。多个世纪以来，曲奇在丹麦都是健康、富庶和成就的象征。<br />\r\n			丹麦藍罐曲奇的故事，始于1933年。在丹麦日德兰半岛的一个小村庄，奇新先生爱上了一位造饼师傅的女儿&ndash; 安娜，她造的曲奇，令人一试难忘。奇新先生将安娜的曲奇，卖到其他村庄，继而遍及全国，最后决定开设第一家曲奇店。 70多年后的今天，已发展成现代化曲奇生产线，丹麦藍罐曲奇一直沿用优质黄油及各种天然成分烘制。每款曲奇均有独特之配方、烘焙方法、形状及香味，每一片 皆甘香松脆，送礼体面过人。</div>\r\n		<div class=\"emptyClear\">\r\n			&nbsp;</div>\r\n	</div>\r\n	<div class=\"seeAll\">\r\n		&nbsp;</div>\r\n</div>\r\n<p>\r\n	&nbsp;</p>\r\n',NULL,'2014-11-11 00:00:00','2015-11-11 00:00:00','0.00','118.00','0.00',NULL,0,20,5,0,NULL,NULL,NULL,NULL,'0','0',NULL,NULL,NULL,NULL,NULL,'','','1',NULL,'1','2014-11-11 09:51:53',NULL,'0.00',NULL,'1128718134','1'),(603,25,'3347553812,6771682731,6128777182','',NULL,'Danisa皇冠 曲奇饼908g促销装(进口) ','GN-20141111100140078','',NULL,'丹麦Danisa皇冠丹麦曲奇908g\r\n\r\n配料：面粉、黄油、白砂糖、鸡蛋、椰子粉、葡萄干、奶粉、食盐、食品添加剂（碳酸氢铵、香兰素）。规格：908g/罐原产国：印度尼西亚保质期：2年','/goods/2014/11/11/us4gyu12214j6yr2pyp6.jpg,/goods/2014/11/11/6vf64y3dqcnebdv2u87j.jpg,/goods/2014/11/11/5u641bh8d153g682xqjm.jpg,/goods/2014/11/11/381r453t5trpan8g8d4j.jpg',NULL,'<div class=\"productDescriptionWrapper\">\r\n	<div class=\"aplus\">\r\n		<h4>\r\n			皇冠曲奇饼尊赏皇家待遇，陶醉聚会时分。与朋友和家人共度美好时光里，让皇冠伴你一起分享！皇冠牛油曲奇，源自传统配方，精心焙制的优质曲奇饼干。无论是传统，喜庆，还是值得纪念的场合，皇冠牛油曲奇都可以陪你一起欢度；金黄色典雅高档曲奇，为你带来尊贵非凡的皇家享受。</h4>\r\n		<div class=\"centerImage\">\r\n			<img alt=\"曲奇\" data-original=\"http://g-ecx.images-amazon.com/images/G/28/foodchatu/B003NSAN2Q3._V193280129_.jpg\" height=\"450\" src=\"http://g-ecx.images-amazon.com/images/G/28/foodchatu/B003NSAN2Q3._V193280129_.jpg\" style=\"\" width=\"900\" /></div>\r\n		<h4>\r\n			&nbsp;</h4>\r\n		<p>\r\n			享 有&ldquo;皇冠&rdquo;之美誉，每块曲奇的烘焙都倾注着皇冠点心大师不变的完美追求，选用天然原料和优质牛油，精心烘焙成金黄色泽，皇冠传统牛油曲奇，浓浓牛油香味， 松脆好美味。每个人都有自己不同的方式来享受皇冠，唯一相同的是，当你第一口品尝到皇冠曲奇时，都会为她不可抗拒的美味爱上她!<br />\r\n			不同口味的皇冠曲奇饼干带给你不同的享受乐趣：满月圆、牛油卷、糖片、香草圈、葡萄干加仑子。<br />\r\n			皇冠牛油曲奇总能在你与家人的相伴时刻里带来特别的感受！</p>\r\n	</div>\r\n	<br />\r\n	&nbsp;</div>\r\n<h3 class=\"productDescriptionSource\">\r\n	品牌简介</h3>\r\n<div class=\"productDescriptionWrapper\">\r\n	皇冠曲奇（Danisa Butter Cookies）由美亚拉英达有限公司出品，其中最经典的皇冠曲奇从创始至今一直坚持使用新鲜牛油和优质面粉全手工精制而成。奶香浓郁、色泽诱人、造型独特，每一小块曲奇都令人爱不释手，回味无穷。\r\n	<div class=\"emptyClear\">\r\n		&nbsp;</div>\r\n</div>\r\n<h3 class=\"productDescriptionSource\">\r\n	安全警告</h3>\r\n<p>\r\n	常温避光保存</p>\r\n',NULL,'2014-11-11 00:00:00','2015-11-11 00:00:00','125.00','86.80','0.00',NULL,0,20,5,0,NULL,NULL,NULL,NULL,'0','0',NULL,NULL,NULL,NULL,NULL,'','','1',NULL,'1','2014-11-11 10:04:43',NULL,'0.00',NULL,'6638318838','1'),(604,25,'3347553812,6771682731,5417813774','',NULL,'LEE南益 巧克力口味威化饼干 200g 马来西亚进口','GN-20141111105524109','',NULL,'南益威化饼是马来西亚畅销的威化饼，也是最令人难以忘怀的威化饼，极为松脆和香浓醇滑的巧克力，真是美味到赞。','/goods/2014/11/11/yxd6fvd7y4w2c17583n2.jpg,/goods/2014/11/11/3l8b8wu351v5616bml8i.jpg,/goods/2014/11/11/b4no8d4l36fml6682637.jpg,/goods/2014/11/11/7nx66oft47868tv66462.jpg',NULL,'<p>\r\n	<img alt=\"\" src=\"http://static.txmp.com.cn/img/seller/ckeditor/2014/11/11/318gqc5xnu4n1hb6nu56.jpg\" style=\"width: 780px; height: 340px;\" /></p>\r\n<p>\r\n	<img alt=\"\" src=\"http://static.txmp.com.cn/img/seller/ckeditor/2014/11/11/1x8bm333usbo1l2jrl82.jpg\" style=\"width: 780px; height: 370px;\" /></p>\r\n<p>\r\n	<img alt=\"\" src=\"http://static.txmp.com.cn/img/seller/ckeditor/2014/11/11/4e12ngc54m4b452vr782.jpg\" style=\"width: 780px; height: 330px;\" /></p>\r\n<p>\r\n	<img alt=\"\" src=\"http://static.txmp.com.cn/img/seller/ckeditor/2014/11/11/kaa2y7qf866ygj2ybdiu.jpg\" style=\"width: 780px; height: 500px;\" /></p>\r\n<p>\r\n	<img alt=\"\" src=\"http://static.txmp.com.cn/img/seller/ckeditor/2014/11/