rc=\"http://g-ec4.images-amazon.com/images/G/28/foodchatu/B004HZYIMA1.jpg\" style=\"\" /></div>\r\n		<h4>\r\n			商品信息：</h4>\r\n		<p>\r\n			【商品名称】：益昌老街白咖啡2+1(20g*50包)</p>\r\n		<p>\r\n			【原产国】：马来西亚</p>\r\n		<p>\r\n			【净含量】：20g*50包</p>\r\n		<p>\r\n			【保质期】：720天</p>\r\n		<p>\r\n			【产品配料】：植脂末[葡萄糖浆，植物油，酪蛋白酸钠(含牛奶),乳化剂E471，稳定剂E340，抗结剂E554,&beta;-胡萝卜素E160a]，白砂糖。</p>\r\n		<p>\r\n			【储存方法】:请置于阴凉干燥清洁处存放，避免阳光直接照射。</p>\r\n		<div class=\"break\">\r\n			&nbsp;</div>\r\n		<h4>\r\n			冲泡方法：</h4>\r\n		<ol>\r\n			<li>\r\n				<p>\r\n					热饮：将一包咖啡粉倒入一杯沸热水中（180毫升），用力搅拌后，即可享用；</p>\r\n			</li>\r\n			<li>\r\n				<p>\r\n					冷饮：将一包咖啡粉倒入半杯沸热水中（90毫升），加入一茶匙炼奶，搅拌后再加入冰块，即可享用；</p>\r\n			</li>\r\n			<li>\r\n				<p>\r\n					冰沙：将一包咖啡粉倒入搅拌器，加入一大杯冰块，一小杯鲜奶，搅拌后，在上端加忌廉，即可享用。</p>\r\n			</li>\r\n		</ol>\r\n		<div class=\"rightImage\">\r\n			<img alt=\"益昌老街白咖啡2+1(20g*50包)  \" data-original=\"http://g-ec4.images-amazon.com/images/G/28/FOODchatu/B004HZYIJI2.jpg\" src=\"http://g-ec4.images-amazon.com/images/G/28/FOODchatu/B004HZYIJI2.jpg\" style=\"\" /></div>\r\n		<h4>\r\n			商品特色：</h4>\r\n		<ul>\r\n			<li>\r\n				<p>\r\n					益昌采用最传统的制作工艺，口感更顺滑，味道更香醇。普通咖啡是咖啡豆，加焦糖炒制而成。然后煮成咖啡原浆，烘干。</p>\r\n			</li>\r\n			<li>\r\n				<p>\r\n					这样的做法会有大量的咖啡碱和反式脂肪、脱水化合物，伤胃、钙流失、肥胖都是这些物质在作祟。白咖啡好喝是因为制作工艺，它选料正宗，而且是低温烘焙而成的，传统咖啡豆都是加焦糖炒制的，熟的快但口味不好，低温烘焙时间会比炒制时间长N倍。</p>\r\n			</li>\r\n			<li>\r\n				<p>\r\n					白 咖啡并不是指咖啡的颜色是白色的，而是指采取上等名贵咖啡豆，经低温（中轻度）烘培及特殊工艺加工后大量去除咖啡碱，去除高温碳烤所产生的焦苦与酸涩味， 将咖啡的苦酸味、咖啡因含量降到最低，不加入任何添加剂来加强味道，甘醇芳香不伤肠胃，保留咖啡原有的色泽和香味，颜色较比普通咖啡更清淡柔和，味道纯 正，故得名为白咖啡。</p>\r\n			</li>\r\n			<li>\r\n				<p>\r\n					白咖啡完全不掺杂麦粒、玉蜀黍粒等杂质，一般不含糖，低热量，咖啡因低于10%，不含任何添加剂，可以直接冲泡，保持了天然咖啡的纯正香味。</p>\r\n			</li>\r\n			<li>\r\n				<p>\r\n					喝了白咖啡不燥热、不上火，其咖啡因含量低于10%，不含任何添加剂；吸收率高，对胃肠道无任何不良刺激。因而克服了传统咖啡的弊端，患有糖尿病、心脏病、胆固醇病、高血压、肥胖病等病人都可以喝。</p>\r\n			</li>\r\n			<li>\r\n				<p>\r\n					白咖啡溶解快，匀醇可口，冰冻或冷却后口感不变差不变酸；入口爽滑、纯正、香浓，酽而不腻，不带一丝苦涩，爽神舒心，既有西方咖啡的韵味，又有东方的精巧。</p>\r\n			</li>\r\n		</ul>\r\n	</div>\r\n	<br />\r\n	&nbsp;</div>\r\n<h3 class=\"productDescriptionSource\">\r\n	品牌简介</h3>\r\n<div class=\"productDescriptionWrapper\">\r\n	上海益马昌商贸有限公司是一家专门致力于&ldquo;推动中国咖啡消费升级&rdquo;的创新型现代市场营销公司。 　　秉着&ldquo;高品位、更健康&rdquo;的宗旨，公司专注于推广来自马来西亚原装进口的&ldquo;益昌老志行&rdquo;品牌、&ldquo;益昌老街&rdquo;品牌的白咖啡、香滑拉茶等风味饮品，同时也提 供世界顶级的全自动现调咖啡机。 　　作为中国大陆最早最专业从事白咖啡事业的公司之一，上海益马昌公司引进推广的&ldquo;益昌老志行&rdquo;品牌、&ldquo;益昌老街&rdquo;品牌的白咖啡、香滑拉茶等，是马来西亚 最富盛名的益昌公司的荣誉产品，风靡东南亚市场63余载，已成为马来西亚的&ldquo;特色国货&rdquo;，深受世界各地旅游\r\n	<div class=\"emptyClear\">\r\n		&nbsp;</div>\r\n</div>\r\n<h3 class=\"productDescriptionSource\">\r\n	安全警告</h3>\r\n<p>\r\n	常温避光</p>\r\n',NULL,'2014-11-11 00:00:00','2015-11-11 00:00:00','98.00','60.00','0.00',NULL,0,20,5,0,NULL,NULL,NULL,NULL,'0','0',NULL,NULL,NULL,NULL,NULL,'','','1',NULL,'1','2014-11-11 11:53:17',NULL,'0.00',NULL,'6222718122','1'),(607,25,'3347553812,3664622236,1743441472','',NULL,'HERSHEY\'S好时可可粉226g(美国进口)','GN-20141111115336462','',NULL,'HERSHEY\'S好时可可粉，纯天然可可豆研磨而成，香味超浓郁，而且能加速脂肪燃烧，具有明显的减肥效果哦。','/goods/2014/11/11/3jd21x2v4y74h3l37k8n.jpg,/goods/2014/11/11/74y4p5s2ms7ximp8kugo.jpg,/goods/2014/11/11/3g11661c2773jseao473.jpg,/goods/2014/11/11/111ghyeix2ghtmo8ab2c.jpg',NULL,'<div class=\"productDescriptionWrapper\">\r\n	<div class=\"aplus\">\r\n		<h4>\r\n			HERSHEY&#39;S好时可可粉226g</h4>\r\n		<div class=\"leftImage\">\r\n			<img alt=\"好时可可粉\" data-original=\"http://g-ec4.images-amazon.com/images/G/28/foodchatu/B003NNUL1O1.jpg\" src=\"http://g-ec4.images-amazon.com/images/G/28/foodchatu/B003NNUL1O1.jpg\" style=\"\" /></div>\r\n		<h4>\r\n			****本产品实际发货重量为226g+以上****</h4>\r\n		<p>\r\n			<strong>温馨提示：此款商品新老包装交替中，商品本身无变化，请客户以收到实物为准，谢谢。</strong></p>\r\n		<p>\r\n			HERSHEY&#39;S 好时可可粉，纯天然可可豆研磨而成，香味超浓郁，而且能加速脂肪燃烧，具有明显的减肥效果哦。决不可错过的健康美味！可可粉分为中高低三档脂肪含量。是做 巧克力，蛋糕等的重要原料，可可粉里的化学成分，可以减少高胆固醇对心脉的影响，可可粉的口感很苦，越纯的可可粉，口感越苦，因为他的热量低，人体用来消 耗他的热量高于他自身的热量，所以现在很多美眉都拿他来减肥。而巧克力粉是一种综合性的粉，他里面一般添加了，可可粉、糖、乳化剂等，这类的粉粉，口感非 常滑，巧克力气味也很浓郁，入口不会很苦。热量也比较高。两个粉的区别就是：可可粉其实是巧克力粉的原料之一，纯度高，热量低。巧克力粉是在可可粉的基础 上添加了热量高的其他成分，如糖，乳化剂等等。</p>\r\n		<h5>\r\n			可可粉营养分析：</h5>\r\n		<div class=\"rightImage\">\r\n			<img alt=\"好时可可粉\" data-original=\"http://g-ec4.images-amazon.com/images/G/28/foodchatu/B003NNUL1O4.jpg\" src=\"http://g-ec4.images-amazon.com/images/G/28/foodchatu/B003NNUL1O4.jpg\" style=\"\" /></div>\r\n		<p>\r\n			科学家表示，越来越多的研究结果表明，可可粉中的化学成份可以有效治疗心脏病、糖尿病、高血压以及血管性疾病等。可可粉中使人身体受益的是一种名为黄烷醇的植物化学成份，在红葡萄酒和红茶中也有这种化学成份。</p>\r\n		<p>\r\n			可可粉是巧克力的魅力所在。研究者发现，巧克力中富含的可可粉可以减少高胆固醇对动脉的影响。他们研究的是低脂的可可粉提取物，而不是普通的高脂巧克力块或巧克力热饮。</p>\r\n		<p>\r\n			加 利福尼亚大学的Dr.TissaKappagoda在最近召开的2000年生物实验会议上宣布了这项发现。他和他的同事们在研究中发现可可粉提取物中含有 一种生物活性物质，这种物质可以保护兔子的动脉免受胆固醇的影响。Kappagoda解释说，这种可可粉提取物是抗氧化剂黄酮类物质的来源，它可以阻止胆 固醇引起动脉疾病的化学过程。 在蔬菜、水果和茶叶中都能发现这类化合物。</p>\r\n		<p>\r\n			为了证实这一点，他们做了一系列的实验来检测可可粉提取物对兔子的主动脉的影响。正常的主动脉有足够的舒张能力以保证正常的血流和血压。胆固醇对动脉的损害则限制了这种舒张功能，导致血压升高。</p>\r\n		<div class=\"leftImage\">\r\n			<img alt=\"好时可可粉\" data-original=\"http://g-ec4.images-amazon.com/images/G/28/foodchatu/B003NNUL1O2.jpg\" src=\"http://g-ec4.images-amazon.com/images/G/28/foodchatu/B003NNUL1O2.jpg\" style=\"\" /></div>\r\n		<h5>\r\n			饮用方法：</h5>\r\n		<p>\r\n			1.稀释比例1公克可可粉沖泡30c.c.热开水（80℃以上）。</p>\r\n		<p>\r\n			2.依个人口味，可添加糖，奶精或奶粉，口味更佳。</p>\r\n		<p>\r\n			3.好时可可粉1茶匙：牛奶2茶匙：三花淡奶3茶匙，沖泡约350c.c.，依各人口味酌量加减。3茶匙，冲泡约350c.c.，依个人口味加量、减量。</p>\r\n		<h4>\r\n			品牌简介：</h4>\r\n		<p>\r\n			好 时(HERSHEY&#39;S)，北美地区最大的巧克力及巧克力类糖果制造商；好时公司位于宾夕法尼亚州，是家具有107年历史的老字号公司。好时巧克力的创始 人米尔顿&middot;好时先生（MiltonHershey）1903年在这里初创巧克力制造业时，这里还是一片少有人烟的牧场。好时先生以他的智慧和长远眼光上创 建了世界一流的巧克力工厂，牧场专送的新鲜牛奶，精心筛选的可可豆，加上传统的经典工艺。使得HERSHEY&#39;S好时巧克力纯正幼滑，滋味浓冽。整座好时 小镇变成了一个巧克力香味满溢的巧克力王国。</p>\r\n	</div>\r\n	品牌简介</div>\r\n<div class=\"productDescriptionWrapper\">\r\n	好时,美国著名的巧克力品牌。\r\n	<div class=\"emptyClear\">\r\n		&nbsp;</div>\r\n</div>\r\n<h3 class=\"productDescriptionSource\">\r\n	安全警告</h3>\r\n<p>\r\n	阴凉干燥处</p>\r\n',NULL,'2014-11-11 00:00:00','2015-11-11 00:00:00','35.00','49.00','0.00',NULL,0,20,5,0,NULL,NULL,NULL,NULL,'0','0',NULL,NULL,NULL,NULL,NULL,'','','1',NULL,'1','2014-11-11 11:56:43',NULL,'0.00',NULL,'6367116253','1'),(608,25,'3347553812,3664622236,1275246736','',NULL,'Heavenly哈文迪柠檬红茶2g*25(斯里兰卡进口)','GN-20141111115846544','',NULL,'Heavenly哈文迪柠檬红茶2g*25(斯里兰卡进口)','/goods/2014/11/11/2q17afnx5bcl71b5fm5y.jpg,/goods/2014/11/11/6b87l68bbr82l7663v3b.jpg,/goods/2014/11/11/52v243e5h51e81dpmo61.jpg,/goods/2014/11/11/h1bm873i3848u48n44u3.jpg',NULL,'<div class=\"aplus\">\r\n	Heavenly哈文迪柠檬红茶2g*25(斯里兰卡进口)<br />\r\n	<img alt=\"产品介绍\" data-original=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/CG211-20130806-18.jpg\" src=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/CG211-20130806-18.jpg\" style=\"\" /><br />\r\n	<img alt=\"产品细节\" data-original=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/CG211-20130806-19.jpg\" src=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/CG211-20130806-19.jpg\" style=\"\" /><br />\r\n	<img alt=\"冲饮方法\" data-original=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/CG211-20130806-03.jpg\" src=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/CG211-20130806-03.jpg\" style=\"\" /><br />\r\n	<img alt=\"下午茶来源\" data-original=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/CG211-20130806-04.jpg\" src=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/CG211-20130806-04.jpg\" style=\"\" /><br />\r\n	<img alt=\"冬季喝红茶\" data-original=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/CG211-20130806-05.jpg\" src=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/CG211-20130806-05.jpg\" style=\"\" /><br />\r\n	<img alt=\"红茶记载\" data-original=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/CG211-20130806-06.jpg\" src=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/CG211-20130806-06.jpg\" style=\"\" /><br />\r\n	<img alt=\"斯里兰卡\" data-original=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/CG211-20130806-07.jpg\" src=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/CG211-20130806-07.jpg\" style=\"\" /><br />\r\n	<img alt=\"品牌介绍\" data-original=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/CG211-20130806-08.jpg\" src=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/CG211-20130806-08.jpg\" style=\"\" /><br />\r\n	<img alt=\"产品识别1\" data-original=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/CG211-20130806-09.jpg\" src=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/CG211-20130806-09.jpg\" style=\"\" /><br />\r\n	<img alt=\"品牌介绍2\" data-original=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/CG211-20130806-10.jpg\" src=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/CG211-20130806-10.jpg\" style=\"\" /><br />\r\n	<img alt=\"品牌介绍3\" data-original=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/CG211-20130806-11.jpg\" src=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/CG211-20130806-11.jpg\" style=\"\" /></div>\r\n<p>\r\n	<br />\r\n	<br />\r\n	<big><b><font color=\"#CC6600\">品牌简介</font></b></big><br />\r\n	Heavenly 哈文迪是IMPRA 英伯伦是世界著名红茶品牌旗下的一款经典红茶，IMPRA公司以&#39;英伯伦&#39;红茶卓越优秀品质成为当前少数几家向英国皇室提供上等优质红茶的茶叶公司之一， 同时也是英国和欧洲知名茶叶公司的重要原茶供应商。斯里兰卡政府也非常信任&#39;英伯伦&#39;红茶的优异品质，把&#39;英伯伦&#39;和&#39;哈文迪&#39;红茶定为国际交往中向国外 首脑赠送&#39;国礼&#39;的首选。IMPRA 英伯伦是世界著名红茶品牌，IMPRA公司以&#39;英伯伦&#39;红茶卓越优秀品质成为当前少数几家向英国皇室提供上等优质红茶的茶叶公司之一，同时也是英国和欧洲 知名茶叶公司的重要原茶供应商。斯里兰卡政府也非常信任&#39;英伯伦&#39;红茶的优异品质，把&#39;英伯伦&#39;红茶定为国际交往中向国外首脑赠送&#39;国礼&#39;的首选。<br />\r\n	<br />\r\n	<big><b><font color=\"#CC6600\">详细参数</font></b></big><br />\r\n	保质期：3年<br />\r\n	重量：50g<br />\r\n	规格属性：(2g*25)<br />\r\n	<br />\r\n	<br />\r\n	<big><b><font color=\"#CC6600\">使用说明</font></b></big><br />\r\n	品饮方法<br />\r\n	一、直接饮用冲泡方式<br />\r\n	1、将杯子温热，注入150cc，95-100度的热水<br />\r\n	2、放入茶袋加盖浸泡1分钟后，摇动茶袋2-3圈<br />\r\n	3、取出茶袋<br />\r\n	4、依个人口味加入砂糖<br />\r\n	<br />\r\n	二、冰茶冲泡方式<br />\r\n	材料：茶袋1袋，砂糖约2克，冰块200cc容量的杯中放入九分满的冰块<br />\r\n	作法：<br />\r\n	1、将杯子温热，注入150cc，95-100度的热水<br />\r\n	2、放入茶袋，加盖浸泡3分钟后，摇动茶袋2-3圈，取出茶袋<br />\r\n	3、放入砂糖，搅拌至完全溶解<br />\r\n	4、将泡好的茶汤倒入，放9分满冰块的杯中，轻轻搅拌2-3下即可<br />\r\n	<br />\r\n	三、冰奶茶冲泡方式<br />\r\n	材料：茶袋2袋；砂糖约3克；冰块2-3块；鲜奶50cc<br />\r\n	做法：<br />\r\n	1、将杯子温热，注入150cc，95-100度的热水<br />\r\n	2、放入茶袋，加盖浸泡5分钟后，摇动茶袋2-3圈，取出茶袋<br />\r\n	3、放入砂糖，搅拌至完全溶解<br />\r\n	4、将泡好的茶汤以隔水冷却后，放入2-3块的冰块，再加入冰鲜奶即可<br />\r\n	注：可先于前一天将茶汤泡好放置冰箱冷藏，于隔日加入鲜奶即可<br />\r\n	<br />\r\n	四、热奶茶冲泡方式<br />\r\n	<br />\r\n	材料：茶袋：3袋；鲜奶60cc；砂糖约2-3克(可依个人口味调整)<br />\r\n	做法：<br />\r\n	1、将杯子温热，注入150cc，95-100度的热水<br />\r\n	2、放入茶袋，加盖浸泡5分钟后，摇动茶袋2-3圈，取出茶袋<br />\r\n	3、放入砂糖，搅拌至完全溶解<br />\r\n	4、加入温热的鲜奶，直到茶色变成美丽的焦糖色</p>\r\n',NULL,'2014-11-11 00:00:00','2015-11-11 00:00:00','33.00','15.00','0.00',NULL,0,20,5,0,NULL,NULL,NULL,NULL,'0','0',NULL,NULL,NULL,NULL,NULL,'','','1',NULL,'1','2014-11-11 12:01:21',NULL,'0.00',NULL,'1214874341','1'),(609,25,'3347553812,3664622236,1275246736','',NULL,'STASH星皇优品椰子芒果乌龙茶(18袋入)35g(美国进口)','GN-20141111120559491','',NULL,'印度茶冰镇南瓜饼干\r\n\r\n原料\r\n\r\n2½杯普通面粉，½杯子软化黄油，1茶匙发酵粉，1茶匙苏打粉，2茶匙肉桂，½茶匙肉豆蔻，½茶匙丁香，½茶匙盐，1½杯糖，1杯南瓜泥，1个鸡蛋，1茶匙香草精，2杯糖，1 茶匙黄油溶液，1 茶匙香草精，1包印度香料茶，1 茶匙牛奶','/goods/2014/11/11/hal4hw7sk15uh5efnj8f.jpg,/goods/2014/11/11/s6ahi16r5u51ri1u8572.jpg,/goods/2014/11/11/67br75n2c86nx2cxe1rs.jpg,/goods/2014/11/11/8j27y8w7123g8p24u73e.jpg',NULL,'<div class=\"productDescriptionWrapper\">\r\n	<div class=\"aplus\">\r\n		<div class=\"leftImage\">\r\n			<img alt=\"星皇优品茶\" data-original=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/AALS3-20130801-09.jpg\" src=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/AALS3-20130801-09.jpg\" style=\"\" /></div>\r\n		<h4>\r\n			星皇优品的品牌理念</h4>\r\n		<p>\r\n			早在15-17世纪的大航海时代，伴随着新航路的开辟，欧洲的航海家们踏足于全球各个大陆，有机会将世界各地的精品茶叶一一珍藏，并与朋友和家人分享。&ldquo;Stash&rdquo;秉承这一理念，从世界各地找寻最珍贵的茶叶研磨，并吸收各国的茶饮文化，创造出独特的茶品&mdash;星皇优品。</p>\r\n		<div class=\"rightImage\">\r\n			<img alt=\"星皇优品茶\" data-original=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/AALS3-20130801-10.jpg\" src=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/AALS3-20130801-10.jpg\" style=\"\" /></div>\r\n		<p>\r\n			我 们的薄荷茶和精品绿茶已得到《人类健康杂志》的认同，并赞誉这是他们见识过的最好的茶。薄荷茶来自于太平洋西北部，那里的薄荷含有丰富的薄荷醇且能够增强 口感，被公认为是世界上最好的茶。还有气候、土壤和生长季节适宜的巴西茶园，阿萨姆、锡兰等地区都是我们的茶叶来源地。</p>\r\n		<div class=\"leftImage\">\r\n			<img alt=\"星皇优品茶\" data-original=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/AALS3-20130801-11.jpg\" src=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/AALS3-20130801-11.jpg\" style=\"\" /></div>\r\n		<h4>\r\n			异域情调的茶饮体验</h4>\r\n		<p>\r\n			茶 是世界公认的三大饮料(茶、咖啡、可可)之一，但各国饮茶的习俗却不尽相同，各有妙处。Stash从世界最好资源地采购原料和香料，精细加工，在混合前才 对其进行碾磨以调制出优质的口味，并在此基础上独特创新，通过搭配不同的茶点，让你在享受饮茶惬意的同时，更能品位到搭配的乐趣和创意。</p>\r\n		<div class=\"break\">\r\n			&nbsp;</div>\r\n		<div class=\"rightImage\">\r\n			<img alt=\"星皇优品茶\" data-original=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/AALS3-20130801-12.jpg\" src=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/AALS3-20130801-12.jpg\" style=\"\" /></div>\r\n		<h5>\r\n			一、印度茶冰镇南瓜饼干</h5>\r\n		<p>\r\n			原料</p>\r\n		<p>\r\n			2&frac12;杯普通面粉，&frac12;杯子软化黄油，1茶匙发酵粉，1茶匙苏打粉，2茶匙肉桂，&frac12;茶匙肉豆蔻，&frac12;茶匙丁香，&frac12;茶匙盐，1&frac12;杯糖，1杯南瓜泥，1个鸡蛋，1茶匙香草精，2杯糖，1 茶匙黄油溶液，1 茶匙香草精，1包印度香料茶，1 茶匙牛奶</p>\r\n		<p>\r\n			制作方法</p>\r\n		<ol>\r\n			<li>\r\n				1. 先将烤箱预热到350&deg;F。把面粉，香料，盐和发酵粉以及小苏打放在碗里混合，放在一旁备用。</li>\r\n			<li>\r\n				2. 把黄油和糖放在另外一只碗内。同时加入南瓜，香草和鸡蛋继续搅拌，搅拌直至混合物如奶油状顺滑。</li>\r\n			<li>\r\n				3. 将面团放置在冰箱内冷冻半个小时使其变稠，然后，将一大勺的黄油滴在放置在羊皮内衬纸烤板上的面团上。烘烤15-20分钟，只直至边缘变至金黄色。从烤箱中取出使其冷却，然后再结糖霜。</li>\r\n			<li>\r\n				4. 对于糖霜，用平底锅文火将黄油化开并且加入牛奶，将印度茶的茶包放在水中浸泡5分钟，然后取出。加入香草和糖搅拌直至变稠变成顺滑的糖霜。</li>\r\n		</ol>\r\n		<div class=\"leftImage\">\r\n			<img alt=\"星皇优品茶\" data-original=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/AALS3-20130801-13.jpg\" src=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/AALS3-20130801-13.jpg\" style=\"\" /></div>\r\n		<h5>\r\n			二、波本威士忌印度茶</h5>\r\n		<p>\r\n			原料</p>\r\n		<p>\r\n			4茶匙印度香料红茶，1根开裂的带豆荚的香草豆，3杯热水，3杯全脂牛奶或者是不甜的杏仁奶，1/4杯蜂蜜或龙舌兰，&frac12;杯别有滋味的波本威士忌，比如美格波本威士忌，丁香，肉桂，肉豆蔻，姜</p>\r\n		<p>\r\n			制作方法</p>\r\n		<ol>\r\n			<li>\r\n				1. 将茶叶和香草豆，豆荚，其他一些香料和加入3杯热水中。用中高火炖，并且加入牛奶，蜂蜜或是龙舌兰，威士忌。改用小火，关火，浸泡10-15分钟，滤掉固体，提取风味。</li>\r\n			<li>\r\n				2. 将印度茶移到另一个耐热的水罐中，一边搅拌一边放入波本威士忌。</li>\r\n		</ol>\r\n		<div class=\"rightImage\">\r\n			<img alt=\"星皇优品茶\" data-original=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/AALS3-20130801-14.jpg\" src=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/AALS3-20130801-14.jpg\" style=\"\" /></div>\r\n		<h5>\r\n			三、制作冰茶</h5>\r\n		<p>\r\n			热方法：2茶匙茶叶或2只茶包，8盎司(约227g)水。取约113g水，加热煮沸；将茶叶或茶包加入到茶壶中，注入沸水；3-5分钟后，取出茶叶或茶包；加入剩余冷水；将茶壶放入冰箱中冷藏或是放在冰块中冰镇。</p>\r\n		<p>\r\n			冷方法：在茶壶中放入2茶匙茶叶或2只茶包，注入8盎司(约227g)冷水；将茶壶放入冰箱中冷藏3-8小时；可根据个人喜好调整冷藏时间；饮用时加入冰块。</p>\r\n		<div class=\"leftImage\">\r\n			<img alt=\"星皇优品茶\" data-original=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/AALS3-20130801-15.jpg\" src=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/AALS3-20130801-15.jpg\" style=\"\" /></div>\r\n		<div class=\"break\">\r\n			&nbsp;</div>\r\n		<h4>\r\n			产品分类</h4>\r\n		<ol>\r\n			<li>\r\n				早餐茶：生姜早餐红茶，超级爱尔兰红茶，柠檬生姜草本茶，脱咖啡因早餐茶，脱咖啡因树莓早餐茶。</li>\r\n			<li>\r\n				下午茶：超级爱尔兰红茶，桃子红茶，格雷伯爵红茶，橘子香料红茶，印度香料红茶枸杞绿茶，茉莉绿茶，莫吉多绿茶，巧克力薄荷乌龙茶，椰子芒果乌龙茶</li>\r\n			<li>\r\n				睡前茶 ：芒果西番莲草本茶，蓝莓草本茶，甘菊草本茶，杨百利黑加仑子草本茶，草莓石榴草本茶，肉桂</li>\r\n			<li>\r\n				苹果甘菊草本茶，迈耶草本茶，巴西莓草本茶，薄荷草本茶</li>\r\n			<li>\r\n				超级抗氧化茶：蓝莓草本茶</li>\r\n			<li>\r\n				舒缓压力茶：甘菊草本茶</li>\r\n			<li>\r\n				和胃止咳茶：柠檬生姜草本茶，生姜早餐红茶</li>\r\n			<li>\r\n				健脾润肺茶：肉桂苹果柑橘草本茶，橘子香料红茶</li>\r\n			<li>\r\n				镇静安神茶：芒果西番莲本茶</li>\r\n			<li>\r\n				排毒养颜：迈耶草本茶(蔷薇，柠檬香草、橘子皮、芙蓉花、迈耶柠檬油和红花)</li>\r\n			<li>\r\n				祛风热头痛：薄荷草本茶(萃取了来自美国西北部最佳薄荷的清淡可口、清新提神的口感)</li>\r\n		</ol>\r\n	</div>\r\n	品牌简介</div>\r\n<div class=\"productDescriptionWrapper\">\r\n	<div class=\"aplus\">\r\n		<p>\r\n			星皇优品茶大中华地区由上海茵芙食品有限公司独家代理。</p>\r\n		<p>\r\n			上海茵芙食品有限公司 是目前国内首屈一指的专门经营美国进口食品的专业代理商，代理食品种类繁多，涵盖美国一线知名品牌：Yummy Earth(雅美儿)糖果、Alaska(阿拉斯加)三文鱼、Stash Tea(星皇优品茶)等。上海茵芙优秀的双语团队以及美国加利福尼亚和华盛顿的采购办事处，为上海茵芙进口分销高品质并适合中国市场的美国食品，提供了强 有力的保障。上海茵芙的目标是为美食爱好者提供更多美味、健康的美国食品，打造一个优秀的美国食品在中国的分销平台。</p>\r\n	</div>\r\n	<div class=\"emptyClear\">\r\n		&nbsp;</div>\r\n</div>\r\n<h3 class=\"productDescriptionSource\">\r\n	安全警告</h3>\r\n<div class=\"productDescriptionWrapper\">\r\n	请勿吞食</div>\r\n',NULL,'2014-11-11 00:00:00','2015-11-11 00:00:00','45.00','39.90','0.00',NULL,0,20,5,0,NULL,NULL,NULL,NULL,'0','0',NULL,NULL,NULL,NULL,NULL,'','','1',NULL,'1','2014-11-11 12:08:59',NULL,'0.00',NULL,'2228726623','1'),(610,25,'3347553812,3326815772,4414263112','',NULL,'Dole都乐缤果趣夹心软糖(黄桃味夹心，酸奶味涂层和杏仁脆片)45g(泰国进口)','GN-20141111134711804','',NULL,'都乐Dole进口夹心软糖缤果趣选用泰国黄桃果浆制成的黄桃味夹心，清新酸奶味涂层，撒上香脆杏仁脆片。\r\n一口一个，居家办公旅行，随时随地享受新奇口感搭配，妙趣之味，缤纷体验，尽在都乐缤果趣！','/goods/2014/11/11/31w2xaw864x2a1l28b54.jpg,/goods/2014/11/11/aan8n6e636lxlji3y84u.jpg,/goods/2014/11/11/13rkng3v6374avtfh4o2.jpg',NULL,'<p>\r\n	都乐Dole进口夹心软糖缤果趣选用泰国黄桃果浆制成的黄桃味夹心，清新酸奶味涂层，撒上香脆杏仁脆片。<br />\r\n	一口一个，居家办公旅行，随时随地享受新奇口感搭配，妙趣之味，缤纷体验，尽在都乐缤果趣！<br />\r\n	<img data-original=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/AAR3A-20130924-01.jpg\" src=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/AAR3A-20130924-01.jpg\" style=\"\" /></p>\r\n',NULL,'2014-11-11 00:00:00','2015-12-11 00:00:00','12.80','9.80','0.00',NULL,0,20,5,0,NULL,NULL,NULL,NULL,'0','0',NULL,NULL,NULL,NULL,NULL,'','','1',NULL,'1','2014-11-11 13:51:42',NULL,'0.00',NULL,'2322148443','1'),(611,25,'3347553812,3326815772,4414263112','',NULL,'Rocky Mountain落基山水果味棉花糖300g (美国进口)','GN-20141111135221176','',NULL,'美国原装进口的Rocky Mountain Marshmallows/落基山棉花糖，是真正意义上的美国经典，有着悠久的制作历史，其轻柔的质地和独一无二的口感使美国式的棉花糖明显有别于世界其他任意地方制造的棉花糖。','/goods/2014/11/11/8oio1kc2588mi58175rc.jpg,/goods/2014/11/11/x7ap27o255l7klo7yfu2.jpg,/goods/2014/11/11/gex12q4d6rxx1d53fis2.jpg,/goods/2014/11/11/f62mamky1e328177kap6.jpg',NULL,'<p>\r\n	美国原装进口的Rocky Mountain Marshmallows/落基山棉花糖，是真正意义上的美国经典，有着悠久的制作历史，其轻柔的质地和独一无二的口感使美国式的棉花糖明显有别于世界其他任意地方制造的棉花糖。<br />\r\n	落基山棉花糖可以烤着吃的棉花糖。将棉花糖放在篝火上烤，没有什么比落基山棉花糖烤至外部金黄，内部胶状更给人喜悦的了。<br />\r\n	Rocky Mountain Marshmallows落基山棉花糖还可以做牛轧糖、做蛋糕、放在咖啡奶茶里或蘸着巧克力一起吃，或者加在两款饼干中间当成夹心饼干等等各种吃法更别有风味，可能是用途最广的一款棉花糖哦，尽情发挥您的创意吃法吧。<br />\r\n	<br />\r\n	<img alt=\"Marshmallows棉花糖\" data-original=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/GRP1T-20140717-1.jpg\" src=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/GRP1T-20140717-1.jpg\" style=\"\" /></p>\r\n<h3 class=\"productDescriptionSource\">\r\n	品牌简介</h3>\r\n<div class=\"productDescriptionWrapper\">\r\n	公司自从1921年开始生产世界上最好吃的棉花糖至今日。20世纪50年代，Doumak创始家族发明挤压工艺制造棉花糖，这一创新方式使棉花糖生产快速 而高效。公司在芝加哥和美国内陆地区拥有两个国家最先进的生产设备，公司拥有引以为傲的IFS认证，确保安全、高效的生产环境从而生产出世界上最优良品质 的棉花糖！\r\n	<div class=\"emptyClear\">\r\n		&nbsp;</div>\r\n</div>\r\n<h3 class=\"productDescriptionSource\">\r\n	安全警告</h3>\r\n<p>\r\n	请勿一口吞食，老人儿童需在监护下食用。<br />\r\n	避免高温、潮湿及阳光直射。</p>\r\n',NULL,'2014-11-11 00:00:00','2015-12-11 00:00:00','35.80','24.00','0.00',NULL,0,20,5,0,NULL,NULL,NULL,NULL,'0','0',NULL,NULL,NULL,NULL,NULL,'','','1',NULL,'1','2014-11-11 13:55:03',NULL,'0.00',NULL,'2518285862','1'),(612,25,'3347553812,3326815772,3741558218','',NULL,'Toblerone瑞士三角黑巧克力含蜂蜜及巴旦木糖100g (瑞士进口)','GN-20141111142706960','',NULL,'名称：Swiss Toblerone瑞士三角 黑巧克力含蜂蜜及巴旦木100g\r\n\r\n品牌：TOBLERONE 瑞士三角 ','/goods/2014/11/11/34o2s72565p7bd35v471.jpg,/goods/2014/11/11/5b8b836j5m13p48ag325.jpg',NULL,'<div class=\"aplus\">\r\n	<p>\r\n		Swiss Toblerone瑞士三角 黑巧克力含蜂蜜及巴旦木 Toblerone（三角巧克力）的名字是由一个姓&ldquo;Tobler&rdquo;和一个意思是&ldquo;专业巴旦木糖&rdquo;的单词&ldquo;torrone&rdquo;合并而成的。 &ldquo;Toblerone&rdquo;这个名字就在1908年被全世界所知道，一年后，这个独一无二含有巴旦木、太妃糖和蜂蜜的巧克力申请了第一个专利：尖顶的三角形包 装。</p>\r\n	<p>\r\n		中文名字源于其特有的三角造型，象征瑞士阿尔卑斯山的马特洪峰。同时其黄色三棱柱的包装和经常在免税店出售的形象深入民心。</p>\r\n	<div class=\"leftImage\">\r\n		<img alt=\"Swiss Toblerone瑞士三角 黑巧克力含蜂蜜及巴旦木100g\" data-original=\"http://ec4.images-amazon.com/images/G/28/foodchatu/B005TP53VM-1.jpg\" src=\"http://ec4.images-amazon.com/images/G/28/foodchatu/B005TP53VM-1.jpg\" style=\"\" /></div>\r\n	<p>\r\n		名称：Swiss Toblerone瑞士三角 黑巧克力含蜂蜜及巴旦木100g</p>\r\n	<p>\r\n		品牌：TOBLERONE 瑞士三角</p>\r\n	<p>\r\n		规格：100g</p>\r\n	<p>\r\n		原产国：瑞士</p>\r\n	<p>\r\n		保质期：18个月</p>\r\n	<p>\r\n		商品形态：固体</p>\r\n	<p>\r\n		适合年龄：所有人</p>\r\n	<p>\r\n		储存方法：请置于阴凉干燥清洁处存放，避免阳光直接照射。</p>\r\n	<p>\r\n		配料：可可液快，白砂糖，乳脂，蜂蜜3%，巴旦木1.6%，可可脂，乳化剂，大豆磷脂，鸡蛋清</p>\r\n	<div class=\"break\">\r\n		&nbsp;</div>\r\n	<div class=\"rightImage\">\r\n		<img alt=\"瑞士三角\" data-original=\"http://ec4.images-amazon.com/images/G/28/foodchatu/B005TP53VM-2.jpg\" src=\"http://ec4.images-amazon.com/images/G/28/foodchatu/B005TP53VM-2.jpg\" style=\"\" /></div>\r\n	<h4>\r\n		瑞士三角味觉体验</h4>\r\n	<p>\r\n		瑞士原产的TOBLERONE三角系列巧克力，是著名食品公司卡夫的王牌产品。TOBLERONE三角系列已经行销世界100多个国家，有超过130年以上的悠久历史。其口碑众人皆知。</p>\r\n	<p>\r\n		瑞士三角巧克力精选世界不同产区原料，精心打造而成。重新唤醒您的味蕾，沉浸在瑞士三角巧克力带给您的独特的味觉体验中吧！</p>\r\n	<p>\r\n		墨西哥，委内瑞拉和厄瓜多尔是世界上最古老的种植可可的国家之一。但是现在象牙海岸和巴西是可可产出最多的地区，这两个地区的可可产量甚至超过了加纳&mdash;&mdash;过去几十年中一直是全世界可可种植量最高的国家。</p>\r\n	<p>\r\n		1907年，瑞士三角牌巧克力刚被发明时，是一种独一无二的、含有牛轧糖、巴旦木和蜂蜜的牛奶巧克力。</p>\r\n	<h5>\r\n		牛奶</h5>\r\n	<p>\r\n		在巧克力的生产中，有时候会加入牛奶。在瑞士三角巧克力中添加的牛奶主要来自于瑞士。</p>\r\n	<h5>\r\n		巴旦木奶油糖</h5>\r\n	<p>\r\n		在我们的奶油果仁糖秘方中，我们将加利福尼亚巴旦木、蜂蜜，糖及蛋清混合在一起。正是这种奶油果仁糖赋予了瑞士三角巧克力独特的味道。</p>\r\n	<h5>\r\n		蜂蜜</h5>\r\n	<p>\r\n		瑞士三角巧克力中含有3%的墨西哥蜂蜜。这种蜂蜜具有强烈的浓郁芳香，带给了瑞士三角巧克力独特风味。Toblerone（三角巧克力）的名字是由一个姓&ldquo;Tobler&rdquo;和一个意思是&ldquo;专业巴旦木糖&rdquo;的单词&ldquo;torrone&rdquo;合并而成的。</p>\r\n	<div class=\"leftImage\">\r\n		<img alt=\"巧克力储存守则\" data-original=\"http://ec4.images-amazon.com/images/G/28/foodchatu/B004AYD464-14.jpg\" src=\"http://ec4.images-amazon.com/images/G/28/foodchatu/B004AYD464-14.jpg\" style=\"\" /></div>\r\n	<br />\r\n	<br />\r\n	<h4>\r\n		巧克力储存守则</h4>\r\n	<ol>\r\n		<li>\r\n			巧克力应存放于干爽及清凉的地方，气温大概为16℃&mdash;18℃，而湿度则不能超过60%&mdash;65%。</li>\r\n		<li>\r\n			最好将巧克力存放于有空调的地方，以防气温差距太大，而导致巧克力溶化。</li>\r\n		<li>\r\n			不要将巧克力与肥皂、清洁剂或消毒剂等气味强烈的货品一起存放，亦应避免阳光直接照射。</li>\r\n		<li>\r\n			应尽快将已损坏，或已溶化的巧克力丢掉，以防影响其余货品品质。</li>\r\n	</ol>\r\n</div>\r\n<p>\r\n	&nbsp;</p>\r\n',NULL,'2014-11-11 00:00:00','2015-12-11 00:00:00','25.80','22.90','0.00',NULL,0,20,5,0,NULL,NULL,NULL,NULL,'0','0',NULL,NULL,NULL,NULL,NULL,'','','1',NULL,'1','2014-11-11 14:30:20',NULL,'0.00',NULL,'2244174588','1'),(613,25,'3347553812,3326815772,3741558218','',NULL,'Rocher费列罗T30榛果威化巧克力375g (意大利进口)','GN-20141111143058596','',NULL,'当百年的意大利经典遇上传统的中国节日，甜蜜的巧克力温暖久别的亲友。费列罗Rocher传承多年的巧克力制作工艺，让金色浓情照亮每家团圆。','/goods/2014/11/11/114uj1c1332814u6fe42.jpg,/goods/2014/11/11/jdm13ja774ef5k6yg8eh.jpg,/goods/2014/11/11/s62eu464tkna6c3p4414.jpg',NULL,'<div class=\"productDescriptionWrapper\">\r\n	<div class=\"aplus\">\r\n		<br />\r\n		金色金典，团圆共享：当百年的意大利经典遇上传统的中国节日，甜蜜的巧克力温暖久别的亲友。费列罗Rocher传承多年的巧克力制作工艺，让金色浓情照亮每家团圆。\r\n		<div class=\"leftImage\">\r\n			<img alt=\"Rocher费列罗T30榛果威化巧克力375g\" data-original=\"http://g-ec4.images-amazon.com/images/G/28/foodchatu/B004R96HKC-1.jpg\" src=\"http://g-ec4.images-amazon.com/images/G/28/foodchatu/B004R96HKC-1.jpg\" style=\"\" /></div>\r\n		<br />\r\n		名称：Rocher费列罗T30榛果威化巧克力375g<br />\r\n		品牌：Ferrero 费列罗<br />\r\n		规格：375g<br />\r\n		原产国：意大利<br />\r\n		商品形态：固体<br />\r\n		适合年龄：所有人<br />\r\n		储存方法：请置于阴凉干燥清洁处存放，避免阳光直接照射。<br />\r\n		商品特质：低卡路里<br />\r\n		过敏原信息: 含牛奶,榛子,麦胶(麸质)蛋白,大豆。生产此食品的设备也处理杏仁。\r\n		<div class=\"break\">\r\n			&nbsp;</div>\r\n		<div class=\"rightImage\">\r\n			<img alt=\" Caroto加罗托巧克力\" data-original=\"http://g-ec4.images-amazon.com/images/G/28/foodchatu/B006LF1TVM-6.jpg\" src=\"http://g-ec4.images-amazon.com/images/G/28/foodchatu/B006LF1TVM-6.jpg\" style=\"\" /></div>\r\n		<br />\r\n		<br />\r\n		费列罗 ROCHER于1982年引入欧洲，仅仅数年时间内，便受到数百万人的热 爱。如今，它已成为享誉全球的巧克力品牌。它成功的秘诀是什么？<br />\r\n		原创配方、精心制作、雅致包装和开创性的推广活动；新颖的形状 &ndash; 圆形却不规则 &ndash; 与金箔纸独立包装，让其尽显典雅华贵；独特风味呼之欲出：外层香浓巧克力，内有松脆威化及香滑榛果可可酱和原粒榛果，带来多种口感的享受。<br />\r\n		一个光芒四射的创想&mdash;&mdash;费列罗Rocher，又名金莎。自1982年问世以来，费列罗Rocher在短短的几年之内，便成为了数百万人最喜爱的巧克力品种；今天，它已经成为巧克力品类中最杰出的领袖。<br />\r\n		费 列罗Rocher传承大半个世纪的苛刻卓越工艺、无与伦比的精美包装和一次又一次带来惊喜的广告活动都是它成功的秘诀。此外，它独有的，圆而不规则的创 新形状，优雅华贵的独立金箔纸包装，每次展开金箔便犹如展开一个璀璨奇异的金色经典世界。柔滑的巧克力，轻巧的威化，包裹精选榛果，为你带来独特的口感享 受，粒粒璀璨，颗颗醇香。<br />\r\n		费列罗Rocher，让你的每一个重要场合都成为金色时刻。\r\n		<div class=\"break\">\r\n			&nbsp;</div>\r\n		<div class=\"leftImage\">\r\n			<img alt=\"巧克力储存守则\" data-original=\"http://g-ec4.images-amazon.com/images/G/28/foodchatu/B006LF1TVM-5.jpg\" src=\"http://g-ec4.images-amazon.com/images/G/28/foodchatu/B006LF1TVM-5.jpg\" style=\"\" /></div>\r\n		<br />\r\n		<br />\r\n		&bull; &ldquo;金&rdquo;湛工艺：费列罗Rocher多层式用料的丰富口感让人深陷其中：轻轻咬开最外层果 仁与巧克力碎的外壳，立刻被里面巧克力威化和软巧克力的香浓柔滑所包围，在专注享受软硬交替的奇妙口感时，意外地和最里面的榛子不期而遇。丝丝美味，让人 在浓郁的巧克力和果仁的混合香气中，体验一种从未有过的奇妙旅程。<br />\r\n		&bull; 粒粒&ldquo;榛&rdquo;选：每粒费列罗Rocher，都经历过30次以上的质量检测。我们苛求完美，只为给您最好的甜蜜体验。作为重要原料之一的榛子，其质量更是我们 关注的重中之重。只有最好的榛子，才适用于费列罗Rocher榛果巧克力，例如皮埃蒙特大区朗鬲地区出产的&quot;TONDA GENTILE&quot;。目前，费列罗公司是全球最大的榛子采购专家。<br />\r\n		&bull; 最佳赏味：要品味费列罗Rocher的最佳滋味，千万不能忽略正确的储存方式。18℃-22℃的气温是最适合巧克力存储的温度，将其放于阴凉干爽、避免阳光直射的地方，能保证费列罗Rocher带给你的每一次甜蜜，都是完美的味觉享受。</div>\r\n	<br />\r\n	&nbsp;</div>\r\n<h3 class=\"productDescriptionSource\">\r\n	品牌简介</h3>\r\n<div class=\"productDescriptionWrapper\">\r\n	<div class=\"aplus\">\r\n		<div class=\"rightImage\">\r\n			<img alt=\" Rocher费列罗\" data-original=\"http://g-ec4.images-amazon.com/images/G/28/foodchatu/B006LF1TVM-4.jpg\" src=\"http://g-ec4.images-amazon.com/images/G/28/foodchatu/B006LF1TVM-4.jpg\" style=\"\" /></div>\r\n		<h4>\r\n			品牌故事</h4>\r\n		<br />\r\n		意大利 FERRERO 费列罗集团在卓越领导人米开力米歇尔&bull;费列罗（Michele Ferrero）的带领下不断发展。凭借采用先进理念来生产和创造新产品的愿望，米开力先生已经彻底改变了数百万消费者的饮食习惯。<br />\r\n		得益于他和他妻子玛丽亚&bull;弗兰卡（Maria Franca）一直以来的有效配合，他成为了二战后第一个在国外开设生产工厂和办事处的意大利糖果业制造商，从而将公司缔造成真正的国际集团。<br />\r\n		要了解这一成功的起源，我们必须追溯到上个世纪40年代。在这些年里，皮耶拉（Piera）和彼得罗（Pietro），米歇尔的父母，将一家点心店发展成了一个工厂。<br />\r\n		最初这些决定性的发展步伐应归功于皮耶尔&bull;费列罗和他当时还非常年轻的儿子米开力发明的产品。另一个成功的关键是皮耶尔的兄弟乔瓦尼（Giovanni，于1949年与世长辞）构建的有效销售网络。<br />\r\n		现 在，费列罗家族的故事已经延续到了第三代。皮耶尔（Pietro）和乔瓦尼&bull;费列罗（Giovanni Ferrero），米歇尔和玛丽亚&bull;弗兰卡的两个儿子，曾联合出任集团总经理10余年。2011年4月，皮耶尔&bull;费列罗为完成一项人道主义使命而外出公干 时，不幸在南非意外身亡。这项使命由皮耶尔发起和推动，旨在再次创办费列罗公司的社会企业。<br />\r\n		如今，乔瓦尼&bull;费列罗继续成功运营公司，旨在实现更为宏伟的目标，并确保将公司鼓舞人心的精神和力量与其父母和弟弟共同分享。<br />\r\n		今天，正如昨天一样，建立于稳固的家庭价值观的基础之上。<br />\r\n		简而言之，在这家跨国公司的商标、营业额和商业扩张的背后，蕴藏着一个关于出类拔萃和意志坚强的皮埃蒙特家族的故事。这个故事从费列罗基金会的箴言：&ldquo;工作、创造、奉献&rdquo;中汲取了超乎寻常力量来实现增长。\r\n		<h4>\r\n			费列罗在中国</h4>\r\n		<br />\r\n		费列罗贸易（上海）有限公司成立于2007年底。<br />\r\n		在中国，最主要的费列罗产品系列是臻品巧克力糖果系列，包括最核心的费列罗Rocher榛果威化巧克力，以及费列罗臻品巧克力糖果礼盒，拉斐尔和费列罗朗慕。<br />\r\n		费列罗还有健达巧克力, 富含牛奶深受孩子喜爱不仅如此，健达家族还有健达奇趣蛋、健达缤纷乐，同时，费列罗还有美味独特的能多益榛果可可酱。</div>\r\n</div>\r\n<p>\r\n	&nbsp;</p>\r\n',NULL,'2014-11-11 00:00:00','2015-11-11 00:00:00','122.80','86.00','0.00',NULL,0,20,5,0,NULL,NULL,NULL,NULL,'0','0',NULL,NULL,NULL,NULL,NULL,'','','1',NULL,'1','2014-11-11 14:37:04',NULL,'0.00',NULL,'2588885237','1'),(614,25,'3347553812,1523315565,5474616683','',NULL,'Kirkland 美国整粒蓝莓干567克(美国进口)','GN-20141111143747743','',NULL,'蓝莓被誉为“浆果之王”，其果肉细腻，口感酸甜，营养丰富, 适合长时间使用电脑人士食用。','/goods/2014/11/11/x1872138q8xu53dyvuff.jpg',NULL,'<div class=\"aplus\">\r\n	<h4>\r\n		美国Kirkland整粒蓝莓干</h4>\r\n	<p>\r\n		蓝莓被誉为&ldquo;浆果之王&rdquo;，其果肉细腻，口感酸甜，营养丰富, 适合长时间使用电脑人士食用。柯克兰（Kirkland Signature）是全美销量第一的健康品牌。多年来以其可靠的产品质量和良好的信誉，在北美众多的保健品品牌中倍受关注，拥有极佳的口碑。</p>\r\n	<div class=\"break\">\r\n		&nbsp;</div>\r\n	<div class=\"leftImage\">\r\n		<img alt=\"美国柯可蓝\" data-height=\"1\" data-original=\"http://ec4.images-amazon.com/images/G/28/FOODchatu/B0085SS74U-1.jpg\" height=\"50\" src=\"http://ec4.images-amazon.com/images/G/28/x-locale/common/one-pixel.gif\" style=\"\" /></div>\r\n	<h4>\r\n		蓝莓介绍：</h4>\r\n	<p>\r\n		蓝莓（Blueberry）学名越桔，果实呈蓝色，并披一层白色果粉，果肉细腻，果味酸甜，风味独特，营养丰富。VC含量是苹果的几十倍，被誉为&ldquo;浆果之 王&rdquo;。</p>\r\n	<p>\r\n		据测定，每百克蓝莓鲜果中含蛋白质400-700毫克、脂肪500-600毫克、碳水化合物12.3-15.3克、维生素A高达 81-100IU(国际单位)，除含有常规的糖、酸、维生素C、矿物元素外，蓝莓果实中还含有尼克酸、SOD、黄酮等特殊成分。</p>\r\n	<p>\r\n		蓝莓果实中除了常规的糖、酸和Vc外，富含VE、VA、VB、SOD、熊果苷、蛋白质、花青苷、食用纤维以及丰富的K、Fe、Zn、Ca等矿质元素。</p>\r\n	<p>\r\n		据 对从美国引进的14 个品种的蓝莓果实分析测定，每百克蓝莓鲜果中花青苷色素含量高达163毫克、蛋白质400-700毫克、脂肪500-600毫克、碳水化合物 12.3-15.3毫克、维生素A高达81-100国际单位、维生素E 2.7-9.5微克、SOD5.39国际单位，维生素都高于其他水果。</p>\r\n	<p>\r\n		微量元素也很高，每克鲜果中钙220-920微克、磷98-274微克、镁 114-249微克、锌2.1-4.3微克、铁7.6-30.0微克、 0.8-1.2微克、铜2.0-3.2微克。</p>\r\n	<p>\r\n		蓝莓果实中含有丰富的营养成分，属高氨基酸、高锌、高钙、高铁、高铜、高维生素的营养保健果品。</p>\r\n	<div class=\"break\">\r\n		&nbsp;</div>\r\n	<div class=\"rightImage\">\r\n		<img alt=\"美国柯可蓝\" data-height=\"1\" data-original=\"http://ec4.images-amazon.com/images/G/28/FOODchatu/B0085SS74U-3.jpg\" height=\"50\" src=\"http://ec4.images-amazon.com/images/G/28/x-locale/common/one-pixel.gif\" style=\"\" /></div>\r\n	<div class=\"rightImage\">\r\n		<img alt=\"美国柯可蓝\" data-height=\"1\" data-original=\"http://ec4.images-amazon.com/images/G/28/FOODchatu/B0085SS74U-2.jpg\" height=\"50\" src=\"http://ec4.images-amazon.com/images/G/28/x-locale/common/one-pixel.gif\" style=\"\" /></div>\r\n	<h4>\r\n		食用方法：</h4>\r\n	<ol>\r\n		<li>\r\n			直接食用,搭配点心。</li>\r\n		<li>\r\n			烘培蓝莓蛋糕。</li>\r\n		<li>\r\n			每三茶匙加250ml热水冲泡5-10分钟饮用。</li>\r\n		<li>\r\n			配合其他花草茶饮用。</li>\r\n	</ol>\r\n	<h4>\r\n		储存方法：</h4>\r\n	<ul>\r\n		<li>\r\n			开口食用后，二次储存时用密封条将封口压紧，放入冰箱冷藏即可</li>\r\n	</ul>\r\n	<h4>\r\n		健康功效：</h4>\r\n	<h5>\r\n		蓝莓可以有助预防高血压</h5>\r\n	<p>\r\n		英 国东英吉利大学研究人员和美国同行在新一期《美国临床营养学杂志》上报告说，为研究饮食对血压的影响，他们对十多万志愿者进行了长达14年的健康状况跟踪 调查。其间，这些志愿者每两年报告一次健康状况，每4年报告一次饮食情况。在项目开始时，所有人都没有高血压症状，而14年后，约3.5万人出现了高血压 症状。</p>\r\n	<p>\r\n		参与研究的东英吉利大学教授艾丁&middot;卡西迪说，这项研究证实了花青素具有降血压的功效。花青素属于黄酮类物质，茶、果汁、红酒、黑巧 克力等食物中也都含有这类物质。此前人们已经知道黄酮类物质具有降血压的功效，而本次研究显示，虽然人们可以从不同途径摄入黄酮类物质，但还是富含花青素 的蓝莓降血压功效最为显着，同样富含花青素的草莓降血压效果也不错。</p>\r\n	<h5>\r\n		蓝莓可增强记忆力消除眼疲劳</h5>\r\n	<p>\r\n		蓝莓果实单果重平均 2克，最大5克，果实呈蓝色并有一层白色果粉，果肉细腻，种子极小，清淡芳香，为一鲜食佳品。蓝莓富含VC、VE、VA、SOD、花青素、食用纤维等其他 品种少有的特殊成分以及丰富的钾、铁、锌、锰等微量元素。而根据美国Tufts大学的分析，在40种具有抗氧化效力的蔬菜和水果中，蓝莓的花青素含量排名 第一。</p>\r\n	<p>\r\n		花青素的抗氧化性能比维生素E高五十倍，比维生素C高二百倍。它对人体的生物有效性是百分之百，服用后二十分钟就能在血液中检测到。与其它的抗氧化剂不同的是，花青素能通过血脑屏障，直接保护大脑和神经系统。</p>\r\n</div>\r\n<p>\r\n	&nbsp;</p>\r\n',NULL,'2014-11-11 00:00:00','2015-11-11 00:00:00','166.00','108.00','0.00',NULL,0,20,5,0,NULL,NULL,NULL,NULL,'0','0',NULL,NULL,NULL,NULL,NULL,'','','1',NULL,'1','2014-11-11 14:41:10',NULL,'0.00',NULL,'2736662152','1'),(615,25,'3347553812,1523315565,5474616683','',NULL,'Sabava沙巴哇 菠萝蜜干果220g -“包装升级，新老包装随机发货”(越南进口)','GN-20141111144136386','',NULL,'','/goods/2014/11/11/26us835782u8ue17tjd4.jpg',NULL,'<h3 class=\"productDescriptionSource\">\r\n	品牌简介</h3>\r\n<p>\r\n	沙巴哇&mdash;&mdash;整体像一座小山，上部有椰树，下面有沙滩，海水，是一种时尚、休闲、诗意的象征。<br />\r\n	沙巴哇干果是沙巴哇品牌商品系列之一， 采用纯越南进口的天然水果低温干燥脱水而成。沙巴哇的制造商是越南食品股份公司，是越南目前供应干果实力较强工产厂商，集有上万亩果园、生产加工基地、大 型冻库、物流、研发部门。采用进口设备、先进管理方法，多年来荣获越南国家农业部门好评，出口国家有中国、美国、中东等地区。<br />\r\n	公司立足于研制和开发特色传统食品标，发扬创建特色传统食品强势企业为目标。</p>\r\n<p>\r\n	沙巴哇菠萝蜜干果在加工鲜果成为干制品过程中，不添加任何食品添加剂，并以其特殊加工方法完全保留果味的品质和天然风味，其口味香脆可口，是时尚的休闲食品。</p>\r\n',NULL,'2014-11-11 00:00:00','2015-12-11 00:00:00','28.80','20.20','0.00',NULL,0,20,5,0,NULL,NULL,NULL,NULL,'0','0',NULL,NULL,NULL,NULL,NULL,'','','1',NULL,'1','2014-11-11 14:42:58',NULL,'0.00',NULL,'5622733132','1'),(616,26,'6284124436,5421714264,8113552212','',NULL,'COACH 蔻驰 女式 手提包 23575-SVB3V 12寸 卡其西瓜红','GN-20141112100015508','',NULL,'COACH 蔻驰 女式 手提包 23575 12寸','/goods/2014/11/12/6d2y211t6qm4u163416m.jpg,/goods/2014/11/12/r3bgh316q325r1538588.jpg,/goods/2014/11/12/18dlgm5ipvq2vhc8r46b.jpg,/goods/2014/11/12/q132e13kx4wc8ily174p.jpg',NULL,'<div class=\"productDescriptionWrapper\">\r\n	<div class=\"aplus\">\r\n		COACH 蔻驰 女式 手提包 23575 12寸<br />\r\n		<br />\r\n		<br />\r\n		<img src=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/AAK7R-130929-1.jpg\" /><br />\r\n		<img src=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/AAK7R-130929-2.jpg\" /><br />\r\n		<img src=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/AAK7R-130929-35.jpg\" /><br />\r\n		<img src=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/AAK7R-130929-36.jpg\" /><br />\r\n		<img src=\"http://g-ec4.images-amazon.com/images/G/28/aplus_rbs/AAK7R-130929-37.jpg\" /></div>\r\n	<div class=\"emptyClear\">\r\n		&nbsp;</div>\r\n</div>\r\n<h3 class=\"productDescriptionSource\">\r\n	包装清单</h3>\r\n<div class=\"productDescriptionWrapper\">\r\n	包*1，防伪扣环\r\n	<div class=\"emptyClear\">\r\n		&nbsp;</div>\r\n</div>\r\n<h3 class=\"productDescriptionSource\">\r\n	品牌简介</h3>\r\n<p>\r\n	美国经典皮件品牌COACH，一向以简洁、耐用的风格特色赢得消费者的喜爱。而拥有历久弥新之口碑的COACH包包，最初的设计灵感竟是来自于一只垒球手 套，品牌创立人Miles Caha在一次观看垒球比赛的现场，惊讶地发现垒球手套具有越用越光滑、越柔软的特性，因此他回去后就试着将皮革特殊处理，使之更柔软，具有不易脱色、磨 损的特性，并且只要简单利用湿布擦拭，就能保有皮件的完美如新，当然这样耐久便利的设计，马上受到广大消费者的喜爱！</p>\r\n',NULL,'2014-11-12 00:00:00','2015-12-13 00:00:00','4180.00','1858.00','0.00',NULL,0,5,2,0,NULL,NULL,NULL,NULL,'0','0',NULL,NULL,NULL,NULL,NULL,'','','1',NULL,'1','2014-11-12 10:15:41',NULL,'0.00',NULL,'8655127246