28/meiying/lixu/B00D2NB8K8-03._V365077132_.jpg\" src=\"http://g-ec2.images-amazon.com/images/G/28/meiying/lixu/B00D2NB8K8-03._V365077132_.jpg\" style=\"\" /> <img alt=\"Osprey 男式 Kestrel 小鹰\" data-original=\"http://g-ec2.images-amazon.com/images/G/28/meiying/lixu/B00D2NB8K8-04._V365077132_.jpg\" src=\"http://g-ec2.images-amazon.com/images/G/28/meiying/lixu/B00D2NB8K8-04._V365077132_.jpg\" style=\"\" /> <img alt=\"Osprey 男式 Kestrel 小鹰\" data-original=\"http://g-ec2.images-amazon.com/images/G/28/meiying/lixu/B00D2NB8K8-05._V365077132_.jpg\" src=\"http://g-ec2.images-amazon.com/images/G/28/meiying/lixu/B00D2NB8K8-05._V365077132_.jpg\" style=\"\" /></div>\r\n	</div>\r\n	<div class=\"emptyClear\">\r\n		&nbsp;</div>\r\n</div>\r\n<h3 class=\"productDescriptionSource\">\r\n	品牌简介</h3>\r\n<p>\r\n	OSPREY 是一个历史悠久的厂商，1974年MIKE PFOTENHAUER 和 LAURIE WHITE 开创了OSPREY品牌的雏形，公司所在地是科罗拉多州的Circle Cortez.与众多传奇性的户外产品一样，MIKE PFOTENHAUER 和 LAURIE WHITE 即是公司的老板，也同样是产品最主要的设计师。近几年，OSPREY将所有生产线全部都放在越南。作为比较早进入中国的一流背包品牌，OSPREY在中国 拥有为数众多的拥护者，享有非常高的品牌知名度和美誉度。OSPREY的背包设计独树一格、创新的理念十足，敢于尝试新材料、新做法、可称为美式背包的代 表作之一。 OSPREY团队致力研发、开拓向前，在保持背包专业性的基础上，扩大背包运用的涉及面和覆盖面，从户外到城市，从重装到休闲，OSPREY都无所不在。 全新的背负设计、不俗的负载性能，区分男女款式的背包设计以及追求轻量化&amp;贴合度的统一，OSPREY始终走在时代前列，引领着背包发展的新趋 势。</p>\r\n',NULL,'2014-11-12 00:00:00','2015-11-13 00:00:00','1480.00','1110.00','0.00',NULL,0,5,1,0,NULL,NULL,NULL,NULL,'0','0',NULL,NULL,NULL,NULL,NULL,'','','1',NULL,'1','2014-11-12 11:51:19',NULL,'0.00',NULL,'4456783257','1'),(626,26,'6284124436,5421714264,5156623527','',NULL,'Osprey 男式 Kestrel 小鹰 48 双肩背包 348080-71918001361','GN-20141112115152269','',NULL,'','/goods/2014/11/12/d88dy36tl658e4v8hx7d.jpg,/goods/2014/11/12/3w68a627o374o2mtdoj4.jpg',NULL,'<h3 class=\"productDescriptionSource\">\r\n	商品描述</h3>\r\n<div class=\"productDescriptionWrapper\">\r\n	<div class=\"aplus\">\r\n		<h4>\r\n			Osprey Kestrel小鹰 48 双肩背包 男式 348080-48</h4>\r\n		<p>\r\n			Kestrel 小鹰系列 可能是我们最为多功能系列的背包，轻质、便捷和高功能性的完美结合，集各种功能于一身，我们升级了他们的外观，使其更前卫，同时又不损失它的功能性，和其 独有的吸引力。小鹰48是款&rdquo