-show/back5_png-8._V355502328_.png\" /></div>\r\n			<div style=\"width:760;border-style:solid;border-width:1px;border-color:#E9E7EF;padding:19px;margin:40px 0px 10px 0px;\">\r\n				<img id=\"cndq_detail_show.main_img_2\" src=\"http://ec4.images-amazon.com/images/I/71ExmvJfLPL._CR14,28,2520,915_SX760_.jpg\" /></div>\r\n		</div>\r\n	</div>\r\n</div>\r\n<div id=\"product-description_feature_div\">\r\n	<div>\r\n		<hr class=\"bucketDivider\" noshade=\"true\" size=\"1\" />\r\n	</div>\r\n</div>\r\n<h3 class=\"productDescriptionSource\">\r\n	商品描述</h3>\r\n<div class=\"productDescriptionWrapper\">\r\n	Adidas 阿迪达斯 DAROGA TWO 11 LEA 男 越野跑步鞋\r\n	<div class=\"emptyClear\">\r\n		&nbsp;</div>\r\n</div>\r\n<h3 class=\"productDescriptionSource\">\r\n	品牌简介</h3>\r\n<h4>\r\n	Adidas 阿迪达斯 品牌介绍</h4>\r\n<div class=\"leftImage\">\r\n	<img alt=\"Adidas 阿迪达斯\" data-original=\"http://g-ec4.images-amazon.com/images/G/28/shoes/adidas_shoes_brand_logo-140124.jpg\" src=\"http://g-ec4.images-amazon.com/images/G/28/shoes/adidas_shoes_brand_logo-140124.jpg\" style=\"\" width=\"110\" /></div>\r\n<p>\r\n	阿 迪达斯(adidas)是德国运动用品制造商，是adidas AG集团公司的成员公司。阿迪达斯(adidas)品牌的前身在1920年于德国赫佐格奥拉赫(Herzogenaurach)开始生产鞋类产品。 1948年，阿迪达斯(adidas)的创办人阿道夫&bull;阿迪达斯勒(Adolf Adi Dassler)先生用他的中间名adi和姓氏Dassler的头三个字母组成，合成&ldquo;adidas&rdquo;作为商品品牌并申请注册。1949年8月18日以 adidas AG名字注册公司，adidas的Logo，著名的呈三角形的三条线商标问世。</p>\r\n<p>\r\n	目前阿迪达斯旗下拥有四大系列：运动表现系列performance(三条纹)，运动传统系列originals(三叶草)，运动时尚系列style(分三个子品牌：Y-3，SLVR，adidas)以及运动生活系列NEO Label。</p>\r\n<p>\r\n	adidas 在足球、篮球、田径、网球、棒球、拳击、游泳以及最新潮的极限运动等运动项目都占有一席之地，许多知名的顶尖运动选手都为adidas的品质折服。在运动 用品的世界中，adidas一直代表着一种特别的地位，而这种象征有人称之为&ldquo;胜利的三条线&rdquo;。自1948年创立至今，adidas帮助过无数的运动选手 缔造佳绩，成就了不少的丰功伟业。因此，adidas也可以说是集合了众人信赖及尊敬的最佳典范。今日，adidas依然秉持阿迪&bull;达斯勒完美制鞋的理 念，不断的与世界级的顶尖运动家与教练交换心得与需求，经过一连串反覆的测试与考验，发展出符合人体工学的各项产品，不但能帮助各类专业运动家们提升运动 表现、更能满足一般市场消费者对高品质运动商品的需求。</p>\r\n<p>\r\n	adidas不仅在设计上、功能上有新突破，代表性的三条线设计概念亦在流行趋势中掀起另一股风潮，席卷时下的年轻新世代，形成流行新风格，带领全球运动商品迈向更多元化的远景。</p>\r\n',NULL,'2014-11-12 00:00:00','2015-11-13 00:00:00','799.00','599.00','0.00',NULL,0,20,5,0,NULL,NULL,NULL,NULL,'0','0',NULL,NULL,NULL,NULL,NULL,'','','1',NULL,'1','2014-11-12 12:08:31',NULL,'0.00',NULL,'2211818844','1'),(629,26,'6284124436,4863848563,4854218147','',NULL,'Adidas 阿迪达斯 TEAM Mad Handle 2 男 篮球鞋','GN-20141112120956011','',NULL,'','/goods/2014/11/12/k256i22urvg42f85tou1.jpg,/goods/2014/11/12/5tf232se5h4v18t7172c.jpg,/goods/2014/11/12/x6vxj5bc2co245n7bxu3.jpg,/goods/2014/11/12/yp47r7kab1f86fo81755.jpg',NULL,'<h2 style=\"margin: 7px 0 7px 0\">\r\n	细节展示</h2>\r\n<div id=\"cndq_aplus_detail_show\" style=\"margin:10px 0 10px 0px\">\r\n	<div id=\"cndq_detail_show.alternative_annotation\" style=\"text-align:left;font-family:Microsoft YaHei;line-height:19px;font-size:13px;color:#888888;\">\r\n		以一种颜色为例</div>\r\n	<div id=\"cndq_template_wrapper_div\" style=\"width:880px;margin:40px auto 25px;padding:0 40px 0 40px;text-align:left;font-family:Microsoft YaHei;font-size:16px;line-height:20px;color:#888888;\">\r\n		<div>\r\n			<div style=\"margin:5px 0px 0px 12px;position:absolute;z-index:2\">\r\n				侧面特写</div>\r\n			<div style=\"position:absolute;z-index:1;-moz-opacity:0.8;opacity: 0.8;filter: Alpha(Opacity=80);\">\r\n				<img alt=\"\" src=\"http://g-ec2.images-amazon.com/images/G/28/cndq/detail-show/back5_png-8._V355502328_.png\" /></div>\r\n			<div style=\"width:760;border-style:solid;border-width:1px;border-color:#E9E7EF;padding:19px;margin:0px 0px 0px 0px;\">\r\n				<img id=\"cndq_detail_show.main_img_1\" src=\"http://ec4.images-amazon.com/images/I/81-145D32nL._CR0,0,2560,1461_SX760_.jpg\" /></div>\r\n		</div>\r\n		<div style=\"margin:40px auto 0px;width:880;\">\r\n			<div style=\"display:inline-block;width:382px;margin:0px 36px 0px 0px;*display:inline;*zoom:1;background-color:#fafafa;\">\r\n				<div style=\"margin:5px 0px 0px 12px;width:360;position:absolute;z-index:2\">\r\n					鞋舌/鞋带</div>\r\n				<div style=\"position:absolute;z-index:1;-moz-opacity:0.8;opacity: 0.8;filter: Alpha(Opacity=80);\">\r\n					<img a