Mark/g14/M02/00/11/rBEhV1Gz2AQIAAAAAAGRVkb_K5IAAAG3AFBn8EAAZFu851.jpg\" style=\"margin: 0px; padding: 0px;\" /> <img alt=\"\" class=\"err-product\" src=\"http://img30.360buyimg.com/popWaterMark/g14/M02/00/11/rBEhV1Gz2AUIAAAAAAM5QlMJKkUAAAG3AFGhgkAAzla395.jpg\" style=\"padding: 0px;\" /> <img alt=\"\" class=\"err-product\" src=\"http://img30.360buyimg.com/popWaterMark/g14/M02/00/11/rBEhVlGz2AUIAAAAAAFibV-RVc0AAAG3AFLIUMAAWKF710.jpg\" style=\"margin: 0px; padding: 0px;\" /> <img alt=\"\" class=\"err-product\" src=\"http://img30.360buyimg.com/popWaterMark/g14/M02/00/11/rBEhVlGz2AUIAAAAAAGyHAoRq6gAAAG3AFNuoEAAbI0900.jpg\" style=\"margin: 0px; padding: 0px;\" /></p>\r\n<h1 style=\"margin: 0px; color: rgb(71, 123, 64);\">\r\n	要吃就吃天然安全的</h1>\r\n<h2 style=\"margin: 0px; color: rgb(71, 123, 64);\">\r\n	---------------------------------------------------</h2>\r\n<h2 style=\"margin: 0px; color: rgb(234, 111, 1);\">\r\n	吉顺号正宗梁河皂角米</h2>\r\n<h1 style=\"color: rgb(234, 50, 1);\">\r\n	不硫熏 不漂白的放心食品,假一赔十</h1>\r\n<h3 style=\"text-align: left;\">\r\n	掌柜推荐理由:</h3>\r\n<p style=\"text-align: left; text-indent: 28px;\">\r\n	不是所有皂角米都叫吉顺号!</p>\r\n<p style=\"text-align: left; text-indent: 28px;\">\r\n	来自云南德宏梁河,单个生长于山林之间,庭前屋后的健康食品,古时皇室贵妃最喜欢的养颜圣品.</p>\r\n<p style=\"text-align: left; text-indent: 28px;\">\r\n	<span style=\"color:#ea3201;\">丰富的胶原蛋白,氨基酸含量,女人护肤养颜的佳品,更有超Q超糯超滑的口感,</span>给您带来最极致的食品享受.</p>\r\n<p style=\"text-align: left; text-indent: 28px;\">\r\n	吉顺号坚持使用原产地皂角米,传承民族文化,使用传统工艺,<span style=\"color:#ea3201;\">拒绝使用任何添加剂防腐剂,使用真空包装干仓存储,当月加工制作.</span>给亲提供最优质的足量云南皂角米,颗颗饱满,粒粒结实.</p>\r\n<p style=\"text-align: left; text-indent: 28px; font-size: 12px;\">\r\n	注:本款是双荚皂角米,本店也有单荚皂角米,请亲不要选错.</p>\r\n<p>\r\n	<img alt=\"\" class=\"err-product\" src=\"http://img30.360buyimg.com/popWaterMark/g14/M02/00/11/rBEhVVGz2AYIAAAAAAGou50nqpsAAAG3AFPbLUAAajT632.jpg\" style=\"margin: 0px; padding: 0px;\" /> <img alt=\"\" class=\"err-product\" src=\"http://img30.360buyimg.com/popWaterMark/g14/M02/00/11/rBEhVlGz2AYIAAAAA