 src=\"http://img30.360buyimg.com/popWaterMark/g14/M06/00/11/rBEhVlGz2AcIAAAAAAABalWjzaMAAAGwwP__ngAAAGI120.jpg\" />口感</td>\r\n							<td>\r\n								Q弹爽口,香糯不黏牙</td>\r\n						</tr>\r\n					</tbody>\r\n				</table>\r\n			</td>\r\n		</tr>\r\n		<tr style=\"height: 30px;\">\r\n			<td>\r\n				<table style=\"border-width: medium medium 1px; border-style: none none solid; border-color: currentColor currentColor rgb(238, 238, 238); width: 600px;\">\r\n					<tbody>\r\n						<tr>\r\n							<td style=\"width: 135px;\">\r\n								<img alt=\"\" class=\"err-product\" src=\"http://img30.360buyimg.com/popWaterMark/g14/M09/00/0F/rBEhV1Gz2AcIAAAAAAABc47vqk0AAAGOwPrUakAAAJY232.jpg\" />香气</td>\r\n							<td>\r\n								淡淡米香</td>\r\n						</tr>\r\n					</tbody>\r\n				</table>\r\n				<table style=\"border-width: medium medium 1px; border-style: none none solid; border-color: currentColor currentColor rgb(238, 238, 238); width: 600px;\">\r\n					<tbody>\r\n						<tr>\r\n							<td style=\"width: 135px;\">\r\n								<img alt=\"\" class=\"err-product\" src=\"http://img30.360buyimg.com/popWaterMark/g14/M02/00/10/rBEhVlGz2AcIAAAAAAABc1TaY2EAAAGoAP__aMAAAJd143.jpg\" />保存方法</td>\r\n							<td>\r\n								避光 干燥 通风</td>\r\n						</tr>\r\n					</tbody>\r\n				</table>\r\n				<table style=\"border-width: medium medium 1px; border-style: none none solid; border-color: currentColor currentColor rgb(238, 238, 238); width: 600px;\">\r\n					<tbody>\r\n						<tr>\r\n							<td style=\"width: 135px;\">\r\n								<img alt=\"\" class=\"err-product\" src=\"http://img30.360buyimg.com/popWaterMark/g14/M01/00/10/rBEhV1Gz2AcIAAAAAAABitOREvcAAAGlQP__ZsAAAJl317.jpg\" />重量</td>\r\n							<td>\r\n								100g</td>\r\n						</tr>\r\n					</tbody>\r\n				</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<h3 style=\"text-align: left;\">\r\n	产品展示</h3>\r\n<h1 style=\"margin: 0px; color: rgb(71, 123, 64);\">\r\n	山中珍品 天然安全</h1>\r\n<h2 style=\"margin: 0px; color: rgb(71, 123, 64);\">\r\n	---------------------------------------------------</h2>\r\n<h2 style=\"margin: 0px; color: rgb(234, 111, 1);\">\r\n	吉顺号正宗梁河皂角米</h2>\r\n<p>\r\n	<img alt=\"\" class=\"err-product\" src=\"http://img30.360buyimg.com/popWaterMark/g14/M02/00/11/rBEhVlGz2AgIAAAAAAHn0u3sOoIAAAG3AFeiR0AAefq721.jpg\" style=\"margin: 0px; padding: 5px 0px 0px;\" /> <img alt=\"\" class=\"err-product\" src=\"http://img30.360buyimg.com/popWaterMark/g14/M02/00/11/rBEhVVGz2AgIAAAAAAH9ROpp08AAAAG3AFjvy8AAf1c737.jpg\" style=\"margin: 0px; padding: 5px 0px 0px;\" /> <img alt=\"\" class=\"err-product\" src=\"http://img30.360buyimg.com/popWaterMark/g14/M02/00/11/rBEhV1Gz2AgIAAAAAAE61GqMSIoAAAG3AFmr9wAATrs186.jpg\" style=\"margin: 0px; padding: 5px 0px 0px;\" /></p>\r\n<h2 style=\"margin: 0px; text-align: left; color: rgb(234, 111, 1);\">\r\n	「真正天然皂角米 传统方式加工 」</h2>\r\n<p style=\"text-align: left; text-indent: 28px;\">\r\n	吉顺号皂角米,选用来自云南梁河山野之间的生态皂荚,经人工摘菜,传统工艺晒制加工后,经人工筛选,静电除尘后,方才打包,皂角米泡发率高,虽然干米时颜色微黄,但是跑发后就变得晶莹剔透了,口感香糯,保证亲吃过一次就爱上她.</p>\r\n<p style=\"text-align: left; color: rgb(234, 50, 1); text-indent: 28px;\">\r\n	特别提示:我们家的皂角米选用的是天然的皂角米,所以颗粒可能会不均,因光照情况的不同,不能保证每粒都是一样的颜色,有深有浅是很正常的!市面上那些看上去完美无瑕的,极有可能是通过漂白烟熏的!</p>\r\n<h1 style=\"margin: 0px; color: rgb(71, 123, 64); padding-top: 40px;\">\r\n	长于山间,绿色生态</h1>\r\n<h2 style=\"margin: 0px; color: rgb(71, 123, 64);\">\r\n	---------------------------------------------------</h2>\r\n<h2 style=\"margin: 0px; color: rgb(234, 111, 1);\">\r\n	吉顺号正宗梁河皂角米</h2>\r\n<p>\r\n	<img alt=\"\" class=\"err-product\" src=\"http://img30.360buyimg.com/popWaterMark/g15/M04/00/11/rBEhWVGz2AkIAAAAAALlBVyaREsAAAG3AEBDP8AAuUd843.jpg\" style=\"margin: 0px; padding: 5px 0px 0px;\" /> <img alt=\"\" class=\"err-product\" src=\"http://img30.360buyimg.com/popWaterMark/g14/M02/00/11/rBEhVVGz2AoIAAAAAAIHydyNIwkAAAG3AFpOz4AAgfh198.jpg\" style=\"margin: 0px; padding: 0px;\" /></p>\r\n<p style=\"text-align: left; text-indent: 28px;\">\r\n	亲,这就是野生皂荚哦,长于山林之间,庭前屋后,每一株都隔得比较远,也没有人工成片种植的,当地村民都是亲自上山采集的,这可是个体力活.</p>\r\n<p style=\"text-align: left; text-indent: 28px;\">\r\n	把长长的皂荚剥开,里面的皂角米有着一层厚厚的深色外壳,去除外壳后,里面就是我们的皂角米啦,因为都是野生的,所以比较珍贵,加之现在过度采集,皂角米已经越来越少了..</p>\r\n<p style=\"text-align: left; text-indent: 28px;\">\r\n	掌柜趁新鲜煮了一碗粥哦,配上云南的老土红糖、枸杞、大枣真是美味呢.</p>\r\n<h1 style=\"margin: 0px; color: rgb(71, 123, 64); padding-top: 40px;\">\r\n	山间拾趣 乐享人生</h1>\r\n<h2 style=\"margin: 0px; color: rgb(71, 123, 64);\">\r\n	---------------------------------------------------</h2>\r\n<h2 style=\"margin: 0px; color: rgb(234, 111, 1);\">\r\n	吉顺号正宗梁河皂角米</h2>\r\n<p>\r\n	<img alt=\"\" class=\"err-product\" src=\"http://img30.360buyimg.com/popWaterMark/g14/M02/00/11/rBEhVVGz2AoIAAAAAAQc-CRdmqYAAAG3AFz5g0ABB0Q455.jpg\" style=\"margin: 0px; padding: 5px 0px 0px;\" /> <img alt=\"\" class=\"err-product\" src=\"http://img30.360buyimg.com/popWaterMark/g14/M02/00/11/rBEhVlGz2AsIAAAAAAL97f2LD_YAAAG3AF4Ax0AAv4F391.jpg\" style=\"margin: 0px; padding: 5px 0px 0px;\" /></p>\r\n<p style=\"text-align: left; text-indent: 28px;\">\r\n	云南从来就是个神秘的地方,这里自然环境优越,有着无数的山林,更重要的是这里形形色色的少数民族,每一个都有着独特的文化,来到云南,就放佛进入了世外桃源,让人再也不想离去.</p>\r\n<p style=\"text-align: left; text-indent: 28px;\">\r\n	梁河县,自古就是文化名镇,这里有着傣家的州府,记录着傣族的年前文化;我们行于深山之间,细品傣家美食,真乃自在享受.</p>\r\n<h3 style=\"text-align: left; margin-top: 50px;\">\r\n	常见问题</h3>\r\n<p style=\"text-align: left; color: rgb(234, 50, 1); padding-left: 15px;\">\r\n	Q:这个皂角米为什么看上去黄黄的,颗粒不均匀能放心吃吗?</p>\r\n<p>\r\n	<img alt=\"\" class=\"err-product\" src=\"http://img30.360buyimg.com/popWaterMark/g14/M02/00/11/rBEhV1Gz2AsIAAAAAACKZUWDuVYAAAG3AF7ASIAAIp9071.jpg\" style=\"margin: 0px; padding: 15px 0px 0px;\" /></p>\r\n<p style=\"text-align: left; padding-left: 15px;\">\r\n	A:亲!我们的产品是天然皂角米,加工方法更是传统晒制,因为放在太阳地下晒,不能保证每颗受到的热量都是均匀的,所以颜色会不一样的,米是天然的,又没有经过嫁接改良,当然每个生的都不是那么完美的.</p>\r\n<p style=\"text-align: left; padding-left: 15px;\">\r\n	掌柜亲自保证,我们的米每一粒都来自云南梁河,不打花哨的口号,敢于展现米的瑕疵,就为亲能够吃上最好的云南皂角米!</p>\r\n<p style=\"text-align: left; color: rgb(234, 50, 1); padding-left: 15px;\">\r\n	Q:怎么样区别烟熏硫制的皂角米呢?</p>\r\n<p>\r\n	<img alt=\"\" class=\"err-product\" src=\"http://img30.360buyimg.com/popWaterMark/g14/M02/00/11/rBEhVlGz2AsIAAAAAAE4zDyVFC8AAAG3AF8YLwAATjk641.jpg\" style=\"margin: 0px; padding: 15px 0px 0px;\" /></p>\r\n<p style=\"text-align: left; padding-left: 15px;\">\r\n	A:这个和药材是一样的,前面时间闹出来的银耳事件一样,外观越美的越是经过化学加工,<strong>硫熏过的皂角米颗颗白皙,而且可以随意储存,都不会起虫,而且发泡率很高,营养成分流失60%以上.</strong></p>\r\n<p style=\"text-align: left; padding-top: 0px; padding-left: 15px; margin-top: 5px;\">\r\n	&nbsp;&nbsp;正常皂角米颜色微黄 ,需使用真空包装,否则会长虫,亲们在开袋后请尽快食用哦,另外因为快递比较暴力,真空包装可能会破损,不影响食用的哦,请避光干燥保存.我们会尽力打包,争取让亲收到完整的包装,</p>\r\n<p style=\"text-align: left; color: rgb(234, 50, 1); padding-left: 15px;\">\r\n	Q:双荚皂角米的单荚的有什么区别呢?</p>\r\n<p>\r\n	<img alt=\"\" class=\"err-product\" src=\"http://img30.360buyimg.com/popWaterMark/g15/M04/00/11/rBEhWFGz2AwIAAAAAAEYppwDFIsAAAG3AEKRhgAARi-460.jpg\" style=\"margin: 0px; padding: 5px 0px 0px;\" /> <img alt=\"\" class=\"err-product\" src=\"http://img30.360buyimg.com/popWaterMark/g15/M04/00/11/rBEhWlGz2AwIAAAAAAEJnNI1CTAAAAG3AEOg10AAQm0037.jpg\" style=\"margin: 0px; padding: 5px 0px 0px;\" /></p>\r\n<p style=\"text-align: left; padding-left: 15px;\">\r\n	A:单荚皂角米产量比较低,价格较高.干米颜色较白一些,而且泡发率比较高,口感略薄,更滑一些.</p>\r\n<p style=\"text-align: left; padding-left: 15px;\">\r\n	&nbsp;&nbsp;双荚皂角米,价格比较实惠颜色偏黄,没有那么高的泡发率,口感更糯更耐嚼一些,亲可以根据自己需求选择.</p>\r\n<p style=\"text-align: left; color: rgb(234, 50, 1); padding-left: 15px;\">\r\n	Q:皂角米应该怎么做呢?</p>\r\n<p>\r\n	<img alt=\"\" class=\"err-product\" src=\"http://img30.360buyimg.com/popWaterMark/g15/M04/00/11/rBEhWFGz2AwIAAAAAAB28IH-61AAAAG3AEPjREAAHcI147.jpg\" style=\"padding: 5px 0px;\" /> <img alt=\"\" class=\"err-product\" src=\"http://img30.360buyimg.com/popWaterMark/g14/M02/00/11/rBEhV1Gz2AwIAAAAAACiQJWNaMwAAAG3AGBJyQAAKJY453.jpg\" style=\"padding: 5px 0px;\" /> <img alt=\"\" class=\"err-product\" src=\"http://img30.360buyimg.com/popWaterMark/g15/M04/00/11/rBEhWVGz2AwIAAAAAADM0i8vULsAAAG3AEQBBkAAMzq254.jpg\" style=\"padding: 5px 0px;\" /></p>\r\n<p style=\"text-align: left; padding-left: 15px;\">\r\n	A:皂角米吃法多样,一般用于煮粥,调羹,跟桃胶、大枣、枸杞更是绝配,皂角米不用放太多仅仅10g左右就够吃一大碗了.</p>\r\n<p style=\"text-align: left; color: rgb(234, 50, 1); padding-left: 15px;\">\r\n	Q:云南皂角米和贵州皂角米有什么区别呢?</p>\r\n<p>\r\n	<img alt=\"\" class=\"err-product\" src=\"http://img30.360buyimg.com/popWaterMark/g14/M02/00/11/rBEhVVGz2A0IAAAAAAB7IBKQ0IQAAAG3AGByXwAAHs4504.jpg\" style=\"padding: 5px 0px;\" /></p>\r\n<p style=\"text-align: left; padding-left: 15px;\">\r\n	A:<span style=\"text-align: left; text-indent: 28px;\">大家都知道,皂角米全国只有2个地方生产,一个是贵州,一个是云南梁河,云南的皂角米因优质的生态环境,独有的光照时间,使皂角米更佳饱满,口感更Q更糯.</span></p>\r\n<h3 style=\"text-align: left; padding-left: 15px;\">\r\n	有关色差</h3>\r\n<p>\r\n	<img alt=\"\" class=\"err-product\" src=\"http://img30.360buyimg.com/popWaterMark/g15/M04/00/11/rBEhWlGz2A0IAAAAAAFbhPW7uq4AAAG3AEQ0QMAAVuc694.jpg\" style=\"margin: 0px; padding: 0px;\" /></p>\r\n<p style=\"text-align: left; padding-left: 15px;\">\r\n	本店图片均为实物拍摄,加摄影师精心处理尽量还原产品颜色, 但由于显示器有时会存在色差,导致显示结果与实物稍有不一致,且茶叶颜色较为微妙,在不同光线下颜色会有所不同,希望亲理解</p>\r\n<h3 style=\"text-align: left;\">\r\n	有关快递</h3>\r\n<p style=\"text-align: left; padding-left: 15px;\">\r\n	全店满50元包邮，默认发ems经济快递、韵达、中通、汇通（由工作人员视不同区域选择适当快递）， 如需发其他快递或以上快递到不了的地方请联系客服</p>\r\n<p>\r\n	<img alt=\"\" class=\"err-product\" src=\"http://img30.360buyimg.com/popWaterMark/g14/M02/00/11/rBEhVlGz2A0IAAAAAADWL3MQI2kAAAG3AGCRLQAANZH374.jpg\" style=\"margin: 0px; padding: 0px;\" /></p>\r\n<div>\r\n	<img alt=\"\" src=\"http://img10.360buyimg.com/imgzone/g15/M09/10/18/rBEhWlMymAsIAAAAAAPJXH-dYVkAAKuzAF3pZIAA8l0033.jpg\" /> <img alt=\"\" src=\"http://img10.360buyimg.com/imgzone/g15/M09/10/18/rBEhWlMymA8IAAAAAANYkYURuUMAAKuzAMgge0AA1ip898.jpg\" /> <img alt=\"\" src=\"http://img10.360buyimg.com/imgzone/g15/M09/10/18/rBEhWlMymA0IAAAAAAfS8dm317kAAKuzAIkT6YAB9MJ936.jpg\" /> <img alt=\"\" src=\"http://img10.360buyimg.com/imgzone/g15/M01/10/18/rBEhWFMyl-AIAAAAAAQ4nrOr-1QAAKuyAGdWKAABDi2948.jpg\" /> <img alt=\"\" src=\"http://img10.360buyimg.com/imgzone/g15/M01/10/18/rBEhWFMyl-EIAAAAAAW