/*Table structure for table `goodsorder` */

DROP TABLE IF EXISTS `goodsorder`;

CREATE TABLE `goodsorder` (
  `order_id` varchar(17) NOT NULL DEFAULT '',
  `buy_cust_id` mediumint(9) NOT NULL,
  `sale_cust_id` mediumint(9) NOT NULL,
  `consignee` varchar(20) NOT NULL,
  `area_attr` varchar(100) NOT NULL,
  `address` varchar(200) NOT NULL,
  `zip_code` varchar(10) DEFAULT NULL,
  `telephone` varchar(20) DEFAULT NULL,
  `mobile` varchar(12) NOT NULL,
  `goods_amount` decimal(10,2) DEFAULT '0.00',
  `ship_free` decimal(10,2) DEFAULT '0.00',
  `tax_invoice` decimal(10,2) DEFAULT NULL,
  `discount` float DEFAULT NULL,
  `discount_money` decimal(10,2) DEFAULT NULL,
  `dis_explain` varchar(100) DEFAULT NULL,
  `insured` decimal(10,2) DEFAULT NULL,
  `tatal_amount` decimal(10,2) DEFAULT '0.00',
  `inter_money` int(11) DEFAULT NULL,
  `buy_mode` char(1) DEFAULT '0',
  `pay_id` varchar(10) DEFAULT NULL,
  `send_mode` char(10) DEFAULT NULL,
  `order_state` char(1) NOT NULL,
  `pay_state` char(1) DEFAULT NULL,
  `send_state` char(1) DEFAULT NULL,
  `order_time` datetime NOT NULL,
  `pay_time` datetime DEFAULT NULL,
  `send_time` datetime DEFAULT NULL,
  `receipt_time` datetime DEFAULT NULL,
  `mem_remark` varchar(300) DEFAULT NULL,
  `invoice_type` char(1) DEFAULT NULL,
  `invoice_top` varchar(300) DEFAULT NULL,
  `company_name` varchar(50) DEFAULT NULL,
  `ident_number` varchar(50) DEFAULT NULL,
  `regis_address` varchar(100) DEFAULT NULL,
  `regis_tel` varchar(20) DEFAULT NULL,
  `open_bank` varchar(22) DEFAULT NULL,
  `bank_account` varchar(100) DEFAULT NULL,
  `invoice_content` varchar(300) DEFAULT NULL,
  `give_inter` int(11) DEFAULT NULL,
  `order_type` varchar(10) DEFAULT 'goods',
  `order_src` varchar(10) DEFAULT NULL,
  `order_goods_desc` varchar(3000) DEFAULT NULL,
  `is_del` varchar(1) DEFAULT NULL COMMENT '0:未删除，1：已删除，2：彻底删除',
  PRIMARY KEY (`order_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 CHECKSUM=1 DELAY_KEY_WRITE=1 ROW_FORMAT=DYNAMIC COMMENT='记录商品订单信息';

