/*Table structure for table `goodsstockhistory` */

DROP TABLE IF EXISTS `goodsstockhistory`;

CREATE TABLE `goodsstockhistory` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '记录流水号',
  `goods_id` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT '商品ID',
  `change_amount` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '库存变化数量',
  `change_type` bit(1) NOT NULL DEFAULT b'1' COMMENT '库存变化类型：1，增加库存；0，减少库存',
  `before_change` int(11) NOT NULL DEFAULT '0' COMMENT '变化前库存',
  `after_change` int(11) unsigned NOT NULL DEFAULT '0' COMMENT '变化后库存',
  `change_reason` smallint(1) unsigned NOT NULL DEFAULT '0' COMMENT '变化原因：0，订单创建；1：订单取消；2：商品初始化；3：卖家操作；4：其他；',
  `change_desc` varchar(255) DEFAULT NULL COMMENT '变化描述',
  `change_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '库存变化发生时间',
  `order_no` varchar(17) DEFAULT NULL COMMENT '订单号',
  PRIMARY KEY (`id`),
  KEY `idx_goods_id` (`goods_id`)
