/*Table structure for table `groupgoods` */

DROP TABLE IF EXISTS `groupgoods`;

CREATE TABLE `groupgoods` (
  `group_id` mediumint(9) NOT NULL AUTO_INCREMENT,
  `goods_id` mediumint(9) NOT NULL DEFAULT '0',
  `cust_id` mediumint(9) NOT NULL,
  `group_title` varchar(200) NOT NULL,
  `cat_attr` varchar(100) DEFAULT NULL,
  `bond` decimal(10,2) NOT NULL,
  `group_price` decimal(10,2) NOT NULL,
  `cust_maxbuy` int(11) DEFAULT '1',
  `min_buy` mediumint(9) NOT NULL DEFAULT '0',
  `max_buy` mediumint(9) NOT NULL DEFAULT '0',
  `buy_num` mediumint(9) NOT NULL DEFAULT '0',
  `already_buy` mediumint(9) NOT NULL DEFAULT '0',
  `reach_time` datetime NOT NULL,
  `saler_address` varchar(100) NOT NULL DEFAULT '',
  `contact_way` varchar(20) DEFAULT NULL,
  `group_desc` text,
  `group_img` varchar(100) DEFAULT NULL,
  `is_seven` char(1) NOT NULL DEFAULT '1' COMMENT '0:是 1:否',
  `is_overdue` char(1) NOT NULL DEFAULT '1' COMMENT '0:是 1:否',
  `is_ship` char(1) NOT NULL DEFAULT '1' COMMENT '0:是 1:否',
  `start_date` datetime NOT NULL,
  `end_date` datetime NOT NULL,
  `sort_no` int(11) NOT NULL DEFAULT '0',
  `give_inter` int(11) NOT NULL DEFAULT '0',
  `give_money` decimal(10,2) NOT NULL DEFAULT '0.00',
  `info_state` char(1) NOT NULL COMMENT '0：未审核 1：审核通过 2：审核不通过 3：禁用',
  `no_reason` varchar(100) DEFAULT NULL,
  `user_id` mediumint(9) NOT NULL,
  `oper_time` datetime NOT NULL,
  PRIMARY KEY (`group_id`)
) ENGINE=MyISAM AUTO_INCREMENT=38 DEFAULT CHARSET=utf8 COMMENT='记录团购商品信息';

