/*Table structure for table `inc_feedback` */

DROP TABLE IF EXISTS `inc_feedback`;

CREATE TABLE `inc_feedback` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `content` varchar(500) NOT NULL,
  `contact` varchar(100) DEFAULT NULL,
  `device_id` varchar(200) DEFAULT NULL COMMENT 'Imei+mac地址 MD5加密',
  `app_os` tinyint(4) DEFAULT NULL COMMENT '1：Android；2：IOS',
  `app_os_version` varchar(10) DEFAULT NULL,
  `create_time` datetime NOT NULL,
  `app_version` varchar(10) DEFAULT NULL COMMENT 'APP版本',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=20 DEFAULT CHARSET=utf8 COMMENT='记录用户对手机客户端的反馈意见';

