CREATE TABLE `inc_goods_return` (
  `trade_id` char(17) NOT NULL,
  `biz_type` char(1) NOT NULL COMMENT '0：换货 1：退货 2：维修',
  `order_id` varchar(20) NOT NULL,
  `goods_id` mediumint(9) NOT NULL,
  `cont_desc` varchar(600) NOT NULL,
  `img_path` varchar(600) DEFAULT NULL COMMENT '多张以，号分隔',
