/*Table structure for table `interhistory` */

DROP TABLE IF EXISTS `interhistory`;

CREATE TABLE `interhistory` (
  `trade_id` int(11) NOT NULL,
  `user_id` int(11) NOT NULL,
  `credit_in` int(11) NOT NULL,
  `credit_out` int(11) NOT NULL,
  `credit_remain` int(11) NOT NULL,
  `credit_action` char(1) NOT NULL COMMENT '0：交易成功获得积分；1：评分获得积分；',
  `reason` varchar(100) NOT NULL,
  `in_date` datetime NOT NULL,
  `order_id` char(17) DEFAULT NULL,
  `goods_id` mediumint(9) DEFAULT NULL,
  PRIMARY KEY (`trade_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

