CREATE TABLE `member` (
  `cust_id` int(11) NOT NULL AUTO_INCREMENT,
  `user_name` varchar(50) DEFAULT NULL,
  `passwd` varchar(32) DEFAULT NULL,
  `contact_name` varchar(50) NOT NULL,
  `contact_phone` varchar(50) NOT NULL,
  `contact_email` varchar(100) NOT NULL,
  `cust_name` varchar(100) NOT NULL,
  `logo_img` varchar(100) DEFAULT NULL,
  `area_attr` varchar(100) NOT NULL,
  `address` varchar(200) NOT NULL,
  `phone` varchar(50) NOT NULL,
  `reg_money` varchar(20) NOT NULL,
  `reg_money_type` varchar(20) NOT NULL,
  `lic_no` varchar(100) NOT NULL,
  `lic_address` varchar(200) NOT NULL,
  `lic_start_time` varchar(50) NOT NULL,
  `lic_end_time` varchar(50) NOT NULL,
  `lic_img` varchar(100) NOT NULL,
  `product` varchar(200) NOT NULL,
  `person_id_img` varchar(100) NOT NULL,
  `org_img` varchar(100) NOT NULL,
  `tax_img` varchar(100) NOT NULL,
  `email` varchar(50) NOT NULL,
  `bank_img` varchar(100) NOT NULL,
  `bank_name` varchar(100) NOT NULL,
  `bank_id` varchar(50) NOT NULL,
  `apply_time` datetime NOT NULL,
  `user_id` int(11) DEFAULT NULL,
  `audit_status` char(1) NOT NULL COMMENT '0：未审核 1：审核通过 2：审核不通过',
  `no_reason` varchar(200) DEFAULT NULL,
  `audit_time` datetime DEFAULT NULL,
  PRIMARY KEY (`cust_id`)
) ENGINE=InnoDB AUTO_INCREMENT=28 DEFAULT CHARSET=utf8 COMMENT='记录会员信息表';

