/*Table structure for table `nav` */

DROP TABLE IF EXISTS `nav`;

CREATE TABLE `nav` (
  `nav_id` int(11) NOT NULL AUTO_INCREMENT,
  `nav_name` varchar(20) NOT NULL,
  `isshow` char(1) NOT NULL COMMENT '0：显示 1：隐藏',
  `sort_no` int(11) NOT NULL,
  `isopen` varchar(10) NOT NULL,
  `link_url` varchar(100) NOT NULL,
  `nav_post` char(1) NOT NULL COMMENT '0：上部 1：中部 2：下部',
  `nav_code` varchar(20) DEFAULT '',
  `plat_type` char(10) DEFAULT NULL,
  PRIMARY KEY (`nav_id`)
