/*Table structure for table `ordertrans` */

DROP TABLE IF EXISTS `ordertrans`;

CREATE TABLE `ordertrans` (
  `trans_id` mediumint(9) NOT NULL,
  `cust_id` mediumint(9) DEFAULT NULL,
  `order_id` char(17) DEFAULT NULL,
  `order_state` char(1) DEFAULT NULL,
  `user_id` mediumint(9) DEFAULT NULL,
  `trans_time` datetime DEFAULT NULL,
  `reason` varchar(300) DEFAULT NULL,
  PRIMARY KEY (`trans_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='记录商品订单异动信息';

/*Data for the table `ordertrans` */

/*Table structure for table `organize` */

DROP TABLE IF EXISTS `organize`;

CREATE TABLE `organize` (
  `org_id` char(10) NOT NULL,
  `org_name` varchar(20) NOT NULL,
  `up_org_id` char(10) NOT NULL COMMENT '1111111111',
  `org_level` int(11) NOT NULL,
  `sys_org` char(1) NOT NULL DEFAULT '0' COMMENT '0：业务部门 1：系统部门',
  `area_attr` varchar(500) NOT NULL DEFAULT '',
  `contact` varchar(10) NOT NULL,
  `phone` varchar(20) NOT NULL,
  `cellphone` varchar(20) DEFAULT NULL,
  `skype` varchar(60) DEFAULT NULL,
  `qq` varchar(20) DEFAULT NULL,
  `msn` varchar(60) DEFAULT NULL,
  `email` varchar(60) DEFAULT NULL,
  `fax` varchar(20) DEFAULT NULL,
  `address` varchar(100) DEFAULT NULL,
  `cat_attr` varchar(100) DEFAULT NULL,
