/*Table structure for table `static_info` */

DROP TABLE IF EXISTS `static_info`;

CREATE TABLE `static_info` (
  `id` int(11) NOT NULL,
  `module_name` varchar(50) DEFAULT NULL,
  `type` char(1) DEFAULT NULL COMMENT '0：修改或添加   1：删除',
  `info_id` varchar(20) DEFAULT NULL,
  `push` char(1) DEFAULT NULL COMMENT '0：只生成静态页，不推送  1：只推送   2：既生成静态页，同时推送',
  `execnum` char(1) DEFAULT NULL COMMENT '0：默认  1：当执行过一次且推送为2，则变为1 。    当再此执行时判断为1的，则删除。',
  `in_date` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='静态化增量信息';

/*Data for the table `static_info` */

/*Table structure for table `subscribe` */

DROP TABLE IF EXISTS `subscribe`;

CREATE TABLE `subscribe` (
  `sub_id` mediumint(9) NOT NULL AUTO_INCREMENT,
  `cust_id` mediumint(9) NOT NULL,
  `info_type` char(1) NOT NULL COMMENT '0：供应 1：求购',
  `keyword` varchar(60) NOT NULL,
  `cat_attr` varchar(200) DEFAULT NULL,
  `area_attr` varchar(200) DEFAULT NULL,
  `period` int(11) NOT NULL COMMENT '天数',
  `send_type` char(1) NOT NULL COMMENT '0：邮件 1：站内信',
  `enabled` char(1) NOT NULL COMMENT '0：有效 1：无效',
  `in_date` datetime NOT NULL,
  PRIMARY KEY (`sub_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='记录会员商机订阅信息';

/*Data for the table `subscribe` */

/*Table structure for table `subscribeinfo` */

DROP TABLE IF EXISTS `subscribeinfo`;

CREATE TABLE `subscribeinfo` (
  `send_id` mediumint(9) NOT NULL AUTO_INCREMENT,
  `cust_id` mediumint(9) NOT NULL,
  `sub_id` mediumint(9) NOT NULL,
  `info_type` char(1) NOT NULL COMMENT '0：供应 1：求购',
  `info_attr` text NOT NULL,
  `in_date` datetime NOT NULL,
  PRIMARY KEY (`send_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='记录会员商机订阅信息';

/*Data for the table `subscribeinfo` */

/*Table structure for table `substation` */

DROP TABLE IF EXISTS `substation`;

CREATE TABLE `substation` (
  `sub_id` int(8) NOT NULL AUTO_INCREMENT,
  `area_attr` varchar(100) NOT NULL,
  `sub_layout` varchar(50) NOT NULL,
  `sub_style` varchar(50) NOT NULL,
  `sort_no` varchar(10) NOT NULL,
  `info_state` varchar(4) NOT NULL,
  PRIMARY KEY (`sub_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

/*Data for the table `substation` */

/*Table structure for table `sysconfig` */

DROP TABLE IF EXISTS `sysconfig`;

CREATE TABLE `sysconfig` (
  `var_id` int(11) NOT NULL AUTO_INCREMENT,
  `var_name` varchar(20) DEFAULT NULL,
  `var_value` varchar(800) DEFAULT NULL,
  `var_desc` varchar(300) DEFAULT NULL,
  `var_group` char(1) DEFAULT NULL,
  `var_type` char(1) DEFAULT NULL,
  `val_sys` char(1) DEFAULT NULL,
  `module_type` varchar(10) DEFAULT NULL,
  PRIMARY KEY (`var_id`)
) ENGINE=InnoDB AUTO_INCREMENT=210 DEFAULT CHARSET=utf8;

