/*Table structure for table `terminal_data` */

DROP TABLE IF EXISTS `terminal_data`;

CREATE TABLE `terminal_data` (
  `model_name` varchar(10) NOT NULL DEFAULT '' COMMENT '数据名称',
  `record_no` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '已处理记录值'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='终端机处理记录表';

